8f9e8659-98d0-42c4-ab70-6506cb097e30	Установка Java в Ubuntu 18.04	Java;ubuntu;	Java - это очень популярный язык программирования, разработанный в компании Sun Microsystems. Сейчас Java используется для создания различных десктопных программ, веб-приложений, серверных приложений и многого другого. Основная особенность этого языка - это максимальная кроссплатформенность. Программа, написанная для одной системы, будет без проблем работать в другой. Но для программ, написанных на Java, нужна специальная Java-машина. Именно её мы будем сегодня устанавливать.\nВ этой статье мы рассмотрим, как выполняется установка Java Ubuntu 18.04 для разных версий программы. А также попытаемся разобраться во всём её многообразии.\nСодержание статьи:\nКакую версию Java выбрать?\nУстановка Java 8 в Ubuntu 18.04\n1. Как установить OpenJDK в Ubuntu\n2. Как установить Oracle Java в Ubuntu\nУстановка Java 11 в Ubuntu 18.04\n1. Установка OpenJDK 11\n2. Установка Oracle Java 11\nВыбор версии Java\nУдаление Java из Ubuntu\nВыводы\nКакую версию Java выбрать?\nСейчас разработкой Java занимается компания Oracle. До недавнего времени существовало две основных версии виртуальной машины Java:\nСтарая седьмая версия;\nНовая восьмая, используемая в большинстве программ.\nПлатформа распространялась в двух форматах:\nПроприетарном (Oracle Java) - с дополнительными возможностями и поддержкой;\nОткрытом (Open JDK) - полностью открытая версия.\nОбе платформы выпускались компанией Oracle, но вторая поддерживалась сообществом разработчиков, а первая самой компанией. Сейчас же ситуация немного изменилась. Теперь компания выпускает новую версию Java каждые пол года. Сначала вышла Java 9, 10, а затем 11 и длительность срока поддержки этих версий тоже короткая - всего семь месяцев. Поэтому большинство программ остались работать на Java 8, которая будет официально поддерживаться до 2020 года. Именно её и надо устанавливать в большинстве случаев.\nЕсли вы разработчик, и хотите получить самую свежую версию Java, то стоит устанавливать Java 11. Это LTS-версия, которая будет поддерживаться до 2026 года. В ней было очень много улучшений и изменений, как в плане синтаксиса, так и для распространения. Теперь проприетарная версия доступна бесплатно только для некоммерческого использования. Для коммерческих целей необходимо платить или же устанавливать OpenJDK.\nВ Ubuntu, да и в других дистрибутивах Java поставляется в двух редакциях:\nJDK\nили\nJava Development Kit\n- содержит полную версию Java, необходимую для разработки на этом языке;\nJRE\nили\nJava Runtime Environment\n- содержит только окружение для выполнения программ.\nЗдесь, я думаю, надо выбирать то, что вам нужно. Если нет необходимость что-то компилировать на Java, то будет достаточно JRE. А теперь перейдём к установке.\nУстановка Java 8 в Ubuntu 18.04\n1. Как установить OpenJDK в Ubuntu\nЕсли вы хотите установить OpenJDK в Ubutnu, то никаких сторонних репозиториев вам не нужно. Восьмая версия платформы есть в официальном репозитории Ubuntu 18.04. Чтобы установить jdk на Ubuntu используйте:\nsudo apt install openjdk-8-jdk\nДля установки JRE в Ubuntu выполните:\nsudo apt install openjdk-8-jre\nПосле этого вы можете проверить версию Java:\njava -version\n2. Как установить Oracle Java в Ubuntu\nДля установки проприетарной версии Oracle Java 8 нужно использовать PPA-репозиторий webupd8. Для его добавления используйте команду:\nsudo add-apt-repository ppa:webupd8team/java\nВо время добавления PPA-репозиторий выведет вам информационное сообщение со списком поддерживаемых систем и программ. Необходимо нажать\nEnter\n. Затем только возможна установка Oracle Java в Ubuntu:\nsudo apt install oracle-java8-installer\nВ процессе установки вам будет необходимо принять лицензионное соглашение.\nПосле этого проверьте правильность установки, посмотрев версию:\njava --version\nУстановка Java 11 в Ubuntu 18.04\n1. Установка OpenJDK 11\nJava 11 - это последняя на данный момент версия Java. Это версия с длительным сроком поддержки, поэтому она будет поддерживаться до 2026 года. Свободная версия есть в официальных репозиториях, поэтому вы можете её оттуда без проблем установить:\nsudo apt install openjdk-11-jdk\nИли же вы можете установить JRE-редакцию только для запуска программ:\nsudo apt install openjdk-11-jre\nДалее вы можете посмотреть версию:\njava -version\n2. Установка Oracle Java 11\nДля установки этой версии программы необходимо добавить уже другой репозиторий:\nsudo add-apt-repository ppa:linuxuprising/java\nЗатем запустите скрипт установщика. Он скачает пакет с сайта и установит его на ваш компьютер. Вам нужно будет только принять лицензию:\nsudo apt install oracle-java11-installer\nПроверьте версию Java:\njava -version\nВыбор версии Java\nЕсли вы установили несколько версий Java в систему, то вам нужно выбрать, какая из них будет использоваться по умолчанию. Для этого используется утилита update-java-alternatives. Для просмотра списка версий выполните:\nsudo update-java-alternatives --list\nЗатем установите нужную версию с помощью опции\n--set\n:\nsudo update-java-alternatives --set oracle-java-8\nУдаление Java из Ubuntu\nЧтобы удалить ненужную больше версию Java, используйте такую же команду, которую использовали для установки, только с опцией purge:\nsudo apt purge oracle-java11-installer\nsudo apt purge oracle-java8-installer\nsudo apt purge openjdk-11*\nsudo apt purge openjdk-8*\nЗатем вы можете удалить PPA-репозиторий:\nsudo add-apt-repository --remove ppa:linuxuprising/java\nsudo add-apt-repository ppa:webupd8team/java\nВыводы\nВ этой статье мы разобрали, как установить Java на Ubuntu 18.04. Я думаю, теперь вы знаете, какая версия вам нужна и как всё правильно установить. Надеюсь, информация из статьи была вам полезной.\nУстановка драйвера Nvidia в Ubuntu 18.04\nНоябрь 27, 2015\nУстановка VirtualBox в Ubuntu 18.04\nМай 25, 2016\nКак установить mc в Ubuntu 18.04\nИюнь 28, 2018\nНастройка Ubuntu Server после установки\nЯнварь 16, 2019\nОцените статью:\n3\n4,67\nTweet\nPin It\n	https://losst.ru/ustanovka-java-v-ubuntu-18-04	116
930c7b2d-2e2b-467e-af80-4bf60090b517	Лучшие игры для Linux 2019		В этой статье я хочу представить перевод статьи с ресурса fossmint.com про игры, поддерживающие Linux, которые выйдут в 2019 году. Прошедший год принёс очень много хороших новостей для любителей игр. Тенденция на увеличение количества игр для Linux наметилась еще в 2017 году, в 2018 она укрепилась и мы думаем, что всё лучшее ещё впереди.\nДавайте рассмотрим лучшие игры для Linux 2019, большинство из них ещё не доступны, но они выйдут в 2019 году. Возможно, вы найдёте то, что вам понравится в этом сезоне.\nСодержание статьи:\nЛучшие игры для Linux в 2019\n1. Mosaic\n2. Stoneshard\n3. Voxel Tycoon\n4. At the Gates\n5. The First Men\n6. Monster Crown\n7. Xenosis: Alien Infection\n8. Beyond Blue\n9. Tropico 6\n10. Life is Strange 2\n11. DiRT 4\n12. KURSK\n13. Serious Sam 4: Planet Badass\n14. Pathway\n15. Jupiter Hell\n16. Godhood\n17. Imperator: Rome\n18. Starmancer\n19. Eastshade\n20. We Happy Few\n21. Total War: THREE KINGDOMS\n22. Insurgency: Sandstorm\n23. Psychonauts 2\n24. Indivisible\n25. System Shock\n26. Off Grid\n27. Barotrauma\n28. Shadow of the Tomb Raider\n29. Hellpoint\n30. Overland\n31. In The Valley of Gods\nВыводы\nЛучшие игры для Linux в 2019\n1. Mosaic\nMosaic - это приключенческая трёхмерная игра в жанре хоррора с элементами 2D-головоломок от разработчиков Among the Sleep, Krillbire Studio.\n2. Stoneshard\nStoneshard - это пошаговая RPG, в которой вам предстоит исследовать огромный средневековый мир и управлять своим караваном, одновременно пытаясь выжить и сохранить рассудок. Отправляйтесь в эпическое путешествие и решите судьбу королевства в этом мрачном приключении!\n3. Voxel Tycoon\nVoxel Tycoon - это стратегическая игра, в которой вам предстоит быть строительным магнатом, создавать сложные системы, заводы и компании.\n4. At the Gates\nЭто инди-стратегия от Джона Шафера, дизайнера Civilization 5. Вы будете играть за лорда тёмных веков, которому поручено построить королевство вместо развалившейся Римской Империи. Вы будете управлять кланами и исследовать окружающие земли, чтобы развить экономику и военную мощь.\n5. The First Men\nЭто стратегия реального времени в вымышленном мире. Настраивайте своих Адама и Еву, сражайтесь лицом к лицу с другими расами, ведите дипломатические переговоры или войну, продвигайте первых людей.\n6. Monster Crown\nВ этой игре вам предстоит разводить монстров. Здесь есть динамическая система скрещивания и огромный мир. Вы можете брать существующих опасных животных и скрещивать их для получения новых видов.\n7. Xenosis: Alien Infection\nВ игре Xenosis: Alien Infection вы окажетесь охотником, который находится в глубоком космосе и только что обнаружил останки космического корабля, считающегося уничтоженным уже более 50 лет. Ядро данных, хранящееся в ИИ корабля будет стоить целое состояние на чёрном рынке, поэтому вы пристыковываетесь к разбитому кораблю, чтобы получить его.\n8. Beyond Blue\nBeyond Blue позволит игрокам исследовать тайны нашего океана глазами Мирари, лидера нового исследовательского отряда, в котором будут использоваться современные технологии, чтобы видеть, слышать и чувствовать океан лучше, чем когда либо. В игре будут воспоминания, элементы повествования, исследование нетронутого мира океана и приключения, которые заставят игрока принимать быстрые решения, где на кону будет жизнь экипажа.\n9. Tropico 6\nВ первые, за всю серию игр Tropico вы получите возможность управлять целыми архипелагами, строить мосты, чтобы объединить ваши владения, использовать новые средства передвижения и инфраструктуру. Отправляйте своих поданных в набеги, чтобы украсть чудеса света, в том числе Эйфелеву башню и Статую Свободы. Обставляйте свой дворец по своему желанию и произносите предвыборные речи со своего балкона чтобы завоевать благосклонность подданных.\n10. Life is Strange 2\nДва брата, Шон и Даниэль Диас, вынуждены бежать из дома после трагического инцидента в Сиэтле. В страхе перед полицией Шон и Даниэль отправляются в Мексику, пытаясь скрыть внезапную и таинственную сверхъестественную силу.\n11. DiRT 4\nВ DiRT 4 разработчики попытались объединить высокий уровень острых ощущений и реализма прошлогоднего DiRT Rally с доступностью и гонками на адреналине, знакомыми нам из предыдущих частей игры DiRT 2 и DiRT 3.\n12. KURSK\nKURSK - это первая приключенческая документальная игра, вдохновлённая реальными событиями. Вы берёте на себя роль шпиона, который проникает на российскую подводную атомную подводную лодку K-141 "Курск". Ваша задача собрать информацию о супер секретных торпедах "Шквал".\n13. Serious Sam 4: Planet Badass\nSerious Sam 4: Planet Badass - разработанная настоящими ветеранами шутеров, Croteam, возрождает классическую серию, улучшая старую формулу. Наслаждайтесь активным боем с высоким уровнем адреналина и невероятно разрушительным арсеналом. Испытайте культовый танец Сэма, уничтожающий врагов и заставляющий отступать.\n14. Pathway\nPathway - стратегическая приключенческая игра с пошаговым боем и уникальной сюжетной линией. Исследуйте храмы, гробницы и пустыню в большом приключении!\n15. Jupiter Hell\nJupiter Hell - это классическая игра в жанре научной фантастики девяностых годов. Убивайте демонов, зомби и чудовищ, используя дробовики, цепное оружие и надёжную бензопилу под сияние CRT-мониторов и мелодию хэви-метал.\n16. Godhood\nКак новорождённое божество, создайте и развивайте свою религию, осторожно управляя своими последователями. Ведите своих последователей к Таинству, пока другие божества и их последователи оспаривают твои притязания на власть и славу.\n17. Imperator: Rome\nImperator: Rome - это новейшая грандиозная стратегия от Paradox Development Studio. Время действия игры - бурные века от наследных империй Александра на Востоке до основания Римской империи.\n18. Starmancer\nStarmancer - это вдохновлённая Dwarf Fortress игра по строительству космических станций. После катастрофы на земле, человечество запускает программу Starmancer, чтобы найти убежище среди звёзд. Ваша задача состоит в том, чтобы построить колонию и управлять ей, способной поддерживать человеческую жизнь.\n19. Eastshade\nВы - путешествующий художник, исследующий остров Истсхейд. Запечатлите мир на холсте, используя мольберт художника. Поговорите с жителями, чтобы узнать об их жизни. Помогите нуждающимся. Посещайте города, встречи на высшем уровне, раскрывайте тайны и открывайте для себя забытые места.\n20. We Happy Few\nWe Happy Few - это рассказ об отважной группе людей, пытающихся вырваться из жизни весёлого отрицания в городе Веллингтон Уэллс. Это альтернативная вселенная Англии шестидесятых годов. Вам придётся сражаться или смешаться с наркоманами, большинство из которых не любит людей, которые не соблюдают их правила.\n21. Total War: THREE KINGDOMS\nTotal War: THREE KINGDOMS - это первая игра в этой популярной серии, которая воссоздаёт великий конфликт в Китае. Здесь сочетается захватывающая пошаговая кампания по строительству и завоеванию империи с потрясающими битвами в реальном времени.\n22. Insurgency: Sandstorm\nInsurgency: Sandstorm - это командная многопользовательская игра с опасным ближнем боем. Разработчики попытались развить и усовершенствовать идею Insurgency. Испытайте интенсивность современного боя, где мастерство вознаграждается, а командная работа побеждает в битве. В игре есть современное оружие, лёгкие боевые машины, разрушительная артиллерия и многое другое.\n23. Psychonauts 2\nВ Psychonauts 2 Раз реализует свою мечту и посещает штаб-квартиру психонавтов. Однако, когда он добирается туда, то понимает, что это не идеальное место, каким он себе все представлял. Он быстро понимает, что психонавты нуждаются в нём больше, чем он в них.\n24. Indivisible\nIndivisible - это новая ролевая игра в жанре экшен от Lab Zero, разработчика знаменитых Skullgirls. Находясь в огромном фэнтезийном мире, "Невидимый" рассказывает историю Аджны, добродушной девушки, которая отправляется на поиски, чтобы спасти всё, что она знает от уничтожения.\n25. System Shock\nСпустя два десятилетия Nightdive Studios обновляет и перевыпускает оригинальный System Shock. Разработчики обещают выполнить игру в соответствии с классическими представлениями, сохранить всё, что так понравилось игрокам, а также подарить игрокам современную графику и отличную игру.\n26. Off Grid\nOff Grid - стелс-игра от третьего лица, в которой информация - ваше самое мощное оружие. С этой игрой вы погрузитесь в мир битв за хакерские инструменты и изобретательность.\n27. Barotrauma\nПреодолевайте кризис и неумолимое давление замерзшего океана. Бегите или сражайтесь с инопланетными формами жизни, исследуйте новый мир на орбите Юпитера, управляйте своей командой и производите снаряжение. Всё это в данной 2D-игре.\n28. Shadow of the Tomb Raider\nВ этой игре вам предстоит пережить вместе с Ларой Кофт решающий момент в её жизни, когда она станет расхитительницей гробниц. В Shadow of the Tomb Raider Лара должна выжить в смертельных джунглях, пройти через гробницы и пережить свой самый тёмный час. Она начнёт своё путешествие, чтобы спасти мир от конца света Майя, а в конечном итоге превратится в расхитительницу гробниц, как ей и было суждено.\n29. Hellpoint\nHellpoint - это мрачная научно-фантастическая RPG-игра, действие которой происходит после большого квантового катаклизма. Все живые существа сошли с ума, потому что их тела и сознания были объединены с альтернативными версиями себя из параллельных вселенных. Авария также привлекла существ огромной силы, которые раньше находились в глубине других измерений.\n30. Overland\nOverland - это стратегическая игра с элементами выживания, действия которой происходят в постапокалиптической Северной Америке. Все уровни в игре сгенерированы процедурно, каждый из них наполнен тяжёлыми испытаниями и трудными решениями. Вам предстоит управлять запасами топлива и оружия, делая правильный выбор, чтобы завершить путешествие в самое сердце катастрофического события, которое навсегда изменило землю.\n31. In The Valley of Gods\nIn the Valley of Gods - это однопользовательская игра от первого лица, действие которой происходят в Египте 1920-тых годов. Вы играете за исследователя и режиссёра, который отправился в пустыню со своим давним партнёром, в надежде сделать невероятное открытие и снять фильм. Если вам нравятся игры с хорошо продуманным сюжетом, то эта игра для вас.\nВыводы\nНесмотря на то, что этот список очень обширный, он далеко не полный. Для Linux выйдет ещё больше игр в этом году и разместить их в одной статье невозможно. Вы рады, что все эти игры поддерживаются в Linux? Есть ли другие игры для Linux, которые официально выйдут для этой платформы в 2019 году? Напишите в комментариях!\nНет похожих записей\nОцените статью:\n9\n5,00\nTweet\nPin It\n	https://losst.ru/luchshie-igry-dlya-linux-2019	116
f301ae94-c546-41e6-ad35-145c46a29010	Команда sudo в Linux	ubuntu;	Если вы новый пользователь Linux, то, наверное, уже заметили, что здесь почти для всех серьёзных настроек или операций с системой нужны права суперпользователя. Пользователям Windows такой подход тоже должен быть знаком, когда вы устанавливаете программы или меняете системные настройки, операционная система просит подтвердить выполнение программы от имени администратора.\nВ Linux такой возможности нет, но зато есть команда sudo, которая позволяет вам запускать программы от имени других пользователей, а также от имени суперпользователя. На сайте уже есть несколько материалов про работу с ней, но нет подробной статьи про опции самой команды и её синтаксис. Эта тема и будет раскрыта сейчас. Дальше мы рассмотрим, что представляет из себя команда sudo Linux, но начнем с её синтаксиса.\nСодержание статьи:\nСинтаксис sudo\nОпции sudo\nПримеры использования sudo\n1. Запуск программы\n2. Переменные окружения\n3. Авторизация от имени другого пользователя\n4. Командный интерпретатор\n5. Редактирование файлов\n6. Запуск в фоне\n7. Просмотр полномочий\nВыводы\nСинтаксис sudo\nСинтаксис команды очень прост:\n$ sudo\nопции\nпрограмма\nпараметры\nТак вы можете выполнить абсолютно любую команду Linux. Достаточно написать перед ней команду sudo. По умолчанию sudo запускает переданную ей команду от имени суперпользователя. Если вы хотите добавить какие-либо настройки или использовать другого пользователя, нужно указывать опции.\nОпции sudo\n-A\nили\n--askpass\n- по умолчанию sudo спрашивает пароль пользователя в терминале. Если задана эта опция, утилита попробует использовать графическую утилиту для запроса пароля.\n-b\nили\n--background\n- запускает переданную программу в фоновом режиме;\n-C\nили\n--close-from\n- опции нужно передать число больше трёх. Она позволяет закрыть для программы все файловые дескрипторы, кроме стандартного ввода и вывода;\n-E\nили\n--preserve-env\n- позволяет передать переменные окружения текущего пользователя выполняемой программе. Также можно передать этой опции список переменных, которые нужно разрешить;\n-e\nили\n--edit\n- позволяет редактировать файл вместо запуска команды. Файл копируется во временный каталог, редактируется с помощью редактора, установленного в системе по умолчанию, и если были изменения, записывается обратно с теми самыми правами;\n-g\n- запустить команду с указанной группой вместо группы пользователя, от имени которого запускается программа;\n-h\n- выполнить команду от имени другого хоста;\n-H\nили\n--set-home\n- установить домашний каталог;\n-i\nили\n--login\n- позволяет авторизоваться в консоли от имени другого пользователя. Будет выбран его домашний каталог, а также загружены все переменные окружения;\n-k\n- по умолчанию, sudo сохраняет пароль и некоторое время после выполнения команды, вы можете выполнить ещё раз, без ввода пароля. Эта опция отключает такую возможность;\n-l\nили\n--list\n- позволяет вывести список доступных команд для удалённых пользователей;\n-n\nили\n--non-interactive\n- не интерактивный режим, если будет необходимо ввести пароль, программа выдаст ошибку;\n-p\nили\n--prompt\n- использовать своё приглашение для ввода пароля;\n-r\nили\n--role\n- выполнить программу с контекстом SELinux, у которого есть указанная роль;\n-S\n- использовать стандартный поток ошибок для запроса пароля;\n-s\nили\n--shell\n- позволяет запустить указанный командный интерпретатор;\n-U\nили\n--User\n- вместе с опцией -l позволяет посмотреть привилегии для пользователя;\n-T\nили\n--timeout\n- позволяет установить время выполнения команды, если время истечёт раньше, чем завершится команда, то она будет завершена принудительно;\n-u\n- позволяет указать, от имени какого пользователя нужно выполнять программу;\n-V\n- выводит версию утилиты;\n--\n- означает, что следующие опции обрабатывать не нужно.\nЭто основные опции, которые вы можете использовать. А теперь давайте перейдём к примерам использования команды.\nПримеры использования sudo\n1. Запуск программы\nСамый частый пример использования sudo - выполнение программы от имени суперпользователя. Для этого достаточно написать sudo перед именем программы:\nsudo whoami\nЕсли вы хотите выполнить программу не от имени root, а от имени другого пользователя, то можно использовать опцию -u, например:\nsudo -u sergiy whoami\n2. Переменные окружения\nПо умолчанию, команда sudo не передаёт запускаемой утилите переменные окружения текущего пользователя. А когда вы запускаете графическое приложение, то ему нужна переменная DISPLAY для доступа к графическому серверу. В последних версиях Ubuntu всё немного по другому, но все же эта возможность sudo актуальна. Чтобы передать переменные просто используйте опцию -E:\nsudo -E env\nБез опции -E программа получает только 18 стандартных переменных, а с опцией - все доступные.\nТакже вы можете указать список переменных, которые нужно передать:\n3. Авторизация от имени другого пользователя\nС помощью sudo вы также можете авторизоваться от имени другого пользователя. Для этого используйте опцию -i:\nsudo -i\nwhoami\nПо умолчанию вы будете авторизованы как суперпользователь. Ещё здесь можно указать пользователя, от имени которого вы хотите авторизоваться:\nsudo -i -u sergiy\nwhoami\n4. Командный интерпретатор\nЕсли у вас в системе установлено несколько командных интерпретаторов, например, не только bash, но и zsh, то вы можете авторизоваться от имени другого пользователя и указать, какую именно оболочку вы хотите использовать. Для этого укажите опция -s:\nsudo -s /bin/sh\n5. Редактирование файлов\nКогда вам необходимо отредактировать системный файл, вы пишите sudo vim или sudo nano. Вместо этого можно использовать опцию -e или команду sudoedit. Она открывает файл для редактирования, редактором, установленным в системе по умолчанию. Например, у меня это vim. Чтобы отредактировать /etc/group с правами суперпользователя достаточно выполнить:\nsudo -e /etc/group\nИли:\nsudoedit /etc/group\nУтилита узнает, каким редактором нужно пользоваться из переменной окружения EDITOR.\n6. Запуск в фоне\nЧтобы запустить программу в фоне с помощью sudo можно использовать опцию -b. Например, запускаем OpenVPN в фоновом режиме:\nsudo -b openvpn -с /путь/к/конфигурационному.файлу\n7. Просмотр полномочий\nВам необязательно редактировать конфигурационный файл, чтобы понять, какие настройки для sudo разрешены, а какие нет. Для этого можно выполнить команду с опцией -l. Утилита выведет список разрешённых команд или ALL в случае, если разрешено всё:\nsudo -l\nВыводы\nТеперь вы знаете, что из себя представляет команда sudo Linux. Здесь мы рассмотрели только общие примеры её использования. Если вы хотите прочитать более подробно про её настройку, смотрите статью\nнастройка sudo в Linux\n.\nКак редактировать файлы в Ubuntu\nОктябрь 26, 2016\nУстановка Ruby Ubuntu 16.04\nИюнь 12, 2017\nПереход с Windows на Linux\nАвгуст 7, 2018\nОцените статью:\n9\n4,44\nTweet\nPin It\n	https://losst.ru/komanda-sudo-v-linux	116
f18be119-1d41-4e3d-a5ea-4abc19a7f114	Что нового Ubuntu 19.04		Ubuntu 18.10 уже давно вышла, а значит, пришло время поговорить про следующую версию, которая появится уже совсем скоро - Ubuntu 19.04. Этот выпуск придёт на замену 18.10 и будет получать обновления следующие девять месяцев, поскольку это релиз с коротким сроком поддержки. Несмотря на то, что уже февраль и к финальному релизу осталось не так много времени, пока известно совсем немного о том, чего ждать от будущего релиза.\nПоэтому из сегодняшней статьи вы узнаете, когда запланирована дата выхода Ubuntu 19.04, а также её кодовое имя и несколько предположений об особенностях новой версии.\nСодержание статьи:\nДата выхода Ubuntu 19.04\nКодовое имя Ubuntu 19.04\nЧто нового в Ubuntu 19.04?\n1. Тема Yara будет поддерживать больше приложений\n2. GNOME 3.32 (ожидается)\n3. Ядро Linux 5.0 (ожидается)\n4. Другие изменения\nВыводы\nДата выхода Ubuntu 19.04\nСогласно\nофициальной вики\nпо Ubuntu дата релиза дистрибутива намечена на 18 апреля 2019 года. Важно отметить, что теперь альфа-релиза не будет, а в конце марта уже будет доступна для тестирования бета-версия. Вот более подробный график выхода:\n21 февраля 2019\n- заморозка добавления новых функций;\n14 марта 2019\n- заморозка изменений интерфейса;\n21 марта 2019\n- заморозка изменения документации;\n28 марта 2019\n- релиз финальной беты;\n4 апреля 2019\n- заморозка ядра;\n11 апреля 2019\n- финальная заморозка, выход кандидата в релизы;\n18 апреля 2019\n- финальный релиз.\nКонечно, в процессе разработки в эти сроки могут быть внесены коррективы и выход новой версии Ubuntu состоится чуть раньше или чуть позже.\nКодовое имя Ubuntu 19.04\nКак вы знаете, кодовое имя Ubuntu состоит из прилагательного и имени какого-либо вида животных, как правило, находящихся под угрозой вымирания. Причем оба слова начинаются на одну букву и каждый следующий релиз получает следующую букву в алфавите. Кодовым именем Ubuntu 18.10 было Cosmic Cuttlefish. А для Ubuntu 19.04 было выбрано имя на букву D - Disco Dingo.\nСлово Disco - скорее имя существительное, чем прилагательное, но, видимо, есть случаи, когда это слово может использоваться в качестве прилагательного. Dingo - это вид собак родом из Австралии. Это не вымирающий вид, но в то же время вполне реальное животное.\nЧто нового в Ubuntu 19.04?\nДистрибутив всё ещё находится на ранних стадиях разработки, поэтому о будущих нововведениях известно очень мало. Вот какая информация есть на данный момент.\n1. Тема Yara будет поддерживать больше приложений\nОдним из основных улучшений Ubuntu 19.04 было использование новой темы по умолчанию, которая называется Yaru. Однако эта тема не поддерживала иконки для большинства сторонних приложений. А оригинальные иконки приложений не очень хорошо подходили к внешнему виду темы. Теперь тема будет поддерживать больше иконок, что сделает внешний вид Ubuntu ещё лучше.\n2. GNOME 3.32 (ожидается)\nРелиз Gnome 3.32 состоится 19 марта. Вполне возможно, что Ubuntu 19.04 выйдет с этой версией Gnome, включая все её изменения и улучшения. Одно из самых заметных изменений в этой версии - это новый экран входа в систему. Можно предположить, что такой же экран входа будет использоваться и в Ubuntu:\nТакже Gnome 3.32 получит и другие улучшения, среди которых можно отметить возможность настройки уведомлений, звука и разрешений для каждого приложения отдельно, а также больше не будет глобального меню приложений, вообще. Всё, что было в глобальном меню приложений Gnome, теперь будет отображаться при нажатии на кнопку бутерброда:\nМеню других приложений будут отображаться в окне, как обычно.\n3. Ядро Linux 5.0 (ожидается)\nКак и Gnome 3.32, новое ядро будет выпущено в конце цикла разработки Ubuntu 19.04, и поэтому оно будет отличным кандидатом на включение в релиз.\n4. Другие изменения\nЕщё в Ubuntu 18.10 планировалось добавить поддержку подключения Android-устройств по сети к системе с помощью GSconnect. Но эта возможность была отложена до Ubuntu 19.04. Но увы, в этой версии системы GSconnect тоже не будет.\nТакже в Ubuntu 19.04 планировалось улучшить внешний вид центра приложений: сделать его более удобным и современным. Но, похоже, этому тоже не судьба сбыться. В финальный релиз попадут только несколько улучшений.\nВероятно, в Ubuntu 19.04 будут добавлены патчи производительности для ускорения работы графической оболочки, а также Gnome Shell будет лучше работать на устройствах с сенсорным экраном.\nНу и, конечно, будут новые обои рабочего стола с изображением талисмана этого релиза.\nВыводы\nДата выхода Ubuntu 19.04 намечена на середину апреля 2019 года. До этого момента осталось ещё несколько месяцев, но дата заморозки добавления новых возможностей уже совсем скоро, поэтому разработчики вряд ли успеют добавить ещё что-то новое. Вы можете уже\nскачать\nежедневную сборку, установить её на свой компьютер и посмотреть, что нового в Ubuntu 19.04 есть на данный момент.\nСтатья написана на основе информации из\nitsfoss.com\nНет похожих записей\nОцените статью:\n11\n4,64\nTweet\nPin It\n	https://losst.ru/chto-novogo-ubuntu-19-04	116
ababbb67-eef9-4d74-920c-68ff24df27e8	Установка MariaDB в Ubuntu 18.04	mysql;ubuntu;	MariaDB - это очень популярная система управления базами данных, которая пришла на смену MySQL. Фактически, это одно и то же программное обеспечение, только MariaDB развивается открытым сообществом разработчиков и автором MySQL, а разработкой MySQL занимается компания Oracle. Следовательно, MariaDB чаще обновляется, раньше получает новые возможности и заплатки проблем с безопасностью.\nПоэтому MariaDB заменила MySQL во многих дистрибутивах и теперь поставляется по умолчанию. Но не в Ubuntu. Если вам нужно установить MariaDB Ubuntu, то необходимо устанавливать именно её пакет, иначе установится база данных от Oracle. В этой статье мы рассмотрим, как установить и настроить MariaDB.\nСодержание статьи:\nУстановка MariaDB в Ubuntu 18.04\nНастройка MariaDB в Ubuntu\nКак удалить MariaDB из Ubuntu\nВыводы\nУстановка MariaDB в Ubuntu 18.04\nMariaDB есть в официальных репозиториях Ubuntu, и если вам нужна стабильная версия, то лучше устанавливать её именно оттуда. Для этого выполните:\nsudo apt install mariadb-server mariadb-client\nСейчас в репозиториях Ubuntu 18.04 поставляется версия 10.1. Но уже давно состоялся релиз MariaDB 10.3, и готовится к выпуску 10.4. Если вы хотите установить эти версии, вам придётся использовать репозиторий разработчиков.\nДля получения ссылки на репозиторий откройте\nофициальный сайт\n, выберите ваш дистрибутив, выберите версию дистрибутива, а затем желаемую версию MariaDB:\nЗатем прокрутите страницу вниз и скопируйте  команды добавления репозитория:\nДля Ubuntu 18.04 надо выполнить три команды:\nsudo apt-get install software-properties-common\nsudo apt-key adv --recv-keys --keyserver hkp://keyserver.ubuntu.com:80 0xF1656F24C74CD1D8\nsudo add-apt-repository 'deb [arch=amd64,arm64,ppc64el] http://mirror.mephi.ru/mariadb/repo/10.3/ubuntu bionic main'\nЗатем обновим списки репозиториев и установим MariaDB Ubuntu нужной версии:\nsudo apt install mariadb-server mariadb-client\nВо время установки программа предложит нам задать пароль для суперпользователя базы данных. Пароль нужно ввести два раза:\nПосле того, как установка будет завершена, проверяем запущена ли база данных:\nsudo systemctl status mariadb\nТеперь можно переходить к настройке MariaDB.\nНастройка MariaDB в Ubuntu\nСразу после установки MariaDB ещё не готова к работе. Для обеспечения её безопасности необходимо выполнить команду:\nsudo mysql_secure_installation\nСначала надо ввести пароль суперпользователя, который вы задали при установке MariaDB:\nЗатем можно поменять пароль, но если он вас устраивает, нажмите\nn.\nВо всех следующих пунктах нужно нажимать\nY\n. Утилита отключит анонимный вход, запретит удалённую авторизацию для суперпользователя, удалит временные таблицы и перезагрузит настройки полномочий:\nТеперь база данных готова к работе. Давайте создадим первую базу данных. Чтобы запустить клиент, выполните в терминале:\nmysql -u root -p\nДля создания базы данных с именем test_database выполните:\nCREATE DATABASE test_database;\nЗатем необходимо создать пользователя и дать ему все права на эту базу данных, чтобы ваше приложение могло с ней работать:\nCREATE USER 'test_user' IDENTIFIED BY 'password';\nУ нашего пользователя имя text_user и пароль password. Теперь дадим ему права на нашу базу данных:\nGRANT ALL ON *.* TO 'test_user'@localhost IDENTIFIED BY 'password';\nДальше вы можете использовать этого пользователя и эту базу данных в своих приложениях. Работать в командной строке MariaDB не очень удобно, поэтому, если вам надо создавать много пользователей и таблиц,\nустановите Phpmyadmin\n.\nКак удалить MariaDB из Ubuntu\nЧтобы удалить MariaDB Ubuntu, достаточно использовать команду:\nsudo apt purge mariadb-server mariadb-client\nЗатем очистите систему от пакетов, которые установились автоматически:\nsudo apt autoremove\nИ можно удалить файлы базы данных, которые находятся по адресу /var/lib/mysql/\nsudo rm -Rf /var/lib/mysql\nВыводы\nВ этой статье мы разобрали, как выполняется установка MariaDB Ubuntu 18.04. Как видите, процесс практически не отличается от установки MySQL, только здесь не нужно задавать пароль. Если вам нужна база данных с поддержкой всех самых современных возможностей и нововведений, обязательно следует выбрать MariaDB. А что вы предпочитаете, MariaDB или MySQL?\nУстановка Phpmyadmin Ubuntu 18.04\nЯнварь 30, 2019\nОбновление Kubuntu до 16.04\nЯнварь 26, 2016\nУстановка Chromium Ubuntu 16.04\nОктябрь 28, 2016\nУдаленный рабочий стол ubuntu 16.04\nЯнварь 24, 2017\nОцените статью:\n2\n5,00\nTweet\nPin It\n	https://losst.ru/ustanovka-mariadb-v-ubuntu-18-04	116
e2a26292-2506-4456-8bbc-b5d2ab4b7e35	Создание пользователя MySQL		После того, как вы установили и настроили MySQL, вам необходимо создать базы данных, таблицы и пользователей. Конечно, вы можете сделать это от имени  суперпользователя root, но это не безопасно. Да и большинство приложений не позволят вам такой вольности, например, Phpmyadmin не даст авториrзоваться от имени суперпользователя.\nПоэтому для каждой базы данных нужно создавать отдельных пользователей и настраивать для них права. В этой статье мы рассмотрим, как выполняется создание пользователя mysql, а также настройка его прав.\nСодержание статьи:\nСоздание пользователя mysql\n1. Как создать пользователя MySQL\n2. Права пользователя MySQL\n3. Удаление прав пользователя MySQL\n4. Создание суперпользователя MySQL\nВыводы\nСоздание пользователя mysql\n1. Как создать пользователя MySQL\nПредположим, что база данных уже создана и называется test_database. Нам нужно открыть клиент базы данных. Для этого наберите в терминале:\nmysql -u root -p\nТеперь можно работать. Для создания пользователя используется команда CREATE USER, её синтаксис такой:\nCREATE USER\n'имя_пользователя'\n@\n'хост'\nIDENTIFIED BY\n'пароль'\n;\nКроме имени пользователя, здесь нужно задать хост, с которого может авторизоваться этот пользователь. Здесь может быть доменное имя, IP-адрес, адрес подсети или знак "%", который означает все возможные хосты. Это очень удобно, потому что вы можете создать пользователя, к которому можно будет подключится только локально или настроить отдельно права для локального или удалённого пользователя.\nНапример, давайте создадим локального пользователя test_user с паролем password:\nCREATE USER 'test_user'@'localhost' IDENTIFIED BY 'password';\nИли можно создать пользователя, который будет доступен со всех хостов:\nCREATE USER 'test_user'@'%' IDENTIFIED BY 'password';\nСмотрим наших пользователей:\nSELECT User,Host FROM mysql.user;\nВсе пользователи созданы.\n2. Права пользователя MySQL\nСоздать пользователя - это ещё далеко не всё, теперь нужно назначить ему права. Для этого используется команда GRAT. У неё такой синтаксис:\nGRANT\nпривилегии\nON\nбаза_данных\n.\nтаблица\nTO\n'\nимя_пользователя\n'\n@\n'\nхост\n'\n;\nЗдесь можем дать определённые привилегии для опредёленного пользователя к базе данных или таблице. Если нужно дать права для всех баз данных или таблиц, используйте вместо названия звездочку - "*". Вот основные права пользователя MySQL, которые вы можете использовать:\nALL PRIVILEGES\n- все, кроме GRANT;\nUSAGE PRIVILEGES\n- никаких привилегий;\nSELECT\n- делать выборки из таблиц;\nINSERT\n- вставлять данные в таблицу;\nUPDATE\n- обновлять данные в таблице;\nDELETE\n- удалять данные из таблицы;\nFILE\n- разрешает читать файлы на сервере;\nCREATE\n- создавать таблицы или базы данных;\nALTER\n- изменять структуру таблиц;\nINDEX\n- создавать индексы для таблиц;\nDROP\n- удалять таблицы;\nEVENT\n- обработка событий;\nTRIGGER\n- создание триггеров.\nТакже доступны такие привилегии администрирования баз данных:\nGRANT\n- изменять права пользователей;\nSUPER\n- суперпользователь;\nPROCESS\n- получение информации о состоянии MySQL;\nRELOAD\n- позволяет перезагружать таблицы привилегий;\nSHUTDOWN\n- позволяет отключать или перезапускать базу данных;\nSHOW DATABASES\n- просмотр списка баз данных;\nLOCK TABLES\n- блокирование таблиц при использовании SELECT;\nREFERENCES\n- создание внешних ключей для связывания таблиц;\nCREATE USER\n- создание пользователей;\nЧтобы дать права пользователю MySQL на обновление и добавление записей для базы данных test_database, выполните:\nGRANT SELECT,UPDATE,INSERT ON test_database . * TO 'test_user'@'localhost';\nДальше дадим этому же пользователю все права над этой базой данных:\nGRANT ALL PRIVILEGES ON test_database . * TO 'test_user'@'localhost';\nТеперь посмотрим привилегии нашего пользователя:\nSHOW GRANTS FOR 'test_user'@'localhost';\nМы видим, что для всех баз данных и таблиц привелегий нет, но зато есть все привилегии для базы данных test_database. Вот так это работает. После обновления прав пользователя необходимо обновить таблицу прав пользователей MySQL  в памяти. Для этого выполните:\nFLUSH PRIVILEGES;\n3. Удаление прав пользователя MySQL\nЧтобы отозвать права у пользователя MySQL, используйте команду REVOKE вместо GRANT. Её синтаксис похож на GRANT:\nREVOKE\nпривилегии\nON\nбаза_данных\n.\nтаблица\nFROM\n'\nимя_пользователя\n'\n@\n'\nхост\n'\n;\nНапример, заберём все права на базу данных test_database у нашего пользователя:\nREVOKE ALL PRIVILEGES ON test_database . * FROM 'test_user'@'localhost';\n4. Создание суперпользователя MySQL\nЕсли вам необходимо создать пользователя со всеми правами MySQL на замену для root, то можно использовать такую конструкцию:\nGRANT ALL PRIVILEGES ON * . * TO 'test_user'@'localhost';\nДаём все привилегии для пользователя test_user над всеми базами данными и всеми таблицами. Но наш пользователь не сможет давать права другим пользователям. Чтобы это исправить, нужно дать ему привилегию GRANT, а для этого используется такая команда:\nGRANT ALL PRIVILEGES ON * . * TO 'test_user'@'localhost' WITH GRANT OPTION;\nТеперь этот пользователь является суперпользователем для MySQL и, авторизовавшись от его имени в PhpMyAdmin, вы можете делать всё то же самое, что и с  помощью root.\nВыводы\nВ этой статье мы рассмотрели, как создать пользователя MySQL в  Ubuntu или в любом другом дистрибутиве. Работа в командной строке с MySQL может показаться довольно сложной. Но сделать это надо всего один раз -после установки базы данных. А дальше можно выполнять все действия в Phpmyadmin.\nНет похожих записей\nОцените статью:\n4\n5,00\nTweet\nPin It\n	https://losst.ru/sozdanie-polzovatelya-mysql	116
790b3e83-3a5b-4b35-b75c-53cd1b933988	Установка Phpmyadmin Ubuntu 18.04	mysql;php;ubuntu;	Phpmyadmin - это очень простой и удобный инструмент для управления базами данных MySQL. Он позволяет создавать и редактировать таблицы, вносить в них данные, администрировать пользователей баз данных, а также экспортировать и импортировать записи и структуру таблиц из базы данных.\nВсё это можно делать в простом веб-интерфейсе. В этой статье мы рассмотрим, как выполняется установка Phpmyadmin Ubuntu 18.04 с веб-сервером Apache. Я предполагаю, что такие компоненты, как Apache, MySQL и PHP у вас уже установлены. Если ещё нет, то сначала посмотрите статью\nустановка LAMP Ubuntu 18.04\n.\nСодержание статьи:\nУстановка Phpmyadmin в Ubuntu 18.04\nНастройка Phpmyadmin Ubuntu 18.04\n1. Создание пользователя для Phpmyadmin\n2. Защита Phpmyadmin\nКак удалить Phpmyadmin ubuntu\nВыводы\nУстановка Phpmyadmin в Ubuntu 18.04\nПрежде чем мы сможем установить Phpmyadmin на Ubuntu, нужно убедиться, что у вас установлено расширение php для работы с текстовыми строками в формате юникода. Для его установки выполните в терминале:\nsudo apt install php-mbstring\nТеперь можно установить Phpmyadmin Ubuntu 18.04:\nsudo apt install phpmyadmin\nУстановщик спросит вас, какой веб-сервер будет использоваться для работы программы. Отметьте с помощью кнопки\nПробел\nпункт\napache2\n, а затем с помощью\nTab\nи\nEnter\nнажмите кнопку\nОк\n:\nДалее установщик предложит создать базу данных для Phpmyadmin, там будет служебная информация программы, мы к ней отношения иметь не будем, соглашаемся:\nНа следующем этапе надо придумать пароль для пользователя Phpmyadmin, который будет использоваться программой для доступа к её базе данных, его мы тоже никогда использовать не будем:\nПосле этого установка Phpmyadmin Ubuntu завершена.\nНастройка Phpmyadmin Ubuntu 18.04\nТеперь Phpmyadmin будет доступен по адресу\nip_вашего_сервера/phpmyadmin\n. Вы можете проверить, всё ли работает, просто открыв этот адрес в браузере:\n1. Создание пользователя для Phpmyadmin\nПо умолчанию, вы не сможете авторизоваться в Phpmyadmin от пользователя root, поэтому что у программы есть такая мера безопасности. Отключить ее можно, но не всегда это работает и не всегда так, как нам нужно. Поэтому проще создать нового пользователя со всеми теми же возможностями, что и у root.\nДля этого откройте консоль MySQL и выполните там такие команды:\nsudo mysql\n> CREATE USER 'admin'@'localhost' IDENTIFIED BY 'пароль';\n> GRANT ALL PRIVILEGES ON *.* TO 'admin'@'localhost' WITH GRANT OPTION;\n> FLUSH PRIVILEGES;\nМы создали пользователя с именем admin и паролем "пароль". Вторая команда выдает этому пользователю права на все базы данных, а также даёт возможность изменять полномочия других пользователей, а третья обновляет таблицы привилегий. Теперь попробуйте авторизоваться в Phpmyadmin:\n2. Защита Phpmyadmin\nЕсли ваш Phpmyadmin установлен на производственном сервере, который доступен из сети, то, возможно, есть смысл создать для него дополнительный уровень защиты, добавив авторизацию. Для этого создайте файл /usr/share/phpmyadmin/.htaccess со следующим содержимым:\nsudo vi /usr/share/phpmyadmin/.htaccess\nAuthType Basic\nAuthName "Restricted Files"\nAuthUserFile /etc/phpmyadmin/.htpasswd\nRequire valid-user\nВот что значат эти строки:\nAuthType Basic\n- устанавливает тип аутентификации, мы указываем, что будем использовать пароль;\nAuthName\n- задает сообщение, которое будет видеть пользователь;\nAuthUserFile\n- файл, откуда программа будет брать имена пользователей и пароли;\nRequire\n- указываем, что аутентификация обязательна.\nЗатем создайте новый пароль для своего пользователя:\nsudo htpasswd -c /etc/phpmyadmin/.htpasswd пользователь\nЧтобы настройки из файла .htaccess заработали в этой папке, необходимо, чтобы для неё в файле /etc/apache2/apache2.conf значение AllowOverride было All:\nsudo vi /etc/apache/apache2.conf\n<Directory /usr/share>\nAllowOverride All\nRequire all granted\n</Directory>\nТеперь, если вы попытаетесь открыть Phpmyadmin, вам нужно будет авторизоваться:\nКак удалить Phpmyadmin ubuntu\nЧтобы удалить Phpmyadmin Ubuntu, достаточно выполнить такую команду:\nsudo apt purge phpmyadmin\nВыводы\nВ этой небольшой статье мы рассмотрели, как выполняется установка и настройка Phpmyadmin Ubuntu 18.04. Как видите, всё стало намного проще, чем в предыдущих версиях, когда нам нужно было вручную включать различные модули и настраивать местоположение файлов программы.\nУстановка php 7 в Ubuntu\nИюль 24, 2017\nУстановка MariaDB в Ubuntu 18.04\nФевраль 4, 2019\nУскорение Ubuntu 16.04\nОктябрь 28, 2016\nУстановка кодеков в Ubuntu 18.04\nИюнь 12, 2018\nОцените статью:\n1\n5,00\nTweet\nPin It\n	https://losst.ru/ustanovka-phpmyadmin-ubuntu-18-04	116
1c474496-c349-4a96-80f8-ca9bf7058f33	Настройка UFW Ubuntu	безопасность;сеть;	Во всех дистрибутивах Linux для обеспечения сетевой безопасности и изоляции внутренних процессов от внешней среды используется брандмауэр iptables. Но его настройка может показаться очень сложной для новых пользователей, поэтому многие дистрибутивы создают собственные оболочки, которые упрощают процесс настройки.\nВ Ubuntu используется оболочка под названием UFW или  Uncomplicated FireWall. В этой статье мы разберём, как выполняется настройка UFW Ubuntu, а также как пользоваться основными возможностями этой программы.\nСодержание статьи:\nКоманда UFW Ubuntu\n1. Синтаксис ufw\n2. Команды UFW\nНастройка UFW Ubuntu\n1. Как включить UFW\n2. Политика по умолчанию\n3. Добавление правил UFW\n4. Правила limit ufw\n5. Просмотр состояния UFW\n6. Удаление правил ufw\n7. Логгирование в ufw\n8. Отключение UFW\nВыводы\nКоманда UFW Ubuntu\n1. Синтаксис ufw\nДля управления возможностями брандмауэра используется одноимённая команда - ufw. Давайте сначала рассмотрим её опции и параметры, а потом перейдём к настройке. Синтаксис команды такой:\n$ ufw\nопции\nдействие\nпараметры\nОпции определяют общие настройки поведения утилиты, действие указывает, что нужно сделать, а параметры - дополнительные сведения для действия, например, IP-адрес или номер порта.\nСначала разберём опции утилиты:\n--version\n- вывести версию брандмауэра;\n--dry-run\n- тестовый запуск, никакие реальные действия не выполняются.\n2. Команды UFW\nДля выполнения действий с утилитой доступны такие команды:\nenable\n- включить фаерволл и добавить его в автозагрузку;\ndisable\n- отключить фаерволл и удалить его из автозагрузки;\nreload\n- перезагрузить файервол;\ndefault\n- задать политику по умолчанию, доступно allow, deny и reject, а также три вида трафика - incoming, outgoing или routed;\nlogging\n- включить журналирование или изменить уровень подробности;\nreset\n- сбросить все настройки до состояния по умолчанию;\nstatus\n- посмотреть состояние фаервола;\nshow\n- посмотреть один из отчётов о работе;\nallow\n- добавить разрешающее правило;\ndeny\n- добавить запрещающее правило;\nreject\n- добавить отбрасывающее правило;\nlimit\n- добавить лимитирующее правило;\ndelete\n- удалить правило;\ninsert\n- вставить правило.\nЭто были все опции и команды, которые вы можете использовать в ufw. Как видите, их намного меньше, чем в iptables и всё выглядит намного проще, а теперь давайте рассмотрим несколько примеров настройки.\nНастройка UFW Ubuntu\n1. Как включить UFW\nСначала нужно отметить, что в серверной версии Ubuntu UFW по умолчанию включён, а в версии для рабочего стола он отключён. Поэтому сначала смотрим состояние фаервола:\nsudo ufw status\nЕсли он не включён, то его необходимо включить:\nsudo ufw enable\nЗатем вы можете снова посмотреть состояние:\nsudo ufw status\nОбратите внимание, что если вы работаете по SSH, то перед тем, как включать брандмауэр, нужно добавить правило, разрешающее работу по SSH, иначе у вас не будет доступа к серверу. Подождите с включением до пункта 3.\n2. Политика по умолчанию\nПеред тем, как мы перейдём к добавлению правил, необходимо указать политику по умолчанию. Какие действия будут применяться к пакетам, если они не подпадают под созданные правила ufw. Все входящие пакеты будем отклонять:\nsudo ufw default deny incoming\nА все исходящие разрешим:\nsudo ufw default allow outgoing\n3. Добавление правил UFW\nЧтобы создать разрешающее правило, используется команда allow. Вместо allow могут использоваться и запрещающие правила ufw - deny и reject. Они отличаются тем, что для deny компьютер отсылает отправителю пакет с уведомлением об ошибке, а для reject просто отбрасывает пакет и ничего не отсылает. Для добавления правил можно использовать простой синтаксис:\n$ ufw\nallow\nимя_службы\n$ ufw\nallow\nпорт\n$ ufw\nallow\nпорт/протокол\nНапример, чтобы открыть порт ufw для SSH, можно добавить одно из этих правил:\nsudo ufw allow OpenSSH\nsudo ufw allow 22\nsudo ufw allow 22/tcp\nПервое и второе правила разрешают входящие и исходящие подключения к порту 22 для любого протокола, третье правило разрешает входящие и исходящие подключения для порта 22 только по протоколу tcp.\nПосмотреть доступные имена приложений можно с помощью команды:\nsudo ufw app list\nМожно также указать направление следования трафика с помощью слов out для исходящего и in для входящего.\n$ ufw\nallow\nнаправление\nпорт\nНапример, разрешим только исходящий трафик на порт 80, а входящий запретим:\nsudo ufw allow out 80/tcp\nsudo ufw deny in 80/tcp\nТакже можно использовать более полный синтаксис добавления правил:\n$ ufw\nallow\nproto\nпротокол\nfrom\nip_источника\nto\nip_назначения\nport\nпорт_назначения\nВ качестве ip_источника может использоваться также и адрес подсети. Например, разрешим доступ со всех IP-адресов для интерфейса eth0 по протоколу tcp к нашему IP-адресу и порту 3318:\nsudo ufw allow proto tcp from 0.0.0.0/24 to 192.168.1.5 port 3318\n4. Правила limit ufw\nС помощью правил limit можно ограничить количество подключений к определённому порту с одного IP-адреса, это может быть полезно для защиты от атак перебора паролей. По умолчанию подключения блокируются, если пользователь пытается создать шесть и больше подключений за 30 секунд:\nsudo ufw limit ssh/tcp\nК сожалению, настроить время и количество запросов можно только через iptables.\n5. Просмотр состояния UFW\nПосмотреть состояние и действующие на данный момент правила можно командой status:\nsudo ufw status\nЧтобы получить более подробную информацию, используйте параметр verbose:\nsudo ufw status verbose\nС помощью команды show можно посмотреть разные отчеты:\nraw\n- все активные правила в формате iptables;\nbuiltins\n- правила, добавленные по умолчанию;\nbefore-rules\n- правила, которые выполняются перед принятием пакета;\nuser-rules\n- правила, добавленные пользователем;\nafter-rules\n- правила, которые выполняются после принятия пакета;\nlogging-rules\n- правила логгирования пакетов;\nlistening\n- отображает все прослушиваемые порты и правила для них;\nadded\n- недавно добавленные правила;\nНапример, посмотрим список всех правил iptables:\nsudo ufw show raw\nПосмотрим все прослушиваемые порты:\nsudo ufw show listening\nИли недавно добавленные правила:\nsudo ufw show added\n6. Удаление правил ufw\nЧтобы удалить правило ufw, используется команда delete. Например, удалим ранее созданные правила для порта 80:\nsudo ufw delete allow out 80/tcp\nsudo ufw delete deny in 80/tcp\n7. Логгирование в ufw\nЧтобы отлаживать работу ufw, могут понадобится журналы работы брандмауэра. Для включения журналирования используется команда logging:\nsudo ufw logging on\nsudo ufw logging medium\nТакже этой командой можно изменить уровень логгирования:\nlow\n- минимальный, только заблокированные пакеты;\nmedium\n- средний, заблокированные и разрешённые пакеты;\nhigh\n- высокий.\nЛог сохраняется в папке /var/log/ufw. Каждая строчка лога имеет такой синтаксис:\n[UFW действие] IN=интерфейс OUT=итерфейс SRC=ip_источника DST=ip_назначения LEN=размер_пакета TOS=0x10 PREC=0x00 TTL=64 ID=728 DF PROTO=протокол SPT=порт_источника DPT=порт назначения LEN=размер_пакета\nВ качестве действия приводится то, что UFW сделал с пакетом, например ALLOW, BLOCK или AUDIT. Благодаря анализу лога настройка UFW Ubuntu станет гораздо проще.\n8. Отключение UFW\nЕсли вы хотите полностью отключить UFW, для этого достаточно использовать команду disable:\nsudo ufw disable\nТакже, если вы что-то испортили в настройках и не знаете как исправить, можно использовать команду reset для сброса настроек до состояния по умолчанию:\nsudo ufw reset\nВыводы\nВ этой небольшой статье мы разобрали, как настроить UFW Ubuntu для защиты вашего компьютера от угроз из сети. Это особенно актуально для серверов, потому что они постоянно доступны из интернета.\nПесочница программ Linux\nНоябрь 18, 2016\nКак установить ClamAV в Ubuntu\nЯнварь 10, 2017\nШифрование usb флешки\nАвгуст 5, 2017\nЗащита сайта от sql инъекций\nСентябрь 29, 2017\nОцените статью:\n4\n5,00\nTweet\nPin It\n	https://losst.ru/nastrojka-ufw-ubuntu	116
cb7dc560-3f56-4ee2-ba95-6fad8dbfea1c	Виртуальные машины Qubes OS		В предыдущей\nчасти статьи о Qubes OS 4\nбыли разобраны установка, первичная настройка, обновление и установка программ и особенности работы с файлами.\nВ данной статье считаю необходимым разобрать работу с виртуальными машинами Qubes VM, которые в терминологии Qubes OS называются просто\nqube\n.\nСодержание статьи:\nТипы и назначение Qubes VM\n1. TemplateVM\n2. sys-net, sys-usb, sys-firewall\n3. Personal work qube\nУправление виртуальными машинами Qubes\n4. Как создать qube\n5. Копирование виртуальных машин\n6. Удаление Qube\nЗаключение\nТипы и назначение Qubes VM\n1. TemplateVM\nИсходя из названия становится понятно, что это шаблонные qube. То есть это базовые виртуальные системы на которых основываются все остальные. Именно в TemplateVM происходит обновление и установка приложений, производятся низкоуровневые настройки. При удалении TemplateVM все основанные на ней qube будут так же удалены. При копировании TemplateVM будет создана аналогичная, с тем же набором установленных приложений. Позже на копиях TemplateVM'ов можно делать отдельные qube с разным набором приложений. Об этом ниже.\n2. sys-net, sys-usb, sys-firewall\nЭто так называемые\nNetVM\n, виртуальные машины отвечающие за управление различными подсистемами и регулирующие доступ остальных qube с соотвествующим интерфейсам. Из названий понятно, что:\nsys-net\n- отвечает за сетевое соединение, как правило к ней обращается только\nsys-firewall\n, но можно настроить доступ и без него, но это тема для отдельной статьи.\nsys-firewall\nможно сказать главная NetVM именно она определяет правила и разрешения для всех остальных qube. На их основе невозможно создать новый qube. При копировании можно внести отдельные настройки для каждой, т.е. можно создать несколько системных файрволлов.\nsys-usb\nотвечает за изолирование разъемов USB от остальных qube. В ней можно обратится к подключенным к USB накопителям без монтирования их в другие VM. Копировать и настраивать одельно можно только для управления оттдельными USB портами в каждой машине, иногда это полезно.\n3. Personal work qube\nЭто то чем нам, обычным пользователям, можно и нужно пользоваться для своих целей, таких серфинг в сети, хранение файлов, работа и так далее. Их можно создать бесконечно много для абсолютно любых целей. Так же можно безболезненно удалять, системе это не навредит. Так же их можно визуально настраивать.\nОтдельно стоит отметить установку программ в personal qube, если выполнить установку пакета напрямую в обход TemplateVM, то после перезапуска personal qube приложения и данные будут полностью удалены, тоже относится к репозиториям. Так что получается своеобразная песочница для тестирования программ.\nУправление виртуальными машинами Qubes\n4. Как создать qube\nНаиболее простым будет способ создания через графический интерфейс. В меню выбираем\nCreate Qubes VM.\nВ появившемся окне в графе:\nName and label:\nвводим имя новой qube. В моем случае debian-workspace. Выбираем желаемый цвет.\nType:\nAppVM (остальные варианты это предмет отдельной статьи и будет разобран позже).\nTemplate:\nвыбираем из списка шаблонную систему на базе которой будет создана ваша AppVM. В моем случае debian-9.\nNetworking:\nпо умолчанию выбран sys-firewall. Его рекомендую и оставить для базовой рабочей среды. Так же можно выбрать sys-whonix тогда трафик будет пропускаться через Tor.\nПараметры advanced: provides network\nне включаем для базовой рабочей среды. Этот параметр отвечает за раздачу сетевого соединения другим VM.\nlaunch settings after creation\n- запускает настройки qube после создания, включаем по желанию.\nКак видите, все достаточно просто. После завершения в меню и Qube Manager появится ваша новая AppVM.\nЕще можно выполнить данную операцию через консоль, отвечает за это команда\nqvm-create\n, она имеет достаточно простой синтаксис. Для того что бы создать стандартную AppVM на базе debian в консоль Dom0 нужно ввести:\nqvm-create --template=debian-9 #или любой установленной template VM# --label=<выбираем цвет red, blue, yellow и т.д.> <имя новой VM>\nПолный синтаксис команды требует отдельного описания и в этой статье рассмотрен не будет, в прочем по запросу --help выдается подробная справка.\n5. Копирование виртуальных машин\nДля копирования qube AppVM в графическом режиме необходимо открыть\nQube Manager\nнаходящийся в\nSystem Tools\n, выбрать целевую VM для копирования и в меню ПКМ выбрать\nClone\n, Вам предложат выбрать имя новой VM. Все копирование завершено.\nВ терминале необходимо использовать команду qvm-clone. Синтаксис предельно прост:\nqvm-clone <имя целевой VM> <имя новой VM>\nКак и в предыдущем случае есть дополнительные аргументы, посмотреть можно по запросу\n--help\n. В будущем рассмотрим подробнее в статье про управление Qubes OS в консольном режиме.\n6. Удаление Qube\nПо аналогии с пунктом копирования, выполняется через\nQube Manager\nв GUI режиме. Выбираем машину требующего удаления и в меню ПКМ выбираем delete вводим имя для подтверждения. VM должна быть отключена.\nВ терминале в данном случае есть возможность удаления в ускоренном режиме, бывает нужно когда в удаляемой VM куча ненужных данных. Выполняется командой\nqube-remove\n:\nqube-remove <имя VM>\nИли:\nqube-remove --force <имя VM>\nВ случае\n--force\nудаления данные не будут надежно удалены, а просто стерты из оглавления диска, аналогично быстрому форматированию USB флешек.\nЗаключение\nВот так в Qubes OS выполняется работа в виртуальными системами. Надеюсь Вам было интересно. В следующей статье подробнее разберу работу с TemplateVM.\nНет похожих записей\nОцените статью:\n8\n4,88\nTweet\nPin It\n	https://losst.ru/virtualnye-mashiny-qubes-os	116
ffcd9f34-b55f-4971-a746-39ae9d2fb739	Установка LAMP Ubuntu 18.04	apache;php;	LAMP - это самый популярный стек программного обеспечения для работы веб-сервера. Сюда входят такие программы, как Apache, PHP, MySQL, и работает всё это в Linux, отсюда и такое название. Apache - это самый популярный веб-сервер, может, он не такой производительный, как Nginx, зато очень прост в настройке. PHP - самый популярный язык программирования для веб, а без базы данных вообще сейчас мало что работает.\nВ этой статье мы рассмотрим, как выполняется Установка LAMP Ubuntu 18.04 несколькими способами: с помощью утилиты tasksel или вручную с помощью установщика программ.\nСодержание статьи:\nУстановка LAMP в Ubuntu\n1. Установка пакетов с помощью tasksel\n2. Как установить Lamp в Ubuntu вручную\n3. Настройка брандмауэра\n4. Проверка работы LAMP\n5. Настройка Apache\n6. Настройка PHP\n7. Настройка MySQL\n8. Удаление LAMP в Ubuntu\nВыводы\nУстановка LAMP в Ubuntu\n1. Установка пакетов с помощью tasksel\nTasksel - это утилита, которая позволяет устанавливать пакеты различных программ буквально в одну команду. Она разработана для Debian, но может использоваться и в Ubuntu. Для её установки выполните в терминале:\nsudo apt install tasksel\nЗатем, чтобы установить Lamp на Ubuntu, достаточно выполнить такую команду:\nsudo tasksel install lamp-server\nУстановка займёт кое-какое время, потому что утилите придётся скачать и настроить все пакеты, но потом вы получите полностью работающий стек LAMP.\n2. Как установить Lamp в Ubuntu вручную\nЕсли вы не хотите использовать tasksel, вы можете установить все пакеты по отдельности и настроить их для совместной работы. Сначала установим все необходимые пакеты. Установка последней версии Apache2 из репозиториев:\nsudo apt install apache2\nУстановка базы данных MariaDB из репозиториев:\nsudo apt install mariadb-server\nИли вы можете установить MySQL:\nsudo apt install mysql-server\nУстановка интерпретатора языка программирования PHP 7.2 и расширений, необходимых для его работы с Apache и MySQL:\nsudo apt install php7.2 libapache2-mod-php7.2 php-mysql\nУстановка дополнительных расширений для PHP, которые вам понадобятся в будущем для хостинга большинства популярных проектов:\nsudo apt install php-curl php-json php-cgi php-gd php-zip php-mbstring php-xml php-xmlrpc\n3. Настройка брандмауэра\nПо умолчанию брандмауэр закрывает все неразрешённые входящие подключения. Поэтому, чтобы к вашему веб-серверу можно было получить доступ извне, необходимо добавить его порт в исключения:\nsudo ufw allow in 80/tcp\n4. Проверка работы LAMP\nДля проверки наберите в адресной строке браузера IP-адрес сервера, куда вы устанавливали LAMP, у меня это localhost:\nРаботает, теперь давайте проверим, правильно ли работает PHP. Создайте файл в директории /var/www/html со следующим содержимым:\nsudo vi /var/www/html/phpinfo.php\n<?php phpinfo(); ?>\nЗатем откройте адрес localhost/phpinfo.php. Если всё работает, вы должны увидеть такую страничку:\nТакже можно проверить, работает ли MySQL: если расширение PHP для MySQL загрузилось, то на странице phpinfo будет размещена такая информация:\nГотово, дальше идёт в основном настройка LAMP в Ubuntu 18.04.\n5. Настройка Apache\nДля обработки запросов будет использоваться модуль npm_prefork, так как он совместим с большинством систем. Поэтому его нужно активировать, а npm_event и npm_worker отключить:\nsudo a2dismod npm_event\nsudo a2dismod npm_worker\nsudo a2enmod npm_prefork\nВключаем mod_rewrite, который сейчас используется практически везде:\nsudo a2enmod rewrite\nЕсли вы хотите использовать файлы httaccess для настроек, то необходимо в файле /etc/apache2/apache2.conf изменить значение AllowOverride с None на All для нужных местоположений, например, для /var/www:\nsudo vi /etc/apache2/apache2.conf\n<Directory /var/www/>\nOptions Indexes FollowSymLinks\nAllowOverride All\nRequire all granted\n</Directory>\nДалее необходимо перезапустить Apache:\nsudo systemctl restart apache2\nПодробнее про настройку веб-сервера читайте в отдельной статье\nустановка и настройка Apache\n.\n6. Настройка PHP\nПо умолчанию короткие теги, обрамляющие скрипты PHP, отключены. Это может привести к тому, что некоторые скрипты, использующие эти теги, могут не выполнятся. Для включения этой возможности откройте файл:\nsudo vi /etc/php/7.2/apache2/php.ini\nНайдите\nshort_open_tag = Off\nи замените на:\nshort_open_tag = On\nВывод ошибок в PHP по умолчанию тоже отключён. Если вы хотите разрабатывать программы на этом сервере, то вам необходимо включить ошибки, иначе вместо ошибок вы будете видеть пустой экран. Для этого найдите эти строки и приведите их к такому виду:\nerror_reporting = E_ALL\ndisplay_errors = On\nИли для записи ошибок в файл вы можете добавить такую строку:\nerror_log = php-errors.log\nПосле внесения всех изменений необходимо перезапустить Apache:\nsudo systemctl restart apache2\nПодробнее про настройку файла php.ini смотрите\nздесь\n.\n7. Настройка MySQL\nПо умолчанию MySQL не очень хорошо настроена в плане безопасности. Нам нужно задать пароль суперпользователя и удалить гостевой доступ. Для выполнения всех этих задач запустите в терминале:\nsudo mysql_secure_installation\nНа первом этапе утилита попросит вас ввести пароль суперпользователя, так как он ещё не задан, просто нажмите\nEnter\n:\nДалее введите новый пароль:\nВо всех следующих вопросах нужно отвечать утвердительно:\nЗапретить удалённый вход для root;\nЗапретить гостевой вход;\nУдалить временные таблицы;\nОбновить таблицы привилегий.\nГотово, теперь ваша база данных защищена и готова к работе.\n8. Удаление LAMP в Ubuntu\nЧтобы полностью удалить LAMP из системы, достаточно удалить все пакеты, которые вы установили ранее:\nsudo apt purge  apache2 mariadb-server php7.2 libapache2-mod-php7.2 php-mysql php-curl php-json php-cgi php-gd php-zip php-mbstring php-xml php-xmlrpc\nКоманда purge позволяет удалить не только пакеты, но и их конфигурационные файлы. Если вы хотите оставить конфигурационные файлы, используйте команду remove.\nЕсли установка LAMP на Ubuntu выполнялась с помощью tasksel, то для удаления необходимо выполнить:\nsudo tasksel uninstall lamp-server\nВыводы\nВ этой статье мы разобрали, как выполняется установка Apache, PHP, MySQL на Ubuntu 18.04. Как видите, это не очень сложно и с такой задачей может справится даже новичок, если немного попрактикуется на виртуальной машине. Фактически, уже после шага 3 установка Lamp Ubuntu 18.04 практически завершена, и уже можно работать, а дальше идёт только настройка LAMP. Если у вас остались вопросы, спрашивайте в комментариях!\nУстановка php 7 в Ubuntu\nИюль 24, 2017\nУстановка PHP 7 в CentOS\nСентябрь 9, 2017\nПочему Apache не запускается\nОктябрь 12, 2017\nПерезапуск Apache Ubuntu\nНоябрь 14, 2017\nОцените статью:\n3\n5,00\nTweet\nPin It\n	https://losst.ru/ustanovka-lamp-ubuntu-18-04	116
