-сервера читайте в отдельной статье\nустановка и настройка Apache\n.\n6. Настройка PHP\nПо умолчанию короткие теги, обрамляющие скрипты PHP, отключены. Это может привести к тому, что некоторые скрипты, использующие эти теги, могут не выполнятся. Для включения этой возможности откройте файл:\nsudo vi /etc/php/7.2/apache2/php.ini\nНайдите\nshort_open_tag = Off\nи замените на:\nshort_open_tag = On\nВывод ошибок в PHP по умолчанию тоже отключён. Если вы хотите разрабатывать программы на этом сервере, то вам необходимо включить ошибки, иначе вместо ошибок вы будете видеть пустой экран. Для этого найдите эти строки и приведите их к такому виду:\nerror_reporting = E_ALL\ndisplay_errors = On\nИли для записи ошибок в файл вы можете добавить такую строку:\nerror_log = php-errors.log\nПосле внесения всех изменений необходимо перезапустить Apache:\nsudo systemctl restart apache2\nПодробнее про настройку файла php.ini смотрите\nздесь\n.\n7. Настройка MySQL\nПо умолчанию MySQL не очень хорошо настроена в плане безопасности. Нам нужно задать пароль суперпользователя и удалить гостевой доступ. Для выполнения всех этих задач запустите в терминале:\nsudo mysql_secure_installation\nНа первом этапе утилита попросит вас ввести пароль суперпользователя, так как он ещё не задан, просто нажмите\nEnter\n:\nДалее введите новый пароль:\nВо всех следующих вопросах нужно отвечать утвердительно:\nЗапретить удалённый вход для root;\nЗапретить гостевой вход;\nУдалить временные таблицы;\nОбновить таблицы привилегий.\nГотово, теперь ваша база данных защищена и готова к работе.\n8. Удаление LAMP в Ubuntu\nЧтобы полностью удалить LAMP из системы, достаточно удалить все пакеты, которые вы установили ранее:\nsudo apt purge  apache2 mariadb-server php7.2 libapache2-mod-php7.2 php-mysql php-curl php-json php-cgi php-gd php-zip php-mbstring php-xml php-xmlrpc\nКоманда purge позволяет удалить не только пакеты, но и их конфигурационные файлы. Если вы хотите оставить конфигурационные файлы, используйте команду remove.\nЕсли установка LAMP на Ubuntu выполнялась с помощью tasksel, то для удаления необходимо выполнить:\nsudo tasksel uninstall lamp-server\nВыводы\nВ этой статье мы разобрали, как выполняется установка Apache, PHP, MySQL на Ubuntu 18.04. Как видите, это не очень сложно и с такой задачей может справится даже новичок, если немного попрактикуется на виртуальной машине. Фактически, уже после шага 3 установка Lamp Ubuntu 18.04 практически завершена, и уже можно работать, а дальше идёт только настройка LAMP. Если у вас остались вопросы, спрашивайте в комментариях!\nУстановка php 7 в Ubuntu\nИюль 24, 2017\nУстановка PHP 7 в CentOS\nСентябрь 9, 2017\nПочему Apache не запускается\nОктябрь 12, 2017\nПерезапуск Apache Ubuntu\nНоябрь 14, 2017\nОцените статью:\n3\n5,00\nTweet\nPin It\n	https://losst.ru/ustanovka-lamp-ubuntu-18-04	116
e3e4fe59-7ec7-4cfa-9660-e46488357150	Установка и настройка Qubes OS 4	безопасность;	Qubes OS 4 - операционная система ориентированная на безопасность методом разделения процессов по виртуальным машинам. Виртуализация происходит на базе технологии XEN, что позволяет работать виртуальным машинам значительно быстрее чем при использовании программной виртуализации (VirtualBox, VMware и так далее).\nОднако данная операционная система все же достаточно специфична и может показаться сложной в использовании после классических Linux OS. В данной статье постараюсь как можно подробнее описать установку Qubes OS, настройка, также нюансы системы.\nСодержание статьи:\nУстановка Qubes OS 4\n1. Системные требования Qubes OS\n2. Установка системы\nНастройка Qubes OS 4\n3. Первоначальная настройка\n4. Обновление QubesOS\n5. Установка программ\n6. Дополнительные настройки для Fedora\n7. Копирование файлов\n8. Копирование текста\n9. Работа с USB флешками\nЗаключение\nУстановка Qubes OS 4\n1. Системные требования Qubes OS\nПеред установкой системы необходимо посетить\nсайт разработчика\nи проверить свой компьютер на\nсовместимость аппаратной\nчасти, так же в данном разделе можно добавить свою конфигурацию оборудования после тестирования и описать работоспособность системы конкретно на Вашем железе:\nМинимальные системные требования:\nПроцессор:\nIntel или AMD 64 Bit поддерживающие аппаратную виртуализацию;\nОперативная память:\n4 GB;\nЖесткий диск:\nминимум 32 GB.\nРекомендованные:\nПроцессор:\nIntel или AMD 64 Bit поддерживающие аппаратную виртуализацию;\nОперативная память:\n8 GB;\nЖесткий диск:\nминимум 32 GB SSD;\nВидеокарта:\nочень рекомендуется наличие интегрированного графического процессора Intel, на дискретных видеокартах AMD и Nvidia возможны ошибки.\nСогласно списку совместимого оборудования наиболее подходящими будут ноутбуки с процессорами Intel 6 поколения и выше. В моем случае это Dell Inspirion 13 5378, заявлена полная совместимость, но ошибки все же иногда выявляются, методы решения наиболее часто встречающихся в следующих статьях.\nНеобходимо обязательно проверить свою систему на совместимость, иначе работоспособность не гарантируется и исходя из моего опыта гарантирую множество проблем, вплоть до полного отказа системы.\n2. Установка системы\nИ так, железо проверено пора устанавливать. Загружаем ISO образ с официального сайта. Записываем любым удобным способом на USB флешку с объемом памяти минимум 8 GB, желательно USB 3.0 (система достаточно долго устанавливается). Перезагружаем компьютер, в настройках BIOS отключаем Trusted Boot и Legasy Boot. Загружаемся с флешки или иного носителя. Дальнейшая установка вплоть до первого запуска системы ничем не отличается от установки других дистрибутивов. Дожидаемся полной установки, перезагружаемся.\nНастройка Qubes OS 4\n3. Первоначальная настройка\nПосле загрузки системы появляется меню первоначальной настройки:\nИзвините за качество изображений выполнялась реальная установка на ноутбук без возможности сделать скриншот. Выбираем единственный пункт, далее видим следующее меню.\nРазработчик рекомендует оставить все без изменений, я рекомендую так же, позже указанные параметры можно будет отредактировать. Нажимаем Done в левом верхнем углу экрана и довольно долго ждем завершения начальной настройки (если индикатор остановился не пугаемся, такое бывает). После окончания начальных настроек, система возвращает на первый экран, где в правом нижнем углу нужно нажать\nFINISH CONFIGURATION\n.\nВнимание!\nЕсли нажать на\nQUBES OS\nвсю настройку системы придется повторить!\n4. Обновление QubesOS\nИ так система запущена на экране рабочее окружение XFCE в базовом виде. Первоначально необходимо обновить систему и пакеты встроенных Qubes VM. Для этого подключаемся к Wi-Fi или проводному подключению.\nДалее открываем\nМеню\n,\nTerminal Emulator\n. Вводим следующие команды. Обновляем VM Dom0 (подробнее о всех VM в следующих статьях):\nsudo qubes-dom0-update\nОбновить VMs можно двумя способами: либо через графическое приложение, либо через терминал VM-ов.\nПервый способ.\nПереходим в меню, далее\nSystem Tools\n,\nQubes Update\n, выбираем все VMы, жмем\nNext\nи ожидаем полного обновления.\nВторой способ\nчуть сложнее, однако позволяет просматривать объем обновлений и списки обновляемых пакетов. Переходим в меню,\nTemplate\n:\ndebian-9\nдалее\ndebian-9: Terminal\n.\nВводим стандартные команды обновления Debian:\nsudo apt-get upgrade -y && sudo apt-get update -y && sudo apt-get dist-upgrade\nДалее повторяем это для всех VMs. Fedora:\nsudo dnf upgrade -y && sudo dnf update\nWhonix-gw-14:\nsudo apt-get upgrade -y && sudo apt-get update -y && sudo apt-get dist-upgrade\nWhonix-ws-14:\nsudo apt-get upgrade -y && sudo apt-get update -y && sudo apt-get dist-upgrade\nПосле выполнения всех указанных операций, Ваша система полностью обновлена.\n5. Установка программ\nВ Qubes OS есть нюанс, обновление и установка необходимого ПО и пакетов выполняется только в группе VM Template! Если вы выполняете, все согласно данной инструкции, то другие VM кроме необходимых у вас не запущены, но если вы уже посмотрели и попробовали, что то открыть в других VM они уже запущены, и их необходимо отключить. Делается это следующим образом:\nОткрываем меню,\nSystem Tools\n->\nQube Manager\n. Выбираем необходимую VM, нажимаем правой кнопкой и выбираем\nShutdown Qube\n, ждем когда зеленый значок работы VMа в графе\nState\nне пропадет. Должны быть включены только VMы группы\nTemplate, sys-net, sys-usb, sys-firewall, sys-whonix\n.\nДалее открываем терминал и устанавливаем все, что необходимо, нужно и нравится. Так же можно и нужно подключать необходимые репозитории и PPA\nДалее после установки всех приложений обязательно отключаем VM в котором производилась установка. Сразу отмечу, что по умолчанию, все личные VM такие как\nPersonal, Work, Vault\nи т.д. работают на Fedora 29. Соответственно добавлять можно приложения установленные из\nTemplate Fedora\n. Аналогично с Whonix. Как создать VM на базе Debian в следующих статьях.\nСледующим действием необходимо добавить приложение в меню запуска. Это не обязательно, можно  выполнять запуск из терминала. Но многим удобнее через меню. Переходим в меню выбираем нужную VM, открываем приложение\nQube Settings\n, переходим в\nApplication\nи переносим стрелочкой нужные приложения.\n6. Дополнительные настройки для Fedora\nРепозитории RPMFusion по умолчанию установлены, но отключены. Для их включения откройте терминал и перейдите в yum.repos.d:\ncd /etc/yum.repos.d/\nОткрываем любым текстовым редактором файл rpmfusion-free.repo:\nsudo #текстовый редактор# rpmfusion-free.repo\nОткрываем любым текстовым редактором файл rpmfusion-nonfree.repo:\nsudo #текстовый редактор# rpmfusion-nonfree.repo\nВ обоих файлах находим строку\nenabled=0\nи меняем на 1. Теперь репозитории RPMFusion активны.\n7. Копирование файлов\nКопирование файлов из основного домена Dom0 в другие VM. Такое иногда бывает нужно. Например вы воспользовались приложением Screenshot из System Tools.\nОткрываем Terminal Emulator из основного меню;\nПереходим в необходимый каталог командой\ncd\n;\nКопируем файлы в нужную VM: qvm-copy-to-vm <Имя VM> <Список файлов>;\nВаши файлы появятся в ~/QubesIncoming/dom0/;\nКопирование в каталоги Dom0 будет описано в следующих статьях.\n8. Копирование текста\nКопирование текста внутри одной VM происходит стандартно, сочетанием клавиш\nCtrl+C, Ctrl+V\nили из меню ПКМ. Немного сложнее при копировании между разными VM'ами. Для копирования текста и файлов необходимо:\nВыделить текст или файл и нажать\nCtrl+C\n;\nДалее не снимания выделения и фокусировки на окне нажать\nCtrl+Shift+C\n;\nВыделить окно целевого VM нажать\nCtrl+Shift+V\nи далее\nCtrl+V\n;\nНемного сложно, но со временем привыкаешь, к тому же данное действие не выполняется часто.\n9. Работа с USB флешками\nПодключаем флешку к USB порту;\nОткрываем основной терминал Dom0;\nВводим команду\nqvm-block;\nВ терминале видим список подключенных устройств;\nДалее вводим команду подключения:\nqvm-block attach <Целевая VM> <Целевая флешка>\nВсе, флешка примонтирована к требуемой VM. После перезагрузки или перезапуска VM повторно эту операцию выполнять не нужно, флешка примонтируется автоматически.\nЗаключение\nЭто только первая статья из цикла по работе с Qubes OS 4. На мой взгляд этого минимально необходимого перечня действий достаточно для начала использования. В следующих статьях рассмотрим создание новых VM (в том числе Kali-Linux), подключение к Tor, Proxy, VPN, настройку каждой VM в отдельности и еще многое и многое. Надеюсь вам будет интересно.\nКак пользоваться Wireshark для анализа трафика\nДекабрь 18, 2016\nКак пользоваться Hydra\nМарт 5, 2017\nКак пользоваться Burp Suite\nОктябрь 3, 2017\nКак запустить Kali Linux с флешки\nМарт 20, 2018\nОцените статью:\n11\n4,82\nTweet\nPin It\n	https://losst.ru/ustanovka-i-nastrojka-qubes-os-4	116
f933bc43-dc9e-40ee-a946-13494f2d5b64	Как подключиться по SSH	ssh;	SSH - это основной протокол для удаленного управления серверами на базе операционной системы Linux. Все действия при подключении к SSH выполняются в командной строке, но при достаточном уровне знаний и привилегий в системе там можно сделать практически все что угодно, в отличие от того же FTP где можно только передавать и редактировать файлы.\nЕсли вы покупаете VPS сервер или продвинутый хостинг, обычно в письме вместе с другими данными авторизации есть данные доступа по SSH. В этой статье мы рассмотрим как подключиться по SSH к серверу из Linux или Windows.\nСодержание статьи:\nЧто такое SSH?\nКак подключиться по SSH\n1. Подключение через SSH в Linux\n2. Подключение через SSH в Windows\nВыводы\nЧто такое SSH?\nПоскольку эта статья рассчитана именно на новичков, то перед тем, как перейти дальше давайте подробнее разберемся что из себя представляет SSH. Исторически так сложилось что на большинстве серверов используется операционная система Linux, во многом этому посодействовала ее бесплатность. Графический интерфейс на серверах Linux не используется для экономии ресурсов, поэтому единственным способом администрирования сервера остается командная строка.\nНо это не является недостатком, потому что в командной строке Linux можно сделать больше чем графическом интерфейсе. Протокол SSH позволяет вам выполнять команды в удаленной системе так, как будто вы это делаете в своей системе. Вам доступен буфер обмена, вы вводите команды и можете использовать их вывод. Недоступны разве что файлы из вашей файловой системы. Например, когда вы подключитесь к серверу по SSH из Ubuntu, то все будет выглядеть так, как будто вы открыли терминал в своей системе.\nКак подключиться по SSH\nДля подключения по SSH нам необходимо знать такие данные:\nip адрес сервера, к которому мы собираемся подключится;\nпорт, на котором ожидает подключения SSH сервер, по умолчанию используется 22, но в целях безопасности порт подключения ssh часто изменяют;\nимя и пароль пользователя на удаленном сервере.\nБольше ничего не нужно, обычно эти данные присылают в письме вместе с описанием VPS. Теперь перейдем к практике.\n1. Подключение через SSH в Linux\nВ Linux подключение по SSH выполняется с помощью утилиты ssh. Мы более подробно рассматривали работу с ней в статье\nкак пользоваться ssh\n. Для подключения к удаленному компьютеру ее синтаксис будет выглядеть следующим образом:\n$ ssh\nимя_пользователя\n@\nайпи_адрес\nЭто самый простой вариант, если вам также нужно задать порт, используйте опцию -p:\n$ ssh\nимя_пользователя\n@\nайпи_адрес\n-p\nпорт\nЧтобы выполнить подключение по SSH Linux нажмите Ctrl+Alt+T для открытия терминала и наберите команду, заменив нужные значения:\nssh sergiy@192.168.1.2\nИли, с нестандартным портом:\nssh sergiy@192.168.1.2 -p 2223\nЕсли ip_адрес и порт правильные, то на следующем шаге программа попросит у вас ввести пароль:\nЕсли пытаетесь подключится через SSH к этому серверу первый раз, то утилита также попросит подтвердить добавление нового устройства в свой список известных устройств, здесь нужно набрать yes и нажать Enter:\nТеперь вы подключены, и все вводимые далее команды будут выполнены на удаленном сервере:\nЕсли же произошла ошибка и IP адрес или порт введены неверно, то вы получите ошибку Connection Refused:\nПросто убедитесь что порт введен верно. Если это ваш сервер, то, возможно на нем еще нужно разрешить подключение SSH в брандмауэре. В Ubuntu/Debian для этого на удаленном сервере выполните:\nsudo ufw allow 22/tcp\nА в CentOS/Fedora:\nfirewall-cmd --permanent --zone=public --add-port=22/tcp\nЕсли вы используете другой порт для SSH, то замените 22 на свой порт. Для удобства подключения по SSH в дальнейшем можно\nнастроить авторизацию по ключу ssh\n, чтобы не вводить каждый раз пароль.\nТеперь вы знаете как подключиться по ssh linux и решить проблемы с подключением. А теперь перейдем к Windows.\n2. Подключение через SSH в Windows\nРаньше подключение по SSH из Windows выполнялось только с помощью сторонних утилит, например PuTTY. Но в Windows 10 был добавлен встроенный OpenSSH клиент и работает он точно так же, как и в Linux. По умолчанию этот компонент не активирован. Для его установки откройте\nПараметры\n->\nПриложения\n:\nЗатем выберите\nУправление дополнительными компонентами\n:\nЗдесь нажмите добавить новый компонент и в открывлемся меню выберите\nOpenSSH Client\nи нажмите\nУстанвоить\n:\nДальше вернитесь назад и дождитесь завершения установки. После того, как SSH клиент будет установлен нужно обязательно перезагрузить компьютер.\nПосле перезагрузки нажмите\nWin+R\nчтобы открыть окно запуска команд и наберите в нем cmd:\nДалее нажмите Enter. Перед вами откроется командная строка Windows. Здесь можно использовать утилиту ssh. Синтаксис у нее абсолютно такой же, как и для Linux:\nssh\nимя_пользователя\n@\nайпи_адрес\n-p\nпорт\nНапример, такой командой можно подключится по SSH к Raspberry Pi, который находится в вашей локальной сети по адресу 192.168.1.5:\nssh pi@192.168.1.5\nУтилита предложит добавить устройство в список известных:\nЗатем предложит ввести пароль:\nВсе следующие команды будут выполняться уже на Raspberry Pi или другой удаленной машине, к которой вы подключились.\nТеперь подключиться к серверу по ssh из этой операционной системы также просто как и из Linux.\nВыводы\nВ этой статье мы рассмотрели как выполняется подключение к серверу по SSH из Linux или Windows. Как видите, это очень просто. А дальше, для работы с удаленным сервером вам понадобятся\nкоманды терминала Linux\n.\nНет похожих записей\nОцените статью:\n8\n4,25\nTweet\nPin It\n	https://losst.ru/kak-podklyuchitsya-po-ssh	116
8093af84-3b2e-42f7-9d20-4e3a28e2b153	Лучшие темы XFCE	xfce;	В данной статье мы собрали лучшие темы XFCE. Это DE (\nDesktop E\nnvironment)\nявляется довольно гибким, вы можете настроить в нём всё до мелочей с помощью стандартных средств.\nТем много, хотя и отличий в них мало; некоторые из них непроработаны и глючат, другие не очень красивые. Я постарался подобрать несколько тёмных и светлых тем, которые выглядят довольно симпатично и работают без особых проблем.\nСодержание статьи:\nЛучшие темы для XFCE\n1.  Arc\n2. Zuki\n3. Adapta\n4. Vimix\n5. Plata\n6. Numix Ocean\n7. Elementary\n8. Adwaita\n9. Mac\nВыводы\nЛучшие темы для XFCE\nМожет показаться, что все эти темы похожи, но стоит присмотреться повнимательнее: где-то используются другие тона, где-то иное оформление для панели, в других - так вообще отличие в оформлении элементов управления (кнопок и т. д.).\nИ ещё: после названия каждой темы будет указана команда для её установки в\nArch Linux\nлибо с помощью pacman (если тема есть в стандартных репозиториях), либо же с помощью aurman, если тема есть только в пользовательском репозитории. Если же вы используете другой помощник, команды будут отличаться. Почему именно Arch? Только в нём, на мой взгляд, "опакечено" больше всего тем - в той же Ubuntu далеко не для всех даже PPA есть и нужно ставить руками.\n1.  Arc\nsudo pacman -S arc-gtk-theme\nНаверное, одна из моих самых любимых тёмных тем оформления Xfce. Во многом похожа на Adapta, но, как по мне, немного лучше. К примеру, отчётливее виден контур кнопок, да и порой сочетание цветов удачнее, как в файловом менеджере: основное окно чуть более светлых оттенков, что, лично мне, нравится больше:\nВозможно, среди читателей найдутся  и любители светлых тем, так как выглядят они тоже неплохо:\n2. Zuki\naurman -S zuki-themes\nЭто скорее светлая тема с тёмной панелью. Основной упор тут идёт на использование различных оттенков серого цвета\n3. Adapta\nsudo pacman -S adapta-gtk-theme\nКак и писалось выше, довольно красивая тёмная тема, схожая с Arc и Vimix. Вот только если у Arc всё же присутствуют более светлые тона, в Adapta и Vimix они одинаковые, и основное отличие во внешнем виде кнопок,\nCheckBox'ов и RafioButton'ов:\nНу и опять же светлая версия с некоторыми тёмными элементами:\n4. Vimix\naurman -S vimix-gtk-themes-git\nВ принципе, всё описано выше, имеет как тёмную, так и светлую версии и только 2 основных отличия:\nЭлементы управления (кнопки и т. д.);\nРазличные оттенки.\nИ если с первым всё относительно понятно, то расскажу чуть подробнее о цветах. В комплекте с пакетом темы идёт куча вариаций со второстепенными оттенками: голубой, серый, бирюзовый, голубой, оранжевый и т. д. Как по мне, тёмная тема лучше всего смотрится с голубым оттенком:\nНу а к светлой, как мне кажется, лучше всего подойдёт оранжевый оттенок:\n5. Plata\naurman -S plata-theme\nНе смотря на мою любовь к тёмным темам, Plata показалась мне довольно красивой. В пакете с темой содержится несколько версий, которые, по сути, различаются только своими оттенками, а так же цветом Xfce-панели и некоторыми элементами управления:\n6. Numix Ocean\naurman -S gtk-theme-numix-ocean\nДаже и не знаю, что сказать...как и остальные проекты (другие GTK-темы и пакеты иконок) Numix Ocean выглядит довольно красиво, сочетает в себе как  тёмные элементы (к примеру панель), так и светлые (скорее даже серых оттенков) элементы:\n7. Elementary\naurman -S gtk-theme-elementary\nТема, "свиснутая" =) с Elementary OS, поставляется только в светлом варианте. Есть в ней что-то привлекательное, плюс заметил, что список запущенных приложений на панели Xfce всё же имеет скруглённый вид, а не как у предыдущих тем с заострёнными краями, чем-то похоже на Windows 7:\n8. Adwaita\nsudo pacman -S\ngnome-themes-extra\nДа, Adwaita, Adwaita-dark, HighContras идут в пакете тем гнома, отдельно Adwaita без темы высокого контраста можно поставить из AUR, но, думаю, это не критично.\nЭх Adwaita :), тема которая идёт по умолчанию с большинством DE, основанных на GTK. Если честно, то чем-то напоминает мне Windows XP, порой использую её тёмную версию, когда не хочу пихать в систему лишние темы, ну или просто по желанию. Её отличие от предыдущих тем в том, что она не стремится иметь плоский интерфейс (аля материал дезигн) и, к примеру, использует градиенты в заголовках окон:\n9. Mac\naurman -S macos11-gtk-theme\nСветлая GTK-тема с тёмной панелью, сделанная в стиле Mac OS, наверное, одна из самых светлых тем в данной подборке, выглядит неплохо, думаю кому-нибудь понравится:\nВыводы\nВ данной статье мы рассмотрели 9, на мой взгляд, красивых и интересных GTK-тем, которые отлично смотрятся с Xfce. А какие темы XFCE используете вы? Делитесь в комментариях!\nНет похожих записей\nОцените статью:\n12\n3,67\nTweet\nPin It\n	https://losst.ru/luchshie-temy-xfce	116
b11a9ac3-7eba-4fb6-a47d-a906aca18c21	Настройка Ubuntu Server после установки	ubuntu;сервер;	Ubuntu Server - это дистрибутив Linux для установки на серверы. Он не содержит графической оболочки, по умолчанию доступны только консольные утилиты. После завершения установки вы получаете голую систему Ubuntu и прежде чем она станет способна выполнять свои функции сервера, вам предстоит потратить еще немного времени на ее настройку.\nВ этой статье мы разберем как выполняется настройка Ubuntu Server 18.04 после установки, рассмотрим настройку пользователей, SSH, а также настройку брандмауэра.\nСодержание статьи:\nНастройка Ubuntu Server 18.04 после установки\n1. Обновление системы\n2. Настройка SSH\n3. Настройка брандмауэра ufw\n4. Настройка времени\n5. Разблокировка пользователя root\nВыводы\nНастройка Ubuntu Server 18.04 после установки\nНачнем с обновления системы. Я предполагаю, что сеть у вас уже настроена автоматически. Если это не так, то воспользуйтесь статьей про\nнастройку сети с помощью Netplan\n.\n1. Обновление системы\nПервым делом, после завершения установки любой операционной системы ее необходимо обновить. Для этого выполните такие команды:\nsudo apt update\nsudo apt list --upgradable\nsudo apt upgrade\nЧем больше времени прошло с момента релиза установочного образа Ubuntu Server, тем больше времени займет обновление системы, но это необходимая операция. После обновления перезагрузите систему:\nsudo reboot\n2. Настройка SSH\nПоскольку это серверная система, то получать к ней доступ мы будем удаленно. Поэтому сразу же после обновления следует настроить SSH и использовать этот протокол для дальнейшей настройки.\nСначала необходимо сменить порт SSH на удаленном сервере, иначе рано или поздно кто-то попытается его перебрать. Откройте файл /etc/ssh/sshd.conf, найдите строчку Port 22 и измените значение порта на другое число, например, на 2323:\nsudo vi /etc/ssh/sshd_config\nPort 2323\nДля запуска службы SSH и добавления ее в автозагрузку выполните:\nsudo systemctl start sshd\nsudo systemctl enable sshd\nТеперь вы можете авторизоваться на вашем сервере с другой машины. Но каждый раз вводить пароль при входе не очень удобно. Настроем авторизацию по ключу. Для этого на вашей рабочей машине выполните команду для генерации ключа:\nssh-keygen\nПрограмма спросит вас путь, куда нужно сохранить ключ, не оставляйте по умолчанию, используйте например, ~/.ssh/id_rsa_ubuntu.  Затем утилита предложит ввести пароль для ключа. Если вы не хотите вводить этот пароль каждый раз при входе по SSH, то его задавать не нужно. Но в целях безопасности очень не рекомендуется использовать ключи без паролей.\nЗатем отправьте только что созданный ключ на свой сервер:\nssh-copy-id -i ~/.ssh/id_rsa_ubuntu.pub имя_пользователя@хост\nТеперь вы сможете авторизоваться на этом сервере без ввода пароля:\nssh имя_пользователя@хост\nДальнейшую настройку сервера можно проводить через SSH.\n3. Настройка брандмауэра ufw\nСервер будет находиться в сети, а поэтому к нему будет иметь доступ множество пользователей. Необходимо спрятать все запущенные на сервере службы с помощью брандмауэра и оставить только разрешенные. В Ubuntu для управления брандмауэром используется надстройка над iptables - ufw.\nПо умолчанию, после запуска брандмауэр закрывает доступ ко всем не разрешенным службам извне. Мы сейчас работаем на сервере по SSH, поэтому нужно разрешить эту службу:\nsudo ufw allow OpenSSH\nЕсли вы изменили стандартный порт SSH на втором шаге, необходимо разрешать именно тот порт, который вы указали:\nsudo ufw allow 2323/tcp\nЗатем выполните такую команду для включения ufw:\nsudo ufw enable\nДалее нужно нажать y для подтверждения. Брандмауэр будет запущен и добавлен в автозагрузку. Вы можете посмотреть его состояние командой:\nsudo ufw status\n4. Настройка времени\nУстановщик не предлагает вам выбрать часовой пояс и по умолчанию остается UTC. Таким образом, вы получаете время по Гринвичу. Вы можете проверить какое время показывает ваш сервер с помощью команды:\ndate\nЧтобы это изменить нужно добавить свой часовой пояс. Посмотреть доступные часовые пояса можно командой:\ntimedatectl list-timezones\nА для выбора нужного выполните:\nsudo timedatectl set-timezone Europe/Kiev\nТакже желательно настроить NTP сервер, чтобы время автоматически синхронизировалось с серверами в интернете. Для установки NTP выполните:\nsudo apt install ntp\nА затем добавьте его в автозагрузку:\nsudo systemctl enable ntp\n5. Разблокировка пользователя root\nВ Ubuntu по умолчанию пароль для суперпользователя не задан, поэтому войти от его имени вы не сможете. Если вы хотите иметь возможность логиниться в системе от суперпользователя, или он нужен для системы управления конфигурацией то вы можете задать для него пароль:\nsudo passwd root\nИ введите новый пароль. Затем вы сможете авторизоваться от имени этого пользователя.\nsu - root\nВыводы\nВ этой статье мы разобрали как выполняется настройка Ubuntu Server после установки. Мы сделали только основные шаги, и для того чтобы эта система переварилась в полноценный веб-сервер, сервер баз данных или приложений нужно установить еще много программ. Но обо всем этом уже есть отдельные статьи на Losst.\nУстановка Ubuntu Server 18.04\nЯнварь 14, 2019\nУстановка Gimp в Ubuntu\nИюль 9, 2015\nЛегкое обновление Linux\nИюль 31, 2017\nУстановка Kubuntu 18.04\nИюнь 25, 2018\nОцените статью:\n7\n4,00\nTweet\nPin It\n	https://losst.ru/nastrojka-ubuntu-server-posle-ustanovki	116
2a22bbe2-1bf9-4eda-80f5-e44c3bf4512c	Установка Ubuntu Server 18.04	ubuntu;сервер;	Дистрибутив Ubuntu популярен не только для домашнего использования, но и очень часто применяется на серверах. Серверная версия Ubuntu использует те же репозитории, что и версия для рабочего стола, но здесь нет графической оболочки, а также есть несколько отличий в процессе установки.\nНа нашем сайте уже есть статья про установку Ubuntu 16.04 Server, но в версию Ubuntu 18.04 разработчики внесли несколько важных изменений, основное из которых - использование нового установщика Subiquity и инструмента настройки сети -\nNetplan\n. В этой статье мы рассмотрим, как выполняется установка Ubuntu Server 18.04 пошагово.\nСодержание статьи:\nСистемные требования\nУстановка Ubuntu Server 18.04\nШаг 1. Загрузка образа Ubuntu Server\nШаг 2. Запись образа на носитель\nШаг 3. Настройка BIOS\nШаг 4. Запуск установочного образа\nШаг 5. Начало установки\nШаг 6. Выбор языка системы\nШаг 7. Выбор раскладки клавиатуры\nШаг 8. Выбор варианта установки\nШаг 9. Настройка сети\nШаг 10. Настройка прокси\nШаг 11. Выбор зеркала\nШаг 12. Способ разметки диска\nШаг 13. Создание корневого раздела\nШаг 14. Создание домашнего раздела\nШаг 15. Завершение разметки\nШаг 16. Создание учетной записи\nШаг 17. Установка системы\nШаг 18. Перезагрузка\nШаг 19. Вход в систему\nВыводы\nСистемные требования\nСистемные требования Ubuntu Server немного выросли по сравнению с предыдущим релизом. Теперь для установки системы нужно больше памяти и более мощный процессор:\nТактовая частота процессора:\n1 ГГц;\nОперативная память:\n512 Мб (1 Гб для установки с сети);\nМесто на жёстком диске:\n2,5 Гб (только под базовую систему будет достаточно 1,5 Гб);\nАрхитектура процессора:\nх64.\nТеперь перейдём к установке, и сначала нам нужно скачать установочный образ.\nУстановка Ubuntu Server 18.04\nПоскольку в серверной версии нет графического интерфейса, для установки будет использоваться псевдографическая утилита Subiquity. Для перемещения по пунктам интерфейса используйте кнопки со стрелками\nвверх, вниз\nили\nTab\n, для выбора -\nПробел\n, для нажатия кнопок -\nEnter\n, а для отмены -\nEsc\n.\nШаг 1. Загрузка образа Ubuntu Server\nПервым делом необходимо скачать образ дистрибутива. Это можно сделать на\nофициальном сайте Ubuntu\n. На данный момент самая свежая LTS-версия Ubuntu - 18.04.1. Для загрузки просто нажмите на кнопку\nDownload\nнапротив неё:\nШаг 2. Запись образа на носитель\nВы можете записать образ на флешку или оптический диск. Для записи на флешку используются такие утилиты, как Etcher, Unetbootin в Linux и Rufus в Windows, а для записи на диск - Brasero. Я не буду подробно описывать этот процесс, поскольку это уже сделано в статье\nзапись образа Linux на флешку\n.\nШаг 3. Настройка BIOS\nКогда носитель будет записан, перезагрузите компьютер и во время заставки BIOS нажимайте\nF2\n,\nF8\nили\nDel\n, чтобы войти в режим настройки. Здесь вам нужно найти вкладку\nBoot\nи поставить свою флешку на первое место.\nЗатем сохраните настройки на вкладке\nExit,\nнажав\nExit & Save Settings\n. Для материнских плат с UEFI настройка будет выглядеть похожим образом, только интерфейс будет очень сильно отличаться.\nШаг 4. Запуск установочного образа\nКогда завершите с BIOS, перезагрузите компьютер. Если всё было сделано правильно, начнётся загрузка с ранее записанной флешки. Вы увидите такое сообщение:\nЗдесь нужно нажать любую клавишу, а затем выбрать язык установщика, например русский:\nШаг 5. Начало установки\nЧтобы установить Ubuntu Server 18.04, выберите пункт\nУстановка Ubuntu Server\nв меню:\nЗатем дождитесь, пока завершится загрузка:\nШаг 6. Выбор языка системы\nНа этом шаге установки необходимо выбрать язык для будущей системы. Обычно по умолчанию выделен тот, что вы выбрали для установщика:\nШаг 7. Выбор раскладки клавиатуры\nПо умолчанию нам предлагают русскую раскладку для русского языка. Но поскольку нам будет необходимо печатать имя пользователя, название компьютера и консольные команды, выберите\nАнглийский Великобритания\n:\nЗатем нажмите кнопку\nГотово\n.\nШаг 8. Выбор варианта установки\nЗдесь вы можете установить обычный Ubuntu Server или MAAS - решение для быстрого развертывания Ubuntu на большом кластере серверов. Второй вариант мы рассматривать не будем, поэтому выбирайте первый.\nШаг 9. Настройка сети\nУстановщик предлагает вам настроить сеть.\nЕсли вам необходимо настроить статический IP-адрес, то это можно сделать здесь, открыв пункт\nEdit IPv4 Settings\n.\nОбычно можно оставить всё без изменений.\nШаг 10. Настройка прокси\nЕсли для подключения к интернету требуется прокси-сервер, укажите его здесь:\nШаг 11. Выбор зеркала\nЗеркало для загрузки пакетов тоже оставьте по умолчанию.\nШаг 12. Способ разметки диска\nЗдесь есть несколько вариантов. Либо предоставить системе право самой разбить диск на своё усмотрение, для это выберите\nUse An Entire Disk\n:\nЕщё можно разбить диск\nвручную\n. Мы рассмотрим именно этот вариант.\nШаг 13. Создание корневого раздела\nЧтобы создать новый раздел диска, в разделе\nAvailable Devices\nвыберите нужный диск и нажмите\nEnter\n:\nВ открывшемся контекстном меню выберите\nAdd Partition\n:\nЗатем в поле\nSize\nвведите размер нового раздела в гигабайтах, а в поле\nFormat\nвыберите файловую систему. В поле\nMount\nнужно оставить / для корневого раздела.\nКогда завершите, нажмите кнопку\nCreate\n:\nШаг 14. Создание домашнего раздела\nКак видите, система автоматически создала раздел для BIOS с размером 1 Мб. Теперь создадим домашний раздел.\nВсе действия аналогичны первому варианту, только поле\nSize\nможно оставить пустым, чтобы использовать всё доступное пространство, а в поле\nMount\nнужно выбрать\n/home\n:\nШаг 15. Завершение разметки\nКогда завершите создавать разделы, у вас должно получится три раздела:\nЕсли всё правильно, нажмите кнопку\nГотово\n.\nЗатем подтвердите действие, нажав кнопку\nПродолжить\n.\nШаг 16. Создание учетной записи\nСледующий шаг - создание учетной записи пользователя и выбор имени сервера. Заполните такие поля:\nВаше имя\n- просто имя, можно русскими буквами;\nYour server's name\n- имя вашего сервера, только строчные латинские буквы;\nИмя пользователя\n- имя пользователя для входа в систему;\nПароль\n- вводится два раза, используйте сложные пароли для серверов, поскольку существует множество ботов, которые пытаются перебирать пароли по SSH.\nЕщё на этом этапе вы можете импортировать в систему свои ключи SSH из Launchpad или GitHub.\nШаг 17. Установка системы\nЭтот шаг может занять несколько минут в зависимости от мощности вашего оборудования. Дождитесь завершения установки:\nШаг 18. Перезагрузка\nКогда установка Ubuntu Server 18.04 lts завершится, нажмите кнопку\nПерезагрузить сейчас\n.\nЗатем извлеките установочный носитель и нажмите\nEnter\n.\nШаг 19. Вход в систему\nПосле перезагрузки введите логин и пароль, которые вы использовали на шаге 16 во время установки:\nВсё, перед вами готовая система, которую уже можно использовать:\nО дальнейшей настройке Ubuntu Server 18.04 поговорим в следующих статьях.\nВыводы\nВ этой статье мы рассмотрели, как установить Ubuntu server 18.04. Несмотря на новый установщик, всё работает достаточно стабильно и во время установки у вас не должно возникнуть никаких сложностей. Также вы можете посмотреть видео с процессом установки:\nОбновление Ubuntu 14.04 до 16.04\nАпрель 25, 2016\nУстановка Visual Code и Net Core 1.0 Ubuntu 16.04\nИюль 3, 2016\nУстановка MATE в Ubuntu 16.04\nОктябрь 3, 2016\nНастройка безопасности Ubuntu 16.04\nОктябрь 24, 2016\nОцените статью:\n10\n4,70\nTweet\nPin It\n	https://losst.ru/ustanovka-ubuntu-server-18-04	116
4817a9cf-d011-4494-a9e7-b1632394522d	Как создать группу Linux		Группы - очень удобный инструмент распределения прав в Linux. Благодаря группам можно разрешить нескольким пользователям доступ к одному файлу или папке, а другим запретить, не прибегая к более сложным технологиям, таким, как ACL-списки. Системные сервисы тоже запускаются от имени определённых пользователей, и поэтому группы позволяют очень тонко настроить права доступа к нужным файлам для сервисов, не давая им полного доступа к системе.\nВ этой небольшой статье мы рассмотрим, как создать группу Linux разными способами, а также поговорим о дополнительных настройках группы.\nСодержание статьи:\nКак создать группу Linux\nСоздание группы Linux вручную\nКак удалить группу в Linux\nВыводы\nКак создать группу Linux\nДля создания групп в Linux используется команда groupadd, давайте рассмотрим её синтаксис и опции:\n$\ngroupadd\nопции\nимя_группы\nА теперь разберём опции утилиты:\n-f\n- если группа уже существует, то утилита возвращает положительный результат операции;\n-g\n- установить значение идентификатора группы GID вручную;\n-K\n- изменить параметры по умолчанию автоматической генерации GID;\n-o\n- разрешить добавление группы с неуникальным GID;\n-p\n- задаёт пароль для группы;\n-r\n- указывает, что группа системная;\n-R\n- позволяет изменить корневой каталог.\nПерейдём к практике. Всё очень просто. Создадим группу group1:\nsudo groupadd group1\nТеперь вы можете убедится, что группа была добавлена в файл /etc/group:\ncat /etc/group | grep group1\nСистема создала группу с GID 1001. Вы можете вручную указать GID вашей группы с помощью опции -g;\nsudo groupadd -g 1006 group6\nТакже есть возможность задать пароль для группы. Он служит для того, чтобы пользователи, не состоящие в группе, смогли получить к ней доступ с помощью команды\nnewgrp\n. Эта команда делает пользователя участником указанной группы до конца сеанса. Из соображений безопасности этот метод использовать не рекомендуется, поскольку один пароль будут знать несколько пользователей. Чтобы создать группу с паролем, сначала создаём пароль командой:\nperl -e 'print crypt("12345", "xyz"),"\\n"'\nЗдесь xyz - это случайная комбинация символов для увеличения надёжности пароля, а 12345 - ваш пароль. Мы должны передать утилите именно зашифрованный пароль, если передать его в открытом виде, то ничего работать не будет. Теперь создаём группу с только что полученным паролем:\nsudo groupadd -p sajEeYaHYyeSU group7\nЗатем можно попытаться получить временный доступ к ресурсам группы с помощью\nnewgrp\n:\nnewgrp group7\ngroups\nНам надо ввести пароль, который мы раньше шифровали, и теперь до конца сеанса наш пользователь находится в группе. Если вы хотите добавить пользователя в группу навсегда, то надо использовать команду\nusermod\n:\nsudo usermod -aG group7 имя_пользователя\nСоздание группы Linux вручную\nЕсли вы не хотите создавать группу с помощью команды, это можно сделать, просто редактируя конфигурационные файлы. Все группы, которые существуют в системе, находятся в файле /etc/group. Если мы хотим добавить новую, достаточно добавить строчку с таким синтаксисом:\nимя_группы\n:\nх\n:\ngid\n:\nсписок_пользователей\nРазберём более подробно, какой параметр за что отвечает:\nимя_группы\n- имя, которое будет использоваться для операций с группой;\nx\n- заглушка пароля группы, пароль указывается в файле /etc/gshadow, если в этом есть необходимость;\ngid\n- идентификатор группы;\nсписок_пользователей\n- пользователи, разделённые запятыми, которые входят в группу.\nТаким образом, чтобы создать группу group7, достаточно добавить строку:\nsudo vi /etc/group\ngroup7:x:1007:\nВсё. Теперь нашу группу можно использовать, например, добавим в неё пользователя:\nusermod -aG group7 имя_пользователя\nВы уже знаете, как создать группу пользователей linux двумя способами, теперь разберёмся, как её удалить.\nКак удалить группу в Linux\nЕсли вы создали группу неправильно или считаете, что она не нужна, то её можно удалить. Для этого используйте:\nsudo groupdel имя_группы\nТолько ни в коем случае не удаляйте системные группы, они нужны и используются системой, а их удаление может сломать работу некоторых программ.\nВыводы\nВ этой небольшой статье мы рассмотрели создание группы в Linux, а также то, как удалить созданную группу. Как видите, это довольно просто. Ели у вас остались вопросы, спрашивайте в комментариях!\nНет похожих записей\nОцените статью:\n3\n5,00\nTweet\nPin It\n	https://losst.ru/kak-sozdat-gruppu-linux	116
8e47c034-c32e-42d6-a9d1-2b3f6e57a772	Стресс тест процессора в Linux		Прогнал я тест Linpack и задумался: а не пора ли мне поменять термопасту на своём ноутбуке?\nДа, по результатам нескольких тестов подряд (не буду захломлять статью картинками) видно, что процессор уходит в троттлинг (пропуск тактов и сброс частоты при нагреве), но вот, как быстро он начинает это делать?\nСтресстест процессора в терминале Linux\nЗадавшись этим вопросом и поискав в интернете утилиты, я понял, что основная проблема в решении поставленной мной задачи - одновременный запуск, как минимум пары утилит и разбегающиеся глаза в двух окнах... И я пришёл к выводу, что мне больше подходит консольный вариант, нежели разноцветные окна открытых программ.\nНачал я с sysbench:\nsudo apt install sysbench\nsysbench --num-threads=4 --test=cpu --cpu-max-prime=100000 run\nгде:\n--num-threads=4\n- это количество потоков, у меня двухъядерный четырёхпотоковый Intel® Core™ i7-640M, поэтому 4;\n--cpu-max-prime=100000\n- это максимальное количество выполненных операций, я выставил в 100000, т.к. по умолчанию - 10000, слишком быстро завершают тест.\nПотом я перешёл на Linpack. Так как процессор у меня от Intel и я имею некоторую долю лени (лень - двигатель прогресса), то я взял, скачал и распаковал готовый\nIntel-овский Linpack\n, предварительно создав в домашнем каталоге директорию linpack:\nmkdir ./linpack\ncd ./linpack\nwget http://registrationcenter-download.intel.com/akdlm/irc_nas/9752/l_mklb_p_2018.3.011.tgz\ntar -xvzf ./l_mklb_p_2018.3.011.tgz\nДля AMD процессоров такой вариант я бы не стал пробовать, так как компилятор от Intel вставляет закладки, проверяющие процессор и если он не Intel...ну, подумаешь сотню-другую лишних инструкций процессор выполнит и заведомо проиграет в производительности. Для AMD лучше собрать Linpack из исходников, например, из\nэтих\n. В данной статье сборку из исходников рассматривать не буду - читайте README в source code.\nВернёмся к Intel-овскому Linpack-у. Там много чего лишнего и мне не нужного, а то, что нужно рассмотрю относительно версии 2018.3.011. Сразу же перейду в нужную директорию, чтоб потом не набирать длинные команды:\ncd ./l_mklb_p_2018.3.011/benchmarks_2018/linux/mkl/benchmarks/linpack\nТак как по умолчанию Intel-овский Linpack заточен под тестирование серверных Xeon-ов, создадим свой файл, который будет использоваться в качестве входных опций - просто уменьшим количество тестов, иначе устанем "пару-тройку дней" ждать завершения теста. У меня Linux Mint LMDE 3, поэтому я использую текстовый редактор xed, да и нравится он мне бОльшим функционалом, особенно, когда из-под root-а его запускать - он цвет на красный меняет. И так, создаём в этой же директории, в которую перешли, файл, например, my_test:\nxed ./my_test\nИ в созданный файл копируем следующее содержимое:\nShared-memory version of Intel(R) Distribution for LINPACK* Benchmark. *Other names and brands may be claimed as the property of others.\nSample data file lininput_xeon64.\n5 # number of tests\n1000 2000 5000 10000 20000 # problem sizes\n1000 2000 5008 10000 20000 # leading dimensions\n4 2 2 2 1 # times to run a test\n4 4 4 4 4 # alignment values (in KBytes)\nНу, и собственно запуск Linpack с созданным файлом:\n./xlinpack_xeon64 -i ./my_test\nИли:\n./xlinpack_xeon64 ./my_test\nМожно ещё заюзать stress-ng или stress, но поставленной мной задачи это всё-равно не решает. Вывода температуры, частот и времени от начала старта эти утилиты мне не показывают.\nТемпературу может показать sensors - подробнее про установку этой утилиты\nздесь\n. И эта утилита понадобится в дальнейшем рассмотрении моего вопроса. Линукс - велик и могуч: одна и та же задача может решаться по-разному. За Си мне лень было браться и я написал недостающую мне часть на BASH, ибо строк получилось не так уж и много. Без установленной sensors мой скрипт работать не будет. Фиксацию троттлинга естесственно не стал писать - его и так будет видно по сбросу частоты и температуре. Вот сам скрипт:\n#!/bin/bash\nout=0 # переменная контроля за тестовым процессом\npid_test='tty' # PID тестового процесса (сделан существующей директорией, чтоб запускать без аргументов)\ncpus_num=$(cat /proc/cpuinfo | grep -ci 'processor') # количество процессоров/ядер/потоков\necho -en "\\033[?25l" 1>&2 # скрыть курсор\necho -en "\\033[1m" 1>&2 # жирный шрифт\ncat /proc/cpuinfo | sed '/model name/!d;s/^[^:][^:]*: //g' | sort -u # вывод модели процессора\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\ntrap out=1 SIGINT # инициализация выхода по ctrl+c\ntrap out=2 SIGABRT # инициализация выхода по незапуску теста\nfor ((i=0; i<$cpus_num; i++)) # предварительная инициализация массива переменных\ndo\ncpu_crit_temp[$i]=$(sensors | sed '/Core '"$i"'/!d;s/.*crit = +\\(.*\\)[.][0-9]°C).*/\\1/')\nif [ -n "${cpu_crit_temp[i]}" ]\nthen\nlet cpu_red_temp[i]=cpu_crit_temp[i]-10\nlet cpu_yel_temp[i]=cpu_crit_temp[i]-30\ncpu_min_temp[$i]=1000\ncpu_max_temp[$i]=0\nfi\ndone\nstart_time=$(cat /proc/uptime | sed 's/[.][0-9][0-9] .*$//') # время запуска\nif [ -n "$1" ]\nthen\nscript_pid="$$"\n(if ! $@ > "$0_out" 2>&1 # запуск тестового файла\nthen\nkill -s SIGABRT $script_pid # послать сигнал основному скрипту об отказе запуска\nfi 2>/dev/null)&\npid_test="$!" # PID тестового процесса\nfi\nwhile (true) # контроль температуры\ndo\nfor ((i=0; i<$cpus_num; i++))\ndo\ncpu_freq[$i]=$(cat /sys/devices/system/cpu/cpu${i}/cpufreq/scaling_cur_freq | sed 's/...$//')\ncpu_temp[$i]=$(sensors | sed '/Core '"$i"'/!d;s/.*+\\(.*\\)[.][0-9]°C[ \\t]*(.*/\\1/')\nif [ -n "${cpu_temp[i]}" ]\nthen\n(( ${cpu_temp[i]} < ${cpu_min_temp[i]} )) && cpu_min_temp[$i]=${cpu_temp[i]}\nif (( ${cpu_temp[i]} > ${cpu_max_temp[i]} ))\nthen\ncpu_max_temp[$i]=${cpu_temp[i]}\ntime_max[$i]=$(cat /proc/uptime | sed 's/[.][0-9][0-9] .*$//')\nlet time_max[i]=time_max[i]-start_time\nfi\nif (( ${cpu_temp[i]} > ${cpu_red_temp[i]} ))\nthen\necho -en "cpu${i}:\\t"\necho -en "\\033[1m" 1>&2 # жирный шрифт\necho -n "${cpu_freq[i]} "\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho -en "MHz \\t"\necho -en "\\033[31;1m" 1>&2 # жирный красный шрифт\necho -n "${cpu_temp[i]}"\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho -en "°C \\t(min: ${cpu_min_temp[i]}°C; max: "\necho -en "\\033[31;1m" 1>&2 # жирный красный шрифт\necho -n "${cpu_max_temp[i]}"\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho "°C/${time_max[i]}sec) "\nelif (( ${cpu_temp[i]} > ${cpu_yel_temp[i]} ))\nthen\necho -en "cpu${i}:\\t"\necho -en "\\033[1m" 1>&2 # жирный шрифт\necho -n "${cpu_freq[i]} "\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho -en "MHz \\t"\necho -en "\\033[33;1m" 1>&2 # жирный жёлтый шрифт\necho -n "${cpu_temp[i]}"\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho -en "°C \\t(min: ${cpu_min_temp[i]}°C; max: "\necho -en "\\033[31;1m" 1>&2 # жирный красный шрифт\necho -n "${cpu_max_temp[i]}"\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho "°C/${time_max[i]}sec) "\nelse\necho -en "cpu${i}:\\t"\necho -en "\\033[1m" 1>&2 # жирный шрифт\necho -n "${cpu_freq[i]} "\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho -en "MHz \\t"\necho -en "\\033[32;1m" 1>&2 # жирный зелёный шрифт\necho -n "${cpu_temp[i]}"\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho -en "°C \\t(min: ${cpu_min_temp[i]}°C; max: "\necho -en "\\033[31;1m" 1>&2 # жирный красный шрифт\necho -n "${cpu_max_temp[i]}"\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho "°C/${time_max[i]}sec) "\nfi\nelse\necho -en "cpu${i}:\\t"\necho -en "\\033[1m" 1>&2 # жирный шрифт\necho -n "${cpu_freq[i]} "\necho -en "\\033[0m" 1>&2 # сброс параметров цвета\necho -e "MHz \\t "\nfi\ndone\ntime=$(cat /proc/uptime | sed 's/[.][0-9][0-9] .*$//')\nlet time=time-start_time\necho -en "Time:\\t$time sec. "\n[ ! -d "/proc/${pid_test}" ] && break # выход по окончании теста (лучший способ контроля по comm и cmdline, но...лень)\n[ "$out" != '0' ] && break # выход при ошибке теста\necho -en "\\033[${i}A\\r" 1>&2 # перенос курсора вверх на $i строк и на начало строки\nsleep 0.1 # пауза, чтоб вывод частот сильно не скакал\ndone\necho ''\necho -en "\\033[?25h" 1>&2 # включение курсора\nif [[ "$out" == '0' && -n "$1" ]]\nthen\ncat "$0_out" | sed '/^$/d;/Sample data/d;/CPU frequency/d;/Parameters are set/,/Data alignment value/d'\nrm -fR "$0_out"\nexit 0\nelif [[ "$out" == '1' && -n "$1" ]]\nthen\nkill -9 "$pid_test" 1>/dev/null 2>/dev/null\ncat "$0_out" | sed '/^$/d;/Sample data/d;/CPU frequency/d;/Parameters are set/,/Data alignment value/d'\nrm -fR "$0_out"\nexit 1\nelif [ "$out" == '1' ]\nthen exit 1\nelif [ "$out" == '2' ]\nthen\necho -en "\\033[31;1m" 1>&2\necho 'Error arg!'\necho -en "\\033[0m" 1>&2\nexit 2\nfi\nexit 0\nСильно не ругайте за скидывание управляющих символов в stderr (1>&2), но это дело привычки, если вдруг потом вывод скрипта в файл отправлять, а там все эти ESC-апе последовательности точно не нужны, вот так и будет терминал цветным, а файл чистым. Что-то я отвлёкся.\nЯ создал файл chk в директории с linpack-ом и записал скрипт в него, Вы можете сделать тоже самое, за исключением xed, если у Вас его нет:\nxed ./chk\nИ собственно то, ради чего всё затевалось - тест Linpack cо скриптом:\n./chk ./xlinpack_xeon64 -i ./my_test\nДа, я вижу, одно ядро нагрелось до критического TDP в 105°C за 86 секунд, но это мне ни о чём не говорит, а вот то, что с 50°C до 80°C процессор нагревается за 2 секунды - это уже показатель: термопасту точно пора менять - два года не менял, а вот с системой охлаждения останется вопрос, который проявят тесты после замены термопасты и термопроводящих прокладок на моём ноутбуке.\nПочему именно 80°C я взял за отправную точку? Да просто потому, что именно эта температура заложена в BIOS, как температуры начала скидывания частот, да ещё и начало включения кулера выставлена в 55°C в угоду энергосбережению, но BIOS - InsydeH20, да ещё и с проверкой своей хэш-суммы и белым списком девайсов - та ещё головная боль...будет программатор - займусь им вплотную.\nСкрипт писал на скорую руку и с ориентиром на Linpack, но он так же свободно работает и с другими консольными утилитами. Вот запуск с вышеизложенным sysbench:\n./chk sysbench --num-threads=4 --test=cpu --cpu-max-prime=100000 run\nКак видно из скриншота sysbench не даёт полную нагрузку на процессор, в отличии от Linpack-а...\nВот запуск с утилитой stress (подробнее про stress -\nздесь\n):\n./chk stress --cpu 16\nЕстественно выход/окончание теста с утилитой stress осуществляется вручную по\nCTRL+C\n, отсюда и Error: 1 выведенная моей переменной PS1 из-за подобной реализации выхода из скрипта через exit 1.\nСкрипт можно запустить и без опций, но тогда он только температуру и частоты в почти реальном времени показывает:\n./chk\nВ любом случае выход из скрипта осуществляется автоматически, по окончании теста или можно выйти, нажав\nCTRL + C\n:\nВ общем: поставленную для себя задачу я решил и даже лучше - появилась целая надстройка над тестовыми утилитами. Осталось ноутбук разобрать и поменять таки термопасту с прокладками: как вспомню - аж страшно становится...\nНет похожих записей\nОцените статью:\n4\n4,00\nTweet\nPin It\n	https://losst.ru/stress-test-protsessora-v-linux	116
121fbfbc-1cef-4a09-abe7-b1d8ce425565	Репозиторий не содержит файла release Ubuntu	ошибки;	Довольно часто при использовании сторонних PPA репозиториев во время обновления списка пакетов можно получить ошибку репозиторий не содержит файла release Ubuntu. Обычно она не мешает работе других репозиториев, но репозитории, которые выдают эту ошибку чаще всего не обновляются.\nВ этой небольшой статье мы разберем что означает эта проблема, а также пути ее решения. Статья ориентированна, в основном, на Ubuntu, но подойдет для Debian и всех основанных на нем или Ubuntu систем.\nСодержание статьи:\nКак исправить Репозиторий не содержит файла release Ubuntu?\n1. Нет ветки репозитория для вашей версии Ubuntu\n2. Вы используете старую версию системы\n3. Удаление не работающих репозиториев\nВыводы\nКак исправить Репозиторий не содержит файла release Ubuntu?\nФайл Release - один из самых важных файлов для работы репозитория в Ubuntu. Когда утилита apt обновляет список пакетов, она открывает адрес репозитория и пытается прочитать файл Release. В нем содержится основная информация о репозитории, а также адреса файлов packages.gz, в которых находятся списки пакетов, ссылки где их можно найти и контрольные суммы. Если этого файла нет, то репозиторий подключить невозможно.\nПричин этому может быть несколько. Либо репозиторий заброшен и больше не развивается, либо вы его неправильно настроили. В терминале эти ошибки обычно не мешают, а вот при попытке обновления через графический интерфейс могут возникнуть проблемы.\n1. Нет ветки репозитория для вашей версии Ubuntu\nСначала убедитесь, что вы используете правильные репозитории для своего дистрибутива. Например, утилита apt-add-repository при добавлении PPA репозитория добавляет к его адресу кодовое имя дистрибутива. У репозитория нет отдельной ветки для вашей системы, то он не сможет быть добавлен. Нужно вручную указать то, кодовое имя, для которого есть ветка.\nНапример, если вы пытаетесь добавить репозиторий ubuntu-audio-dev стандартным способом в Ubuntu, то получите ошибку:\nЗайдите на страницу этого PPA репозитория на Launchpad и проверьте есть ли версия для вашего дистрибутива. Как видите, здесь версии для Ubuntu 18.04 Bionic нет, есть только для Ubuntu 13.04 Raring:\nКонечно, такое использование репозиториев не очень безопасно, но если вам очень нужно его добавить, то можно найти файл репозитория в /etc/apt/sources.list.d/ и заменить в нем bionic на raring:\nls /etc/apt/sources.list.d/\nvi /etc/apt/sources.list.d/ubuntu-audio-dev-ubuntu-ppa-bionic.list\nТеперь, репозиторий загружается нормально\nsudo apt update\nСистема сообщает только что невозможно пройти проверку подлиности ключа, возможно, срок его действия уже истек. Чтобы игнорировать проверку подлинности репозитория по GPG добавить в строку конфигурации репозитория такой параметр:\n[trusted=yes]\n2. Вы используете старую версию системы\nТакже подобную ошибку вы можете получать если используете старую, уже не поддерживаемую версию Ubuntu. Дело в том, что после завершения срока поддержки, текущие репозитории пакетов переносятся на другой сервер - old-releases.ubuntu.com. Чтобы устанавливать программное обеспечение в этих дистрибутивах нужно добавить заменить все адреса archive.ubuntu.com и security.ubuntu.com на old-releases.ubuntu.com/ubuntu в файле /etc/apt/sources.list:\nsudo vi /etc/apt/sources.list\nТолько тогда нужные пакеты будут доступны. Это все касается не только Ubuntu, но и других дистрибутивов, только кодовые имена там будут другими.\n3. Удаление не работающих репозиториев\nЕсли таким способом ошибку устранить не удалось, остается только удалить проблемный репозиторий, чтобы он не выводил каждый раз ошибки и не мешал обновлению через графический интерфейс. Отключить репозиторий можно через графический интерфейс. Для этого откройте окно\n"Программы и обновления"\n:\nЗатем перейдите на вкладку\n"Другое ПО"\n:\nЗдесь нужно снять галочки с проблемных репозиториев для их отключения.\nТакже можно удалить полностью репозиторий через терминал, выполнив команду:\nsudo apt-add-repository --remove ppa://имя_репозитория/ppa\nНапример:\nsudo apt-add-repository --remove ppa://ubuntu-audio-dev/ppa\nИли еще можно удалить файл настроек репозитория из /etc/apt/sources.list.d/, но этот вариант не такой надежный, так, как в системе все еще останется ключ репозитория.\nВыводы\nВ этой статье мы рассмотрели как исправить ошибку: репозиторий не содержит файла release Ubuntu. Хоть это проблема не пользователя, а скорее самого репозитория, можно кое-что сделать чтобы ее исправить. Если у вас остались вопросы, спрашивайте в комментариях!\nНе работает перевод страниц в chrome Linux\nНоябрь 29, 2016\nРазрешение экрана VirtualBox в Ubuntu\nДекабрь 30, 2016\nОшибка access denied for user root localhost\nДекабрь 4, 2017\nОшибка device or resource busy\nМай 17, 2018\nОцените статью:\n4\n5,00\nTweet\nPin It\n	https://losst.ru/repozitorij-ne-soderzhit-fajla-release-ubuntu	116
dc98081e-5325-45ec-a086-d4d5408d755e	Как отключить SELinux в CentOS 7		SELinux - это относительно новая подсистема ядра, разработанная агентством национальной безопасности США для улучшения безопасности операционных систем на базе ядра Linux. SELinux создаёт свои атрибуты контроля доступа для файлов и папок, а также позволяет указывать, каким программам можно иметь к ним доступ.\nТаким образом, можно обезопасить систему от взлома, даже если злоумышленнику удастся взломать одну из запущенных программ, то он сможет получить доступ только к файлам, которые может открывать уязвимая программа. Так сложилось, что SELinux чаще всего используется в CentOS, а в Ubuntu больше применяется другая система - AppArrmor. Использование SELinux не всегда целесообразно, поскольку настройка системы с включённой системой безопасности усложняется в разы. Поэтому мы в этой статье разберём, как отключить SELinux CentOS 7.\nКак отключить SELinux в CentOS\nSELinux может работать в нескольких режимах:\nEnforcing\n- система безопасности запущена и работает, все попытки доступа к файлам, для которых не созданы разрешающие правила, блокируются;\nPermisive\n- система запущена и работает, но при попытке несанкционированного доступа к файлам, доступ не блокируется, а всего лишь заносится об этом запись в системный журнал. Это режим для отладки правил;\nDisabled\n- система полностью отключена и не работает.\nТакже есть несколько политик работы системы безопасности. По умолчанию SELinux в CentOS включена и работает согласно политике targeted. Это значит, что SELinux будет управлять только теми приложениями, для которых созданы правила. Все приложения, для которых правила не созданы, будут работать без ограничений. Этот принцип чем-то похож на работу AppArrmor. Существует также политика strict, это самая строгая политика, которая запрещает доступ ко всему, что не разрешено. Прочитать подробнее обо всём этом можно в статье\nнастройка SELinux\n.\nСначала необходимо посмотреть текущее состояние SELinux в системе:\nsestatus\nЗдесь мы видим, что SELinux включён (enforcing) и использует политику targeted.\nЕсли у вас используется политика strict, и вы не хотите полностью отключать SELinux, но хотите, чтобы система трогала ваши программы, то можно переключить политику на targeted. Для этого откройте файл /etc/selinux/config и в строке SELINUXTYPE установите значение targeted:\nsudo vi /etc/selinux/config\nSELINUXTYPE=targeted\nЧтобы изменения применились, систему надо перезагрузить. Переключить SELinux в режим permissive, когда система будет только предупреждать о несанкционированном доступе, можно, выполнив команду в терминале:\nsudo setenforce 0\nНо она будет действовать только до перезагрузки. Чтобы изменение действовало всегда, нужно изменить режим в конфигурационном файле /etc/selinux/config:\nsudo vi /etc/selinux/config\nSELINUX=permissive\nЧтобы отключить SELinux CentOS 7 полностью, откройте файл /etc/selinux/config и замените значение enforcing в параметре SELinux на disabled:\nsudo vi /etc/selinux/config\nSELINUX=enforcing\nТеперь можно перезагружать компьютер, и SELinux будет отключена. Также можно отключить SELinux через Grub, это может быть полезно, например, если вы не можете загрузить систему из-за неправильно настроенного SELinux. Для этого достаточно добавить параметр ядра selinux=0.\nОткройте конфигурационный файл grub - /boot/grub/grub.cfg и найдите там строчку запуска ядра, она начинается с linux... В её конец нужно добавить параметр:\nsudo vi /boot/grub/grub.cfg\nlinux /boot/vmlinuz-3.10.0-862.el7.x86_64 root=UUID=33a6fe0e-5576-4ff9-bd7f-7d451d670cab ro crashkernel=auto rhgb quiet LANG=ru_RU.UTF-8 selinux=0\nЭтот способ также удобен тем, что вы можете нажать кнопку E в меню Grub и внести все изменения на ходу перед загрузкой системы.\nВыводы\nВ этой небольшой статье мы разобрали, как отключить SELinux в CentOS 7. Это система безопасности, поэтому подумайте перед тем, как сделать это. Отключение SELinux CentOS 7 - это последний вариант и самое простое решение. Но, возможно, лучше всё настроить, чтобы сервер был более безопасным.\nНет похожих записей\nОцените статью:\n3\n3,67\nTweet\nPin It\n	https://losst.ru/kak-otklyuchit-selinux-v-centos-7	116
3846dd5b-2fea-4aac-964e-bd821e1bdf4a	Ошибка dracut initqueue timeout в CentOS 7	ошибки;	Ошибка dracut initqueue timeout CentOS 7 может встретиться вам при установке последних версий CentOS с флешки или ISO-образа. Сначала может показаться, что образ системы неверно загружен с интернета. Но это не так, с образом всё в порядке. Проблема кроется в методе записи образа на съемный носитель.\nЕсли вы используете специальную утилиту для записи, то проблемы может и не быть, но при обычной распаковке файлов образа на флешку она очень часто встречается. В этой статье мы рассмотрим, как исправить ошибку centos dracut initqueue timeout и успешно установить CentOS.\nОшибка "dracut initqueue timeout" CentOS 7\nОшибка выглядит следующим образом. Сначала система очень долго грузится:\nЕсли отключить заставку и перейти в текстовый режим, то вы увидите надпись "starting dracut initqueue hook", такая надпись будет показываться несколько минут:\nА затем на экран будет выведено очень много строк с надписью "dracut initqueue timeout starting timeout scripts" и система перейдёт в режим восстановления:\nЭта ошибка возникает потому, что загрузочный скрипт не может найти основные файлы системы и соответственно не может ничего загрузить. В конфигурационном файле grub нашего образа указано место, где надо искать эти файлы:\ninst.stage2=hd:LABEL=CentOS\\x207\\x20x86_64\nИ если бы флешка была записана программой, то она бы имела метку CentOS\\x207\\x20x86_64, и тогда бы всё работало.\nЧтобы исправить ошибку, можно записать образ на флешку с помощью любой из программ записи образов, например Etcher, или исправить метку в загрузчике. Второй способ сложнее, но он позволяет решить проблему, даже не загружая основную операционную систему.\nВ режиме восстановления, который открылся после возникновения ошибки, наберите blkid:\nblkid\nЗдесь мы видим, что у раздела /dev/sdd1, на который записана CentOS, метка DATA. Эту метку надо запомнить. Теперь перезагружаем систему:\nreboot\nВ меню выбора варианта загрузки Grub нажмите на первом пункте клавишу E:\nВ строке запуска ядра найдите опцию inst.stage2=hd:LABEL=CentOS\\x207\\x20x86_64 и замените метку CentOS\\x207\\x20x86_64 на DATA:\nЗатем нажмите\nF10\nили\nCtrl+X\nдля продолжения загрузки. Теперь система запустится нормально, и вы сможете продолжить установку:\nВыводы\nВ этой небольшой статье мы разобрали, как исправить ошибку "dracut initqueue timeout" CentOS 7, как видите, проблема вполне решаема. Если у вас остались вопросы, спрашивайте в комментариях.\nОшибка package has no installation candidate\nНоябрь 27, 2016\nЧто значит 502 bad gateway Nginx\nИюнь 15, 2017\nКак исправить 504 gateway time out Nginx\nАвгуст 16, 2017\nОшибка установки соединения с базой данных WordPress\nНоябрь 24, 2017\nОцените статью:\n1\n5,00\nTweet\nPin It\n	https://losst.ru/oshibka-dracut-initqueue-timeout-v-centos-7	116
21ca1745-7395-4e14-893c-189ba9c2eb15	Программы сканирования в Linux		Несмотря на то, что человечество ещё не может полностью отказаться от использования бумаги, многие люди уже предпочитают сканировать документы и фотографии и работать с ними в электронном формате. Но наличия сканера не достаточно. Вам ещё понадобится программное обеспечение для управления сканером.\nОднако у большинства сканеров нет официального программного обеспечения, которое бы работало в операционной системе Linux. Но по большей части это не имеет значения, потому, что для Linux уже существует несколько отличных программ для сканирования документов. Они совместимы со многими сканерами и хорошо справляются со своей задачей. Давайте рассмотрим простые, но гибкие и свободные программы для сканирования в Linux.\nСодержание статьи:\nПрограммы для сканирования Linux\n1. Simple Scan\n2. Skanlite\n3. Gscan2pdf\n4. Gimp\nВыводы\nПрограммы для сканирования Linux\n1. Simple Scan\nПрограмма Simple Scan - небольшая, быстрая, эффективная и лёгкая в использовании программа. Возможно, вы уже видели её раньше, потому что это программа по умолчанию для сканирования в окружении GNOME, которая используется во многих дистрибутивах.\nСканирование документа или фото выполняется в один клик мышки. После этого вы можете редактировать изображение, вращать его, а потом сохранить в формате JPG или PNG или же в формате документа PDF. Но надо сказать, что программа может работать медленно, даже если вы сканируете документы в не очень высоком разрешении. По умолчанию используются такие параметры: 150 DPI для текста и 300 DPI для фото. Вы можете изменить их в настройках.\nЕсли вы сканируете большой документ, вы можете настроить размещение страниц перед сохранением. Также можно отправить результат сканирования по Email.\n2. Skanlite\nSkanlite - это альтернатива Simple Scan для KDE. Утилита имеет те же функции, что и Simple Scan, плюс несколько дополнительных настроек. Вы можете оорганизовать автоматическое сохранение обработанных файлов, установить качество сканирования и указать, куда надо сохранять результат. Skanline поддерживает такие форматы: JPEG, PNG,BMP, PPM, XBM и XPM.\nОдна из интересных возможностей утилиты - сохранять разные участки отсканированного материала в разные файлы. Это может понадобиться, если вы хотите вырезать часть фото.\n3. Gscan2pdf\nЕщё одна старая, но популярная программа - gscan2pdf. Несмотря на её возраст, у неё есть несколько функций, которых нет у других программ в этом списке. И в то же время программа достаточно лёгкая. Кроме форматов изобаржения JPEG, PNG и TIFF, утилита позволяет сохранять результат сканирования в PDF и DJVU.\nТакже вы можете настроить цветной или чёрно-белый режим сканирования, размер бумаги и качество. Отсканированные страницы можно обрезать, вращать или удалять. Все эти функции вместе дают вам широкое пространство для действий.\n4. Gimp\nНаверное, вы уже знаете Gimp, как мощный графический редактор, но вы можете использовать эту программу и для управления своим сканером. Для этого надо установить программу XSane и плагин Xsane для Gimp. Обе программы доступны в официальных репозиториях. Затем откройте меню\nФайл\n->\nСоздать\n->\nСканер/Камера\n.\nВ этом окне осталось выбрать ваш сканер и нажать кнопку\nСканировать\n. Если такой вариант не работает, вы можете использовать плагин Gimp - QuiteInsane. С помощью любого из плагинов можно сделать из Gimp мощный инструмент для сканирования. Вы даже можете настроить несколько параметров сканирования, например цветной режим или чёрно-белый, а также разрешение сканирования. А дальше можно использовать все возможности Gimp для применения эффектов и фильтров к обработанному материалу.\nВыводы\nВсе выше перечисленные программы для сканирования Linux хорошо работают с большинством сканеров не зависимо от того, подключаются они через USB или через беспроводную связь. Возможно, с некоторыми принтерами или сканерами возникнут проблемы, тогда вам придётся установить официальные драйверы принтера для Linux.\nНет похожих записей\nОцените статью:\n6\n4,83\nTweet\nPin It\n	https://losst.ru/programmy-skanirovaniya-v-linux	116
2d618a70-4519-4d1b-a31c-8ba904ab083e	Тема MacOS для Ubuntu 18.04		Вы устали от внешнего вида окружения рабочего стола Ubuntu и хотите попробовать что-то новое, например интерфейс MacOS? Многие пользователи хотят установить интерфейс MacOS из-за его уникального дизайна и элегантного внешнего вида. И вы можете сделать интерфейс Ubuntu похожим на MacOS с помощью темы Mac OS Ubuntu.\nУже создано множество тем, которые полностью изменят внешний вид вашей операционной системы. Это Linux и здесь вы можете сделать всё, что захотите. В сегодняшней статье мы разберём, как устанавливается тема Mac OS для Ubuntu 18.04.\nСодержание статьи:\nКак сделать Ubuntu похожей на MacOS\n1. Выбор правильного окружения рабочего стола\n2. Установка темы Mac OSX Sierra Compact\n3. Установка темы Mac 11 GTK\n4. Установка иконок MacOS\n5. Активация темы и иконок\n5. Настройка док панели\n6. Установка обоев рабочего стола\n7. Установка шрифтов Mac\nВыводы\nКак сделать Ubuntu похожей на MacOS\nВ интернете доступны сотни тем, шрифтов, обоев и курсоров, которые помогут сделать Ubuntu похожей на Mac. Если на вашем компьютере уже установлен дистрибутив Ubuntu, вы можете найти в репозиториях несколько пакетов для этой цели, например: Macbuntu Transformation Pack, macOS Sierra и другие.\n1. Выбор правильного окружения рабочего стола\nВ Ubuntu можно использовать несколько вариантов окружения рабочего стола, например Gnome, Unity, Cinnamon, KDE Plasma. Но чтобы Ubuntu выглядела как Mac, нам нужно установить Gnome. Именно для этого окружения созданы самые лучшие темы, имитирующие MacOS.\nПоследняя версия Ubuntu поставляется по умолчанию с оболочкой Gnome. Если у вас предыдущая версия с Unity или установлено другое окружение, используйте такую команду для установки Unity:\nsudo apt install gnome-shell\nЕсли система попросит выбрать менеджер входа, выберите lightdm. Затем вам необходимо установить утилиту Gnome Tweak Tool для выбора и настройки тем. Для этого выполните:\nsudo apt update\nsudo apt install gnome-tweak-tool\nПосле завершения установки, выйдите из системы и войдите заново, или просто перезагрузите компьютер.\n2. Установка темы Mac OSX Sierra Compact\nДля оболочки Gnome существует несколько Mac-подобных тем в сети, но лучше всего будет установить тему Mac OSX Sierra Compact. Эта тема наиболее похожа на традиционную MacOS с её градиентами и визуальными эффектами. Скачать тему можно по\nссылке\n.\nЗагрузите самую свежую версию темы на вкладке\nFiles\nи распакуйте содержимое архива в папку ~/.themes. Для этого можно использовать пункт контекстного меню Nautilus -\nИзвлечь в...\n, где достаточно выбрать нужную папку:\nПапка начинается с точки, и это значит, что она скрыта. Чтобы отображать скрытые файлы, нужно нажать сочетание клавиш Ctrl+H. Если такой папки не существует, вы можете её создать.\n3. Установка темы Mac 11 GTK\nЕсли вы хотите более современный плоский дизайн, вы можете установить тему\nMacOS 11 GTK+ and Shell theme\n. Нам понадобится два файла: macOS11-GTK.zip и macOS11-Shell.zip.\nСкачайте их на вкладке Files и распакуйте содержимое в папку ~/.themes, так же как и в предыдущем пункте. Должно получиться вот так:\n4. Установка иконок MacOS\nИконки, стилизованные под MacOS X, можно скачать по этой\nссылке\n.\nПолученный файл надо распаковать в папку ~/.icons в домашней директории:\n5. Активация темы и иконок\nЗатем откройте Gnome Tweak Tool и на вкладке\nВнешний вид\nвыберите тему для приложений и Shell MacOS 11 или Sierra Compact:\nИконки активируются на этой же вкладке, в строке\nЗначки\n:\nЕсли пункт выбора темы для Shell не активен, перейдите на вкладку расширения и включите там расширение User Themes.\nДля полного применения темы необходимо перезагрузить компьютер.\nПосле активации темы Sierra Compact ваше окружение будет выглядеть вот так:\n5. Настройка док панели\nВы можете использовать боковую панель Ubuntu вместо док панели с помощью расширения\nDash to Dock\n. Чтобы опустить панель вниз, активируйте расширение через Gnome Tweak Tool, а затем откройте контекстное меню на значке лаунчера, в нём выберите пункт\nПараметры Dash to Dock\n, а затем\nРасположение на экране\n-\nвнизу\n:\nНо наиболее похожей на интерфейс MacOS будет панель\nPlank\n. Она может использоваться как для запуска приложений, так и для переключения окон. Для установки Plank используйте команду:\nsudo apt install plank\nУстановить тему MacOS для Plank можно из PPA-репозитория:\nsudo add-apt-repository ppa:noobslab/macbuntu\nsudo apt update\nsudo apt install macbuntu-os-plank-theme-v9\nЗатем останется добавить панель Plank в автозагрузку, при старте она будет автоматически скрывать док панель по умолчанию.\n6. Установка обоев рабочего стола\nПоследнее что необходимо сделать, чтобы ваша система выглядела как MacOS - установить правильные обои. Скачать обои MacOS от NoobsLab можно по\nссылке\n. Архив надо распаковать, а дальше выбирайте, что нравится:\n7. Установка шрифтов Mac\nСистемы MacOS известны своим красивым графическим интерфейсом с чистыми, красивыми шрифтами. Вы можете использовать OpenSource-версию шрифта Garuda или же использовать шрифты MacOS. Для их установки используйте команды:\nwget -O mac-fonts.zip http://drive.noobslab.com/data/Mac/macfonts.zip\nsudo unzip mac-fonts.zip -d /usr/share/fonts; rm mac-fonts.zip\nsudo fc-cache -f -v\nВыбрать шрифты для использования можно с помощью Gnome Tweak Tool:\nВыводы\nВ этой небольшой статье мы рассмотрели, как устанавливается тема Mac Ubuntu 18.04, а также разобрали как настроить шрифты, фон рабочего стола и док-панель. Так что если вы хотите, чтобы ваша система выглядела как MacOS, вы уже знаете, что делать.\nНет похожих записей\nОцените статью:\n5\n5,00\nTweet\nPin It\n	https://losst.ru/tema-macos-dlya-ubuntu-18-04	116
186eed16-760a-46fb-8703-e0c283ce6c6e	Установка и настройка Grafana		Если работаешь системным администратором или аналитиком, то часто приходится отображать данные о событиях или статистику в виде графиков и диаграмм, в зависимости от времени, когда они произошли. Для этого существует множество инструментов, и об одном из них мы поговорим в этой статье.\nСегодня рассмотрим установку и настройку Grafana - веб-инструмента для представления данных, связанных со временем, в виде очень красивых графиков и диаграмм. В качестве источника данных для Grafana можно использовать как множество различных сложных движков баз данных, включая Graphite, ElasticSearch, InfluxDB, Prometeus, так и более простых, например MySQL. В этой статье мы рассмотрим, как установить Grafana в Ubuntu 18.04, а также как настроить её для работы с influxdb.\nСодержание статьи:\nУстановка Grafana в Ubuntu\nУстановка Grafana в CentOS\nНастройка Grafana\n1. Первый вход\n2. Источники данных\n3. Создание Dashboards Grafana\n4. Настройка графиков Grafana\n5. Создание SingleStat\n6. Настройка панели\n7. Импорт и экспорт\nВыводы\nУстановка Grafana в Ubuntu\nВ официальных репозиториях дистрибутива пакета для этой программы нет, но вы можете установить её из официального репозитория самой программы. Чтобы добавить репозиторий, выполните такие команды:\ncurl https://packagecloud.io/gpg.key | sudo apt-key add -\nsudo add-apt-repository "deb https://packagecloud.io/grafana/stable/debian/ stretch main"\nЗатем нужно обновить список пакетов:\nsudo apt-get update\nУстановка Grafana Ubuntu:\nsudo apt-get install grafana\nЗатем запускаем сервис и добавляем его в автозагрузку:\nsudo systemctl start grafana-server\nsudo systemctl enable grafana-server\nТеперь убедимся, что сервис действительно запущен и не произошло никаких ошибок:\nsudo systemctl status grafana-server\nЕсли всё прошло хорошо, то в выводе вы увидите сообщение active(running), выделенное зеленым цветом.\nУ Grafana своя система авторизации, поэтому закрывать её обратным прокси не обязательно, если вы, конечно, не собираетесь добавлять для интерфейса SSL-сертификат. Но по умолчанию интерфейс доступен на порте 3000. Нам нужно добавить его в исключения брандмауэра. Для этого выполните:\nufw allow 3000/tcp\nЕсли на вашем сервере брандмауэр не настроен, то ничего делать не надо, порт будет доступен по умолчанию.\nУстановка Grafana в CentOS\nВ CentOS программа устанавливается похожим образом. Только добавление репозитория будет выглядеть совсем по-другому. Для добавления официального репозитория продукта создайте файл /etc/yum.repos.d/grafana.repo со следующим содержимым:\nvi /etc/yum.repos.d/grafana.repo\n[grafana]\nname=grafana\nbaseurl=https://packagecloud.io/grafana/stable/el/7/$basearch\nrepo_gpgcheck=1\nenabled=1\ngpgcheck=1\ngpgkey=https://packagecloud.io/gpg.key https://grafanarel.s3.amazonaws.com/RPM-GPG-KEY-grafana\nsslverify=1\nsslcacert=/etc/pki/tls/certs/ca-bundle.crt\nСохраните изменения с помощью\n:w\n, и можно устанавливать Grafana:\nyum -y install grafana\nЗатем, таким же образом, запустите сервис и добавьте его в автозагрузку:\nsystemctl start grafana-server\nsystemctl enable grafana-server\nДля управления брандмауэром в CentOS используется команда\nfirewalld\n. Чтобы разрешить доступ к программе извне, выполните:\nfirewall-cmd --add-port=3000/tcp --permanent\nfirewall-cmd --reload\nGrafana готова к использованию.\nНастройка Grafana\n1. Первый вход\nЧтобы войти в интерфейс Grafana, нужно ввести в адресной стройке адрес\nhttp://localhost:3000\nпри условии, что вы устанавливали сервер на локальный компьютер. Если программа установлена на другой компьютер или сервер, то нужно ввести именно его адрес.\nПри первом входе система спросит ваш логин и пароль. По умолчанию это admin - admin. Сразу же после успешного входа вам будет предложено ввести новый пароль для администратора:\n2. Источники данных\nДальше вы будете перенаправлены на домашнюю страницу:\nЗдесь нам система предлагает добавить источники, откуда будут загружаться данные. Для этого нажмите на зеленую кнопку\nAdd Data Source\n:\nВ открывшемся окне введите названия ресурса и выберите его тип, движок, откуда будут браться данные. В этом примере я буду использовать InfluxDB:\nВ разделе HTTP надо ввести IP-адрес сервера, где находится наша база данных InfluxDB или другой ресурс. InfluxDB, как и ElasticSearch, использует обычный HTTP API для выполнения запросов, который доступен на порте 8086. Таким образом, если вы установили базу данных на локальный компьютер, адрес будет таким - http://localhost:8086:\nЕсли база данных закрыта с помощью http-аутентификации, то ниже надо указать для неё данные. В самом низу нужно указать имя базы данных пользователя и его пароль для доступа к ней:\nЗатем нажмите кнопку\nSave\n. Если всё прошло успешно, то вы увидите сообщение, что источник успешно добавлен.\n3. Создание\nDashboards\nGrafana\nВернитесь на домашнюю страницу и нажмите кнопку\nNew dashboard\n:\nДоска создана. Теперь нам нужно заполнить её виджетами.\nСейчас доступно 9 разных виджетов:\nGraph\n- график;\nSingleStat\n- одиночный показатель;\nTable\n- таблица;\nHteatmap\n- тепловая карта;\nText\n- обычный текст;\nRow\n- разделитель, позволяющий создавать группы виджетов;\nDashboards List\n- список доступных досок;\nPlugins List\n- список плагинов;\nAlerts List\n- список предупреждений;\nПолезны нам для вывода информации только первые четыре, остальные используются для организации пространства или вывода меню программы. Давайте сначала создадим график.\n4. Настройка графиков Grafana\nТеперь разберём, как выполняется настройка графиков Grafana. Как вы догадались, для создания графика нужно нажать на кнопку\nGraph\n. После этого пустой график будет добавлен в рабочую область панели:\nНажмите на стрелочку около его заголовка и выберите в открывшемся меню\nEdit:\nРассмотрим содержимое интерфейса настройки более подробно:\nШапка\n- содержит кнопки: сохранить, поделиться, меню для выбора периода времени, за который будут браться данные, кнопку изменения интервала времени, кнопку обновления данных и кнопку возврата;\nГрафик\n- размещён под шапкой, показывает, как будет выглядеть ваш график;\nПанель вкладок\n- позволяет переключаться между разными вкладками настроек;\nНастройки\n- под панелью вкладок находятся настройки запроса к базе данных на получение данных;\nЭти настройки можно разделить на несколько пунктов:\nData Source\n- источник данных;\nFROM\n- таблица в базе данных или индекс;\nWHERE\n- условие отбора;\nSELECT\n- поле которые надо выбрать;\nGROUP BY\n- группировка значений.\nВ нашем примере у меня есть база с климатическими данными за определённый период, температурой и влажностью. В ней есть таблица rpi-dht22, в которой есть поля: time, humidity, temperature и location. Структура документа influxdb:\n{\n"measurement"\n: rpidht22,\n"tags"\n: {\n"location"\n: indor/outdor,\n},\n"time"\n: ГГГГ-ММ-ДДTчч:мм:ссZ,\n"fields"\n: {\n"temperature"\n: температура,\n"humidity"\n: влажность\n}\n}\nОбратите внимание, если вы хотите, чтобы InfluxDB могла нормально работать с временем, нужно, чтобы оно было в правильном формате. Правильный формат - это\nГГГГ-ММ-ДД\nT\nчч:мм:сс\nZ\n, где T и Z ни на что не заменяются. Если время будет не в таком формате, то функции группровки по времени могут не работать.\nВ качестве источника выбираем ранее созданный источник\nКлимат\n, таблица - rpidht22, а поле temperature. Когда вы будете открывать каждый из пунктов, программа предложит вам выбрать одно из доступных значений. Это очень удобно:\nЕсли в базе есть данные, то они уже должны начать отображаться. Если не отображаются, попробуйте добавить больше данных или измените период или интервал времени:\nЕсли всё ещё что-то не работает, вы можете нажать кнопку\nQuery Inspector\nна панели вкладок и посмотреть запрос, который используется для получения данных, его можно потом выполнить отдельно в интерфейсе базы данных, поэкспериментировать и понять, что не работает.\nСейчас мы на вкладке\nMetrics\n. Переключившись на вкладку\nGeneral\nмы можем настроить имя графика в поле\nTitle\n:\nСохранив график, вы вернётесь к нашей панели и получите такой результат:\nВот такие графики Grafana можно получить. Если добавить несколько полей данных для графика с помощью кнопки\nAdd Query\n:\nТо на одном полотне будет отображаться два графика:\n5. Создание SingleStat\nВиджет\nSingleStat\nпозволяет отображать усреднённое значение показателя, а также шкалу и его текущую позицию на ней. Чтобы добавить новый элемент на панель, нажмите кнопку\nAdd Panel\n:\nЗатем выберите пункт\nSingleStat\n:\nНастройка источников данных выполняется точно также, как и для графика, только сюда можно добавить лишь один показатель.\nОсобенность этого виджета в том, что он берёт все данные и применяет к ним определённую функцию, а затем выводит результат. По умолчанию применяется функция\naverage\n. Я хочу знать текущую температуру, для этого мне надо получить последнее значение из списка, а не среднее. Функцию обработки данных можно изменить на вкладке\nOptions\n. Для последнего значения выберите в поле\nStat\nзначение\nCurrent\n:\nЧтобы включить отображение шкалы, найдите на вкладке\nOptions\nпункт\nGuage\nи поставьте напротив него галочку. Здесь же можно указать максимальное и минимальное значение:\nВот такая панель получится в результате:\n6. Настройка панели\nИмя панели вы можете задать, нажав на кнопку с шестерёнкой. Затем введите нужное имя в поле\nName\n:\nКак вы, возможно, уже заметили, взявшись за нижний правый угол можно менять размеры виджетов, а за заголовок - перетягивать их в другое место. Добавив несколько виджетов и разделив температуру с помощью условия\nWHERE\nна улицу и дом, получаем такую панель:\nТаблица и тепловая карта выглядят вот так:\nПосле внесения изменений не забывайте сохранить панель.\n7. Импорт и экспорт\nГотовую панель можно экспортировать и импортировать на другом сервере. Для этого есть кнопка\nShare\n:\nЗдесь перейдите на вкладку\nExport\nи нажмите кнопку\nSave to file.\nТеперь полученный файл вы можете использовать для импорта на другой машине. Для этого выберите в меню\nDashboard\n->\nManage\n:\nВ открывшемся окне нажмите кнопку\nImport\n, теперь осталось выбрать файл и выбрать источник, откуда будут браться данные.\nВыводы\nGrafana - это очень мощная система построения графиков и мониторинга статистики. У неё много функций и их невозможно охватить одной статьей, я рассказал только про работу с InfluxDB и построение простых графиков, но этого будет вполне достаточно, чтобы начать работу, а дальше вы уже разберётесь. А какие системы статистики используете вы? Почему? Напишите в комментариях!\nНет похожих записей\nОцените статью:\n5\n4,00\nTweet\nPin It\n	https://losst.ru/ustanovka-i-nastrojka-grafana	116
023dc38c-6ad3-4313-93a2-2e9e71b24216	Cписок установленных пакетов CentOS	centos;	Одни из самых частых задач, которые приходится выполнять системному администратору, - это установка, удаление и управление программным обеспечением. Иногда необходимо получить полный список установленных пакетов CentOS 7. Это нужно для создания резервной копии системы или для поиска определённого пакета.\nВ этой небольшой статье мы разберём несколько способов посмотреть установленные программы в CentOS через терминал.\nСодержание статьи:\nУстановленные пакеты CentOS 7\n1. Пакетный менеджер RPM\n2. Пакетный менеджер YUM\n3. Дополнительные утилиты YUM-Utils\nВыводы\nУстановленные пакеты CentOS 7\n1. Пакетный менеджер RPM\nRPM или Red Hat Package Manager - это низкоуровневый пакетный менеджер, который используется во всех дистрибутивах семейства Red Hat. Его можно сравнить с аналогичным инструментом в Ubuntu - dpkg. Уже существуют более высокоуровневые утилиты, например тот же YUM или DNF, но при необходимости можно использовать и rpm.\nЧтобы посмотреть список всех установленных пакетов, необходимо использовать опцию\n-q\n, которая указывает, что надо выполнить запрос, вместе с опцией\n-a\n, она отображает все установленные пакеты:\nsudo rpm -qa\nЕсли вы хотите найти определённую группу пакетов, можно отфильтровать вывод с помощью\ngrep\n:\nsudo rpm -qa | grep google\nДля сохранения вывода в файл используйте такую команду:\nsudo rpm -qa > packages.txt\nПозже этот список можно использовать для автоматической установки всех этих пакетов в другой системе. Для установки нужно использовать\nYUM\n:\nsudo yum install $(cat packages.txt)\nС помощью опции\n--last\nможно вывести время установки каждого пакета:\nsudo rpm -qa --last\nПосмотреть более подобную информацию об определённом пакете можно с помощью опции\n-i\n:\nsudo rpm -qi wget\nС помощью опции\n-l\nможно вывести список файлов пакета centos:\nrpm -ql wget\n2. Пакетный менеджер YUM\nЭто основной пакетный менеджер, который используется в CentOS 7. Чтобы получить список установленных пакетов с помощью\nнеобходимо использовать команду\nlist\n:\nsudo yum list installed\nТакже вы можете получить список всех доступных пакетов:\nsudo yum list available\nС помощью параметра update можно найти все пакеты, для которых есть обновления:\nsudo yum list update\nВывести все пакеты можно с помощью параметра\nall\n:\nsudo yum list all\nЕсли вы хотите получить только список пакетов для установки, используйте\nawk\n:\nsudo yum list installed | awk '{print $1}'\n3. Дополнительные утилиты YUM-Utils\nПакет\nYUM-Utils\n- это набор утилит, реализующих дополнительные возможности для управления репозиториями, установки и отладки пакетов, поиска пакетов и много другого. Для установки набора программ используйте:\nsudo yum install yum-utils\nЧтобы посмотреть установленные пакеты CentOS, используйте команду repoquery:\nsudo repoquery -a --installed\nС помощью команды\nyumdb\nвы можете вывести все пакеты, установленные из определённого репозитория:\nsudo yumdb search from_repo base\nВыводы\nВ этой небольшой статье мы рассмотрели, как посмотреть установленные пакеты СentOS 7 с помощью пакетного менеджера RPM, YUM и дополнительных утилит. Как видите, это очень просто.\nУстановка пакетов в CentOS 7\nФевраль 4, 2017\nУстановка PHP 7 в CentOS\nСентябрь 9, 2017\nОбновление системы CentOS 7\nОктябрь 9, 2017\nУстановка zabbix CentOS 7\nДекабрь 12, 2017\nОцените статью:\n1\n5,00\nTweet\nPin It\n	https://losst.ru/cpisok-ustanovlennyh-paketov-centos	116
1a70e6a5-b677-4576-b7fd-522b6d06d444	Установка Grub Customizer в Ubuntu 18.04	grub;ubuntu;	Для загрузки операционных систем семейства Linux используется загрузчик Grub. Это отдельная программа, которая запускается самой первой и позволяет пользователю выбрать, какую операционную систему стоит запустить, а также настроить некоторые параметры запуска.\nВсе настройки Grub выполняются через текстовые конфигурационные файлы, однако со временем появилось множество программ, с помощью которых можно выполнять все нужные изменения в графическом интерфейсе. Одна из таких программ - Grub Customizer. В этой статье мы разберём, как установить Grub Customizer в Ubuntu 18.04, а также как пользоваться этой программой.\nСодержание статьи:\nУстановка Grub Customizer в Ubuntu\nКак пользоваться Grub Customizer\n1. Настройка пунктов меню\n2. Создание нового пункта\n3. Таймаут и пункт по умолчанию\n4. Параметры ядра Grub\n5. Внешний вид Grub\n6. Сохранение настроек\nКак удалить Grub Customizer\nВыводы\nУстановка Grub Customizer в Ubuntu\nК сожалению, в официальных репозиториях программа не поставляется, поэтому для её установки нам понадобится подключить PPA-репозиторий:\nsudo add-apt-repository ppa:danielrichter2007/grub-customizer\nЗатем надо обновить списки репозиториев:\nsudo apt update\nИ только после этого можно установить Grub Customizer Ubuntu 18.04:\nsudo apt install grub-customizer\nПрограмма установлена, и это было не сложно. Теперь можно перейти к настройке.\nКак пользоваться Grub Customizer\nЗапустить программу можно через терминал или из главного меню системы:\nПосле запуска ей будет нужно несколько минут на то, чтобы обнаружить все установленные операционные системы, а потом можно переходить к настройке.\n1. Настройка пунктов меню\nНа первой вкладке программа позволяет настроить пункты меню. Можно переименовать, переместить вверх или вниз, удалить или изменить код каждого из пунктов. Для этого просто воспользуйтесь контекстным меню:\nМенять пункты местами можно также с помощью стрелок вверх/вниз на панели инструментов. Стрелки вправо/влево позволяют вносить и выносить пункты меню из папок. Если что-то было сделано неправильно, можно перезагрузить конфигурацию кнопкой с круговой стрелкой.\n2. Создание нового пункта\nС помощью кнопки со значком плюса можно создать новый пункт. Существует несколько типов пунктов. Например, Linux ISO позволяет создать загрузочную запись для iso-образа Linux. Для этого достаточно выбрать нужный образ:\nС помощью варианта Chainloader можно запустить загрузчик с другого раздела, например загрузчик Windows. Для этого достаточно выбрать раздел:\nИли вы можете ввести текст конфигурации сами, выбрав вариант\nПрочее\n:\n3. Таймаут и пункт по умолчанию\nНа второй вкладке можно настроить пункт меню, который будет загружаться по умолчанию:\nА также время ожидания для загрузки пользователем. Вообще не ожидать ввода пользователя и отключить меню можно, выставив значение ноля для этой настройки.\n4. Параметры ядра Grub\nЧуть ниже на этой же вкладке вы можете указать параметры ядра, которые будут передаваться для всех пунктов меню по умолчанию, например, у меня прописано verbose, чтобы видеть как можно больше информации о системе во время загрузки:\nТакже, нажав кнопку\nДополнительные параметры\n, можно более тонко настроить, как будут передаваться параметры ядру и как будет создаваться конфигурационный файл:\n5. Внешний вид Grub\nСамое интересное для многих пользователей - это внешний вид загрузчика. На третьей вкладке можно настроить цвета фона, рамки и шрифта загрузчика, а также фоновое изображения. Пункты, отвечающие за эти настройки, находятся в левой части окна:\nТакже на этой вкладке можно установить и применить уже существующие темы для Grub Customizer. Тему по своему вкусу можно найти на\ngnome-look.org\n. Дальше вам достаточно скачать архив с темой, выбрать, открыть его в программе, нажав кнопку со значком плюс напротив пункта\nТема\n:\nПосле этого откроется редактор файлов темы, где вы можете удалить или добавить новые файлы.\n6. Сохранение настроек\nЧтобы сохранить любые изменения, нажмите кнопку\nСохранить\n.\nТолько после этого внесенные изменения запишутся в конфигурационный файл Grub.\nКак удалить Grub Customizer\nУдалить Grub Customizer Ubuntu можно точно так же, как вы его и устанавливали:\nsudo apt remove --autoremove grub-customizer\nЗатем вы можете удалить PPA через утилиту управления источниками приложений, чтобы полностью вычистить систему от остатков этой программы.\nВыводы\nВ этой небольшой статье мы рассмотрели, как выполняется установка Grub Customizer Ubuntu 18.04, а также основы использования этой программы. С помощью неё вы можете сделать свой загрузчик красивым, и для этого не нужно разбираться в особенностях конфигурации Grub.\nДиспетчер задач в Ubuntu\nМай 15, 2015\nКак установить mc в Ubuntu 18.04\nИюнь 28, 2018\nСпящий режим в Ubuntu\nМай 28, 2018\nНастройка Ubuntu 18.04 после установки\nМай 1, 2018\nОцените статью:\n3\n5,00\nTweet\nPin It\n	https://losst.ru/ustanovka-grub-customizer-v-ubuntu-18-04	116
6d686837-5934-4fcb-a596-5c7fac837771	Автоматический вход Ubuntu	ubuntu;	Пользователи домашних компьютеров с операционной системой Windows привыкли к тому, что авторизация в системе проходит автоматически и им не нужно вводить логин и пароль каждый раз при запуске компьютера. В домашних условиях  это вполне оправдано, поскольку никто чужой к вашему компьютеру получить доступ не может, а на ввод пароля уходит лишнее время.\nВ Ubuntu тоже поддерживается автоматический вход, и система даже предлагает включить автовход во время установки. Но все настройки можно выполнить и гораздо позже. В этой статье мы рассмотрим, как включить автоматический вход Ubuntu.\nСодержание статьи:\nАвтоматический вход Ubuntu\nОтложенный вход в Ubuntu\nВыводы\nАвтоматический вход Ubuntu\nПеред тем, как мы перейдём к настройке, нужно сказать, что с автовходом в Ubuntu есть одна проблема. Он будет нормально работать только если на вашем компьютере не более одного пользователя, для которого это разрешено. В противном случае, независимо от того включён автологин или нет, вам будет показываться список пользователей и нужно будет ввести пароль.\nЧтобы включить автоматический вход, откройте\nПараметры системы\n, затем\nСведения о системе\n, а затем\nПользователи\n:\nЧтобы получить возможность менять настройки, нажмите кнопку\nРазблокировать\nи введите пароль пользователя:\nДалее вам нужно поставить переключатель напротив надписи\nАвтоматический вход\nв положение "включён".\nНа этом всё, теперь при перезагрузке компьютера, авторизация будет выполняться автоматически. Эти же действия можно выполнить через конфигурационный файл. Для этого откройте /etc/gdm/custom.conf и добавьте туда такие строчки в секцию daemon:\nvi /etc/gdm/custom.conf\nAutomaticLoginEnable=True\nAutomaticLogin=имя_вашего_пользователя\nЭтот способ аналогичнен первому в графическом интерфейсе.\nОтложенный вход в Ubuntu\nКак я уже сказал, автоматический вход в систему Ubuntu не будет работать, если у вас есть несколько пользователей. Но проблема решаема. Можно использовать отложенный вход. Сначала открывается меню со списком пользователей и, если в течении указанного времени ничего не происходит, выполняется вход под нужной вам учётной записью автоматически.\nvi /etc/gdm/custom.conf\nTimedLoginEnable = true\nTimedLogin =имя_пользователя\nTimedLoginDelay = 10\nТак намного удобнее, если у вас есть несколько пользователей и вы хотите, чтобы вход в систему выполнялся автоматически.\nВыводы\nВ этой небольшой статье мы разобрали, как настроить автоматический вход Ubuntu. Как видите, это очень просто и может быть полезным при использовании Linux дома.\nУстановка и настройка FreeNX\nАвгуст 25, 2015\nУстановка VirtualBox в Ubuntu 18.04\nМай 25, 2016\nУстановка DeadBeef Ubuntu 16.04\nИюнь 20, 2016\nОцените статью:\n3\n5,00\nTweet\nPin It\n	https://losst.ru/avtomaticheskij-vhod-ubuntu	116
2d698fae-a9c4-4e3c-8951-b6e2df3de495	Как отключить firewall CentOS 7		Брандмауэр или фаервол - это программное обеспечение, которое позволяет контролировать все входящие и исходящие сетевые подключения компьютера. На больших предприятиях под эти задачи выделяется отдельный сервер, на обычных компьютерах же это просто программа. Основная её задача - защищать локальные процессы от подключения к ним из сети, потому что большинство из них не используют аутентификацию и к ним можно получить доступ без подтверждения.\nВо всех дистрибутивах используется фаервол iptables, который встроен в ядро. Довольно часто пользователи интересуются, как отключить firewall CentOS 7. Отключить его нельзя, потому, что это модуль, встроенный в ядро, но можно убрать все запреты, чтобы Firewall пропускал все приходящие к нему сетевые пакеты. Дальше мы рассмотрим, как это сделать.\nКак отключить firewall CentOS 7\nВ CentOS тоже используется firewall iptables, но для удобства его настройки разработчики Red Hat создали оболочку firewalld. Она тоже работает через командную строку, но имеет более простые и понятные команды. Сначала посмотрим текущие правила iptables:\niptables -L\nБольшинство этих правил добавлены с помощью firewalld. Чтобы их убрать, не обязательно сейчас всё удалять. Просто остановите службу firewalld:\nsystemctl stop firewalld\nТеперь в iptables будут только правила по умолчанию, которые всё разрешают:\nПосле перезагрузки компьютера всё вернётся на свои места, чтобы этого не произошло, надо убрать сервис из автозагрузки:\nsystemctl disable firewalld\nТакже можно полностью скрыть сервис, чтобы другие скрипты не смогли его запустить:\nsystemctl mask firewalld\nЧтобы вернуть на место брандмауэр CentOS, используйте три команды:\nsystemctl unmask firewalld\nsystemctl enable firewalld\nsystemctl start firewalld\nИли же вы можете вовсе его не использовать после отключения, а использовать вместо него iptables.\nВыводы\nВ этой небольшой статье мы рассмотрели, как отключить firewall CentOS 7. Как видите, это очень просто. Если у вас остались вопросы, спрашивайте в комментариях.\nНет похожих записей\nОцените статью:\n3\n4,00\nTweet\nPin It\n	https://losst.ru/kak-otklyuchit-firewall-centos-7	116
90324343-a4b3-478f-a9ab-9b43003fc42b	Поиск файла в Linux		В операционных системах семейства Linux все объекты ОС: и данные, и управляющие элементы - являются файлами в файловой системе. Поэтому поиск файлов становится очень важной задачей. И если опытные пользователи уже знают, что и где находится, то для новичков будет очень полезным узнать, как найти местоположение того или иного файла, будь то программа, изображение или документ.\nВ Linux существует множество способов поиска, как в графическом интерфейсе, так и через командную строку. В сегодняшней статье мы разберём, как выполнять поиск файла в Linux с помощью всех этих средств. Но начнём с программ, у которых есть графический интерфейс.\nСодержание статьи:\nПоиск файла в Linux через графический интерфейс\n1. Главное меню системы\n2. Файловые менеджеры\n3. Gnome Search\n4. SearchMonkey\n5. Recoll\nПоиск файлов в Linux через терминал\n1. find\n2. locate\n3. grep\n4. whereis\nВыводы\nПоиск файла в Linux через графический интерфейс\n1. Главное меню системы\nГлавное меню операционной системы позволяет, как правило, не только запускать программы, но и искать их, а также искать файлы. Такая возможность есть как в Gnome, так и в KDE. В главном меню Gnome вы можете ввести нужную фразу для поиска:\nНо у такого поиска есть значительный недостаток. Он рассчитан больше на поиск программ, а не на поиск файлов, поэтому ищет только в домашней папке и не углубляется далеко в файловую систему.\n2. Файловые менеджеры\nБольшинство файловых менеджеров тоже предоставляют возможности поиска файлов, в том числе Dolphin и Nautilus. Здесь вы можете выбрать папку, в которой будет выполняться поиск, а также настроить дополнительные параметры поиска. В Nautilus для запуска поиска вам достаточно нажать кнопку со значком лупы, а потом ввести данные в строку поиска. Например, найдём все фото, сделанные 18 ноября.\nОткрыв стрелочку дополнительных параметров можно выбрать период, за который был создан интересующий нас документ, а также тип документа.\nВ качестве поискового запроса можно использовать символы подстановки: ? и *. Но для более точного поиска придётся использовать сторонние программы.\n3. Gnome Search\nУтилита Gnome Search по умолчанию поставляется не всегда, но вы можете установить её из центра приложений или через официальные репозитории. Она предоставляет такие же возможности, как и файловый менеджер, плюс здесь можно искать по содержимому файлов, что иногда очень удобно.\n4. SearchMonkey\nСледующая программа в нашем списке - SearchMonkey. Она позволяет искать файлы по регулярным выражениям. Здесь тоже можно выполнять поиск файла, как по имени, так и по содержимому фала, можно выбрать диапазон дат и так далее. Но основное преимущество этой программы - возможность везде использовать регулярные выражения.\n5. Recoll\nЕсли вам приходится работать с большой библиотекой текстовой информации и искать данные по содержимому файла, то вам будет полезна утилита Recoll. Это полноценный поисковый движок для поиска документов. Установить программу можно из официальных репозиториев:\nsudo apt install recoll\nСразу же после запуска она предложит вам создать индекс документов, которые есть в вашем домашнем каталоге.\nИ только после создания индекса вы сможете выполнять по нему поиск. Далее, вам будет достаточно ввести запрос, например Wi-Fi, и вы увидите все файлы, которые содержат это слово с примерами вхождений, отсортированные по релевантности:\nДля работы с большим количеством текстовых данных это может быть очень удобно. Программа понимает множество офисных форматов, среди которых pdf, djvu, doc, docx, odf, а также умеет находить такие файлы в архивах.\nПоиск файлов в Linux через терминал\nЕсли графические утилиты рассчитаны на работу обычного пользователя и поиск в домашней папке, то консольные программы предоставляют более гибкие возможности поиск для всех файлов, включая системные и виртуальные.\n1. find\nСамая часто используемая команда поиска файла в Linux на данный момент - это find. Она имеет множество возможностей: вы можете искать файлы по имени, дате изменения, создания, использовать регулярные выражения и маски, выполнять определённые действия для найденных файлов, настраивать глубину поиска и многое другое. Например, найдем все файлы, которые начинаются на "Снимок" в папке ~/Изображения:\nfind ~/Изображения -iname "Снимок*"\nБолее подробную информацию об этой команде читайте в статье\nкоманда find\n.\n2. locate\nКоманда locate считается устаревшей и уже была удалена из многих дистрибутивов. Она выполняет поиск не в реальном времени, как find, а по ранее созданной базе файлов, но она делает только поиск файла по имени Linux. Вы вводите слово, которое вас интересует, и утилита выдаёт все известные ей файлы, имя которых содержит такое слово. Возможно использовать регулярные выражения. Например, найдем все файлы, в имени которых содержится passwd:\nlocate passwd\nОбратите внимание, что если файл был добавлен после создания базы, то он найден не будет.\n3. grep\nУтилита grep позволяет не только фильтровать вывод других команд, но и искать по содержимому файловой системы. Для этого достаточно использовать опцию\n-r\nи указать папку, в которой надо искать текст. Например, найдём все файлы в /etc/, которые содержат строчку error_reporting:\nsudo grep -r "error_reporting" /etc/\nС помощью grep очень удобно искать, где находится нужная конфигурация или же проверять, не содержат ли файлы с кодом чего-нибудь подозрительного. Подробнее про использование grep читайте в статье\nпоиск текста в файлах Linux\n.\n4. whereis\nУтилита whereis достаточно простая и решает только одну задачу. Она показывает, где находится исполняемый файл, переданной ей программы. Например, если мы хотим узнать, где лежит grep, достаточно выполнить:\nwhereis grep\nВыводы\nВ этой статье мы разобрали, как выполнить поиск файла в Linux различными способами, начиная от графического интерфейса и заканчивая терминалом. Как видите, здесь есть множество вариантов, которые позволят вам решить любые задачи по поиску файлов. Возможно, вам также будет интересна статья о том,\nкак узнать pid процесса в Linux\n, который использует файл, порт или изменяет данные.\nНет похожих записей\nОцените статью:\n7\n4,71\nTweet\nPin It\n	https://losst.ru/poisk-fajla-v-linux	116
2914cd43-1f3a-40ee-9f3b-13dbcc769f13	Сетевой шлюз на Orange Pi R1 и Yocto Project		Yocto Project - это совместный Open Source проект для упрощения разработки дистрибутивов для встраиваемых систем. Yocto содержит большое количество шаблонов, метаданных и инструментальных средств сборки, и  поддерживает очень большое количество аппаратных платформ.\nPoky – это эталонная система сборки в рамках проекта Yocto Project. Название Poky также относится к эталонному дистрибутиву Linux, который создается этой системой сборки и может быть чрезвычайно минималистичным (core-image-minimal). В данной статье мы будем руководствоваться шаблоном core-image-minimal и на его основе создадим рецепт сборки дистрибутива для шлюза.\nСодержание статьи:\nУстановка Yocto Project в Ubuntu\nНазначение проекта сетевого шлюза\nТребования к оборудованию\nМеханизм сборки дистрибутива в Yocto Project\nСтруктура слоя "meta-router-bs"\nПакет поддержки платформы "Orange Pi"\nПоддержка USB сетевых плат в "Orange Pi Zero"\nМеханизм поддержки фрагментов конфигураций ядра\nНастройка сетевого интерфейса шлюза\nНастройка DHCP сервера на шлюзе\nФильтрация сетевых пакетов - функции "Брандмауэра"\nКонфигурация "Зоны" шлюза\nИнтерфейсы и хосты\nПолитики\nНастройка трансляции сетевых адресов NAT\nНастройка правил фильтрации\nОстановка Shorewall\nКонфигурация Shorewall\nПримеры настройки Shorewall\nРецепт сборки Shorewall для слоя meta-router-bs\nРецепт сборки образа Router-bs\nДополнительные рецепты включенные в слой\nПоддерживаемые платформы\nКраткая инструкция по созданию прошивки\nАдминистративный пароль по умолчанию\nПервое включение устройства\nЗапись прошивки на карту памяти microSDHC\nВыводы\nУстановка Yocto Project в Ubuntu\nДля установки Yocto Project совместно со слоем поддержки платы "Orange Pi R1"\nвы можете использовать "bash" скрипт следующего содержимого:\nПосле запуска установочного скрипта система сборки Poky будет располагаться каталогом выше, например если вы запустили установочный скрипт install.sh из каталога /home/user/router-bs, то система сборки Poky, будет установлена в каталог /home/user/poky-router\nСкрипт прописывает две переменных в конфигурационном файле\n"build/conf/local.conf"\n"MACHINE"\n- указывает архитектуру под которую собирается дистрибутив;\n"PACKAGE_CLASSES"\n- указывает формат пакетов для установки ПО.\nИ добавляет два слоя в Poky, в файле  "\nbuild/conf/bblayers.conf\n"\nНазначение проекта сетевого шлюза\nПроект предназначен для самостоятельной сборки с "нуля" Linux дистрибутива для одноплатного компьютера "Orange Pi R1" c минимальным набором программ, достаточным для использование Orange Pi R1 в качестве простого шлюза.\nШлюз это компьютер, который подключен как минимум к двум разным подсетям, и который умеет передавать пакеты из одной подсети в другую.\nОсновная функция нашего "Шлюза" - фильтрация внешнего (интернет) сетевого трафика приходящего на один сетевой интерфейс и передача его после фильтрации на другой сетевой интерфейс связанный с локальной сетью т.е. шлюз выполняет функцию "Брандмауэра" для защиты внутренней сети. Также шлюз будет обеспечивать подключение пользователей внутренней сети к ресурсам Интернет от имени своего ip адреса, т.е обеспечивать так называемую трансляцию сетевых адресов NAT (Network Address Translation).\nЕще одной функцией "Шлюза" будет возможность получения от него динамических ip адресов, т.е. любая новая машина в локальной сети с помощью широковещательного запроса сможет получить ip адрес из выделенного диапазона адресов.\nТаким образом "Шлюз" будет выполнять роль DHCP сервера (предполагается что шлюз одним сетевым интерфейсом подключен к сетевому коммутатору локальной сети).\nТребования к оборудованию\nДля создания сетевого шлюза, нам понадобиться одноплатный компьютер «Orange Pi R1» - на базе SoC Allwinner H2+ с характеристиками:\n4 ядра ARM Cortex-A7 с тактовой частотой 1.2 ГГц;\nОбъём оперативной памяти — 256 Мбайт DDR3 SDRAM;\nНа плате размещены два сетевых интерфейса;\nКорпус;\nКарта памяти - microSDHC, любого размера начиная от 8Гб (просто меньшего размера сейчас трудно найти);\nМеханизм сборки дистрибутива в Yocto Project\nВ Yocto Project каждая программная единица описывается с помощью рецепта сборки. Язык описания рецепта напоминает "bash" c возможностью вставок частей кода на языке "python".\nОсновную информацию по синтаксису вы можете почерпнуть из\nруководства Yocto Project\nНабор рецептов сборки в зависимости от назначения можно объединять в отдельные слои сборки. В нашем случае все дополнительные рецепты которые расширяют функциональность базового дистрибутива Yocto, c минимальным количеством пакетов - "core-image-minimal" и привносят в него нужную нам функциональность "сетевого шлюза" будут храниться в слое\n"meta-router-bs"\n.\nСлой\n"meta-router-bs"\nпрописывается в конфигурационном файле poky-router/build/conf/bblayers.conf в момент установки Poky (система сборки в рамках Yocto Project), см. главу Установка Yocto Project в Ubuntu этого документа (bash скрипт установки).\nСтруктура слоя "meta-router-bs"\nДля внесения нужной нам функциональности мы по возможности будем использовать так называемые дополнения для рецептов, которые располагаются в файлах с расширением .bbappend. В файле .bbappend вы можете добавить собственные вызовы команд для штатного метода рецепта сборки, например в метод do_install, do_configure, do_compile  и т.д. В слое нашего шлюза находятся:\nconf\n- конфигурация слоя;\nrecipes-connectivity\n- рецепты сборки сетевых сервисов;\nrecipes-core\n- базовые репепты, настройка сетевых интерфейсов и стартовая заставка;\nrecipes-kernel\n- рецепт относящийся к сборки linux ядра;\nrecipes-router-bs\n- рецепт сборки прошивки с функциональностью шлюза.\nПакет поддержки платформы "Orange Pi"\nДля того, чтобы собрать дистрибутив для Orange Pi Zero в Yocto Project существует отдельный слой -\nmeta-sunxi.\nНа\ngithub\nон располагается по адресу:\nhttps://github.com/linux-sunxi/meta-sunxi.\nПлата которую мы выбрали - "Orange Pi R1" идентична плате "Orange Pi Zero" (за исключением дополнительной встроенной сетевой платы), и поэтому для сборки прошивки под нее мы будем указывать платформу\nMACHINE="orange-pi-zero"\nСлой "meta-sunxi" хорошо работает прямо из коробки, это значит что нам пока без надобности знать особенности аппаратной работы и тонкости конфигурации Orange Pi Zero (все настройки можно оставить по умолчанию), т.е. нам достаточно подключить этот "BSP" слой в "Poky", и после сборки образа аппаратная поддержка платы Orange Pi R1 (Orange Pi Zero) будет включена в наш дистрибутив "router-bs".\nПоддержка USB сетевых плат в "Orange Pi Zero"\nКонечно в идеале нам необходимо взять плату с двумя встроенными сетевыми интерфейсами\nOrange Pi R1\n, и далее это главу вы можете пропустить\nЕсли же по какой то причине у вас есть под рукой только плата Orange Pi Zero, то рассмотрим гипотетический вариант использования второй, внешней USB => Ethernet сетевой платы. Таким же образом в дальнейшем вы можете подключить любое дополнительное оборудование (ну если конечно в Linux ядре это оборудование уже поддерживается).\nДля корректной работы сетевой платы в Linux нам потребуется две вещи:\nПоддержка Linux ядром определенной сетевой платы;\nНаличие в системе модуля ядра для определенной сетевой платы.\nВозьмем к примеру сетевую плату Readyon RD-KY88772A, скорости подключения до 100 Мб/сек нам достаточно. Найдем чипсет на котором плата работает - это AX88772A разработка фирмы "ASIX".\nТеперь найдем название параметра в конфигурации ядра отвечающую за драйвер чипсета AX88772A, лучше всего поискать сочетание слов "AX88772A cateee.net" (на google.com)\nгде "cateee.net" - сайт с полным описанием конфигураций модулей ядра Linux\nСразу находим название конфигурации ядра -\nCONFIG_USB_NET_AX8817X\nи название нужного нам модуля ядра\nasix -\nhttps://cateee.net/lkddb/web-lkddb/USB_NET_AX8817X.html\nДалее нам необходимо удостовериться, что в той версии ядра linux которое мы будет собирать в рамках Yocto Project, нужная нам конфигурация поддерживается, для этого мы можем в начале собрать ядро командой\n"bitbake linux-mainline"\nсм. Краткую инструкция по созданию прошивки в конце статьи\nA затем посмотреть сохраненный файл с текущей конфигурацией ядра:\npoky-router/build/tmp/work/orange_pi_zero-poky-linux-gnueabi/linux-mainline/4.15-r0/defconfig\nВ нашем случае поддержка сетевой платы отсутствует, потому что\nнет строки CONFIG_USB_NET_AX8817X\nи мы можем добавить эту поддержку с помощью включения фрагментов конфигураций ядра (см. следующую главу).\nДля включения в образ поддерживаемых модулей ядра описанных в defconfig, в файле рецепта router-bs-image.bb  мы можем указать пакет\n"kernel-modules"\n. Это добавит все собранные модули в наш образ, увеличив его\n~ на 28 Mбайт\n, но позволит избавиться от части проблем с оборудованием.\nАльтернативным вариантом является явное указание названия модуля, у нас это "kernel-module-asix"\nМеханизм поддержки фрагментов конфигураций ядра\nВ Yocto Project вы можете создать небольшой конфигурационный файл, в котором указать только те параметры ядра, которые вам необходимы, и эти параметры будут добавлены к параметрам по умолчанию, которые уже входят в ядро, которое вы собираете (правда это не всегда работает для некоторых BSP слоев, но в нашем примере, мы покажем как эту функциональность добавить вручную)\nнапример так:\nфайл router-extra.cfg\nФайл будет располагаться по следующему пути:\nrouter-bs/meta-router-bs/recipes-kernel/linux/files/router-extra.cfg\nЧтобы подключить фрагмент конфигураций для нашей сборки ядра (у нас версия 4.15 )\nнам необходимо добавить дополнение для рецепта сборки:\nrouter-bs/meta-router-bs/recipes-kernel/linux/linux-mainline_4.15.bbappend\nСледующего содержания:\nНастройка сетевого интерфейса шлюза\nНастройки сети нашего шлюза на конечном устройстве будет храниться в файле "/etc/network/interfaces" поэтому для замены исходного файла с настройками, необходимо включить в наш слой дополнение для рецепта, файл будет располагаться в нашем слое по такому же пути как и файл основного слоя, т.е. в Pokу рецепт храниться по пути:\npoky-router/meta/recipes-core/init-ifupdown/init-ifupdown_1.0.bb\nу нас файл с дополнением будет располагаться:\npoky-router/meta-router-bs/recipes-core/init-ifupdown/init-ifupdown_1.0.bbappend\nCледующего содержания:\nВ нашем расширении рецепта init-ifupdown_1.0.bb мы указываем, что в секцию "do_configure", а именно в конец секции (на это указывает строка "_append") мы добавляем команду копирования нашего файла с конфигурацией шлюза "interfaces-router" поверх существующего штатного файла "interfaces".\nУказание SRC_URI += "file://interfaces-router" говорит рецепту о том что файл с указанным именем располагается по пути FILESEXTRAPATHS_prepend := "${THISDIR}/files:" (в начало списка FILESEXTRAPATHS добавляется путь с каталогом "files" текущего каталога)\nСодержимое файла с конфигураций "files/interfaces-router":\nЗдесь представлена настройка IP-адреса шлюза по умолчанию. Отредактируйте файл конфигурации files/interfaces-router, например так:\nauto eth1\niface eth1 inet static\naddress 10.0.8.1\nnetmask 255.255.255.0\ndns-nameservers 208.67.222.123 208.67.220.123\nГде:\niface eth1 inet static\n- указывает, что интерфейс находится в диапазоне адресов IPv4;\naddress 10.0.8.1\n- указывает что IP адрес нашей сетевой карты 10.0.8.1;\nnetmask 255.255.255.0\n- указывает что наша маска подсети имеет значение 255.255.255.0;\ndns-nameservers 208.67.222.123 208.67.220.123\n- адреса DNS серверов\nЕще в конфигурации сетевого интерфейса вы можете прописать адрес шлюза более верхнего уровня\ngateway xxx.xxx.xxx.xxx\n(обычно данную информацию предоставляет провайдер). Запись\nauto eth1\n- указывает что интерфейс eth1 необходимо включать автоматически при загрузке системы\nВ приведенном выше примере используются немаршрутизируемые адреса для локальной сети, и данный сетевой интерфейс eth1 будет считаться внутренним (закрытым из вне), для него адрес шлюза указывать не нужно\nВ качестве адресов DNS у нас указаны бесплатные общедоступные серверы OpenDNS, с фильтрацией "взрослого содержимого" т.е. по умолчанию у нас получается маршрутизатор для\n"\nМалышей"\n.\nДля работы устройства в качестве шлюза, вам необходимо похожим образом настроить первый сетевой интерфейс eth0, который будет считаться внешним (открытым из Интернета).\nВсе параметры конфигурации в этом случае вы должны взять у своего "Интернет Провайдера" т.е. компании поставщика услуг на доступ в Интернет\nНастройка DHCP сервера на шлюзе\nНаш "Шлюз" будет выполнять роль DHCP сервера (протокол динамической конфигурации узла). Настройки DHCP сервера на конечном устройстве будут храниться в файле\n"/etc/dhcp/dhcpd.conf"\nпоэтому для замены исходного файла с настройками, нам необходимо включить в наш слой\nmeta-router-bs\nрецепт сборки версии dhcp_4.4.1.bb\nв Pokу рецепт храниться по пути:\npoky-router/meta/recipes-connectivity/dhcp/dhcp_4.3.6.bb\nУ нас файл с новым рецептом dhcp_4.4.1 будет располагаться:\npoky-router/meta-router-bs/recipes-connectivity/dhcp/dhcp_4.4.1.bb\nКонфигурационные файлы которые мы подправим "dhcpd.conf" и "default-server"\nбудут находиться в каталоге\npoky-router/meta-router-bs/recipes-connectivity/dhcp/files\nСодержимое файла с конфигураций "dhcpd.conf"\n"default-server"\n- файл конфигурации, который содержит имена сетевых интерфейсов\nна которых DHCP сервер будет работать,в нашем случае это будет имя внутреннего сетевого интерфейса шлюза\nINTERFACES="eth1"\nddns-update-style\n- схема обновления DNS, в настоящий момент не используется, параметр none\ndefault-lease-time\n- время по умолчанию в секундах на которое сервер выделяет ip адрес клиенту, пока действует lease-time сервер не может отдать данный ip-адрес другой машине. Пока ip-адресов больше чем компьютеров в сети, допустим офисная сеть, где все машины стационарны то lease-time можно ставить побольше, тот же месяц. Тогда и вероятность, что машина получит при включении другой адрес будет минимальна. А если адресов не так много, а компьютеры меняются часто, допустим кафе и wi-fi доступ, то lease-time нужно поменьше, например 1 час. У нас в примере время lease-time равно 36000 сек. (10 часов)\nmax-lease-time\n- максимальное время на которое выделяется ip адрес клиенту у нас в примере время max-lease-time равно 72000 сек. (20 часов)\nДалее в блоке subnet указываем адрес нашей сети, сетевую маску, диапазон ip адресов которые будут использоваться, адрес(а) DNS серверов, которые по буквенному имени домена возвращают ip адрес (обычно назначается вашим провайдером), маска подсети и адрес шлюза.\nИтак мы указали основной минимальный набор параметров, которые необходимы для работы DNS сервера на нашем "Шлюзе".\nФильтрация сетевых пакетов - функции "Брандмауэра"\nВ linux фильтрация пакетов происходит на уровне ядра операционной системы в модуле\n"netfilter"\nи управляется утилитой\niptables.\nТак как правила настройки iptables крайне сложные и запутанные мы будем использовать, удобную утилиту, которая позволяет в простой пользовательской форме задать эти правила, без необходимости изучения "iptables". Для настройки будет использована программа скрипт, программа\nShorewall.\nShorewall использует правила описания каждого из аспектов фильтрации в отдельном файле, и при запуске использует\nPerl\nдля разбора файлов и генерации правил уже в формате "iptables".\nКонфигурация "Зоны" шлюза\nПравила хождения пакетов в Shorewall используют абстракцию зон — все сети, которые вы хотите обрабатывать, надо как-то обозвать. Для начала следует определиться с названиями зон. В нашем случае их будет 3:\nfw\n- необходимая зона, содержащая сам файрволл;\nnet\n- провайдерская сеть;\nloc\n- локальная (или домашняя) сеть с DHCP.\nКонфигурация получается примерно такой: файл zones, путь на целевом устройстве -\n/etc/shorewall/zones,\nпуть в Poky -\npoky-router/meta-router-bs/recipes-connectivity/shorewall/files/zones\nИнтерфейсы и хосты\nПосле описание зон, необходимо распределить их между сетевыми интерфейсами, файл interfaces:\nПуть на целевом устройстве\n/etc/shorewall/interfaces\nПуть в Poky\npoky-router/meta-router-bs/recipes-connectivity/shorewall/files/interfaces\nПараметр "\ndetect\n" говорит shorewall автоматически определить широковещательный адрес, его можно прописать и вручную, например так: 10.0.8.255 для внутреннего сетевого интерфейса с ip адресом 10.0.8.1, см. выше.\nОпция\ntcpflags\n- пакеты, поступающие на этот интерфейс проверяются на наличие определенных незаконных комбинаций TCP флагов.\nОпция\nrouteback\n- заставляет весь трафик, пришедший через интерфейс X, возвращаться к отправителю через него же (без этого практически не обойтись в ситуации, когда провайдеров несколько).\nОпции\nnosmurfs,logmartians\n- разные по своему действию, но близкие по духу параметры, заставляющие Shorewall обращать внимание на пакеты, которых "точно не должно быть на этом интерфейсе". Так, пакеты с широковещательным адресом отправителя отклоняются (nosmurfs), "марсиане" (пакеты с некорректным исходным адресом) протоколируются (logmartians).\nОпция\nroutefilter\nпредписывает включить в ядре фильтрацию по маршруту, но пользоваться им следует с осторожностью: в схеме с несколькими исходящими каналами возможны трудно диагностируемые неполадки.\nОпция\ndhcp\n- сообщает, что на интерфейсе выполняется DHCP-клиент или сервер;\nПолитики\nПосле разделения окружающего мира на зоны, обязательно нужно определить политики т.е. набор правил которые действуют для пакетов, самая правильная политика по умолчанию "все запрещено", а то что разрешено явно указывается в виде отдельных правил.\nНеобходимо определить политики для всех возможных направлений пробегания трафика. Лучше всего в конец дописать дефолтную политику, а чуть выше — исключения: переменная\nFW\nявляется служебной и содержит имя зоны брандмауэра.\nПуть на целевом устройстве\n/etc/shorewall/policy;\nПуть в Poky\npoky-router/meta-router-bs/recipes-connectivity/shorewall/files/policy.\nНастройка трансляции сетевых адресов NAT\nДля того, чтобы все компьютеры из локальной сети могли обращаться в интернет и получать ответ, нам необходимо настроить "Маскарадинг", это когда все запросы в интернет отправляются от имени нашего маршрутизатора, а когда приходит ответ, маршрутизатор автоматически понимает для какого компьютера в локальной сети он предназначается.\nПуть на целевом устройстве\n/etc/shorewall/masq;\nПуть в Poky\npoky-router/meta-router-bs/recipes-connectivity/shorewall/files/masq.\nВ колонке INTERFACE указывается интерфейс назначения т.е. внешний интерфейс подключенный к интернету, в нашем случае это eth0. В поле SOURCE перечисляются адреса (исходящие адреса), для которых нужно применить SNAT-преобразование: здесь, как и во многих реальных случаях, это просто eth1, то есть вся локальная сеть целиком. При желании, имя интерфейса можно заменить явным указанием "серых" адресов (скажем, 192.168.0.0/24). Запретить SNAT для избранных узлов сети можно при помощи следующего синтаксиса:\neth1:!192.168.0.1,192.168.0.3\nКстати, он действует и во многих других конфигурационных файлах Shorewall.\nНастройка правил фильтрации\nДля правильной настройки Shorewall используются определенные правила фильтрации, правила обычно описывают для каких протоколов и портов необходимо разрешить входящий (а иногда исходящий) трафик.\nПуть на целевом устройстве\n/etc/shorewall/rules;\nПуть в Poky\npoky-router/meta-router-bs/recipes-connectivity/shorewall/files/rules.\nВ начале указывается действие (РАЗРЕШЕНИЕ/ЗАПРЕЩЕНИЕ), далее исходящий интерфейс, далее сетевой интерфейс назначения, далее протокол и после этого возможно явно указать номер(а) портов, для которых предназначено данное действие.\nТак же по причине безопасности роутера, не рекомендуем вам оставлять возможность удаленного администрирования роутера из Интернета, пример правила: "SSH(ACCEPT) net $FW" в этом случае как минимум необходимо подобрать сложный пароль администратора (root), а также не использовать порт 22 по умолчанию, так как в любой открытой сети всегда приходят пакеты по протоколу ssh с попыткой автоматического подбора пароля.\nТакой перебор выполняется специальными программами сканерами в автоматическом режиме, и в 95% случаев достаточно изменить номер стандартного порта, что бы случайным образом не оказаться взломанным\nНастоятельно не рекомендуем заниматься перенастройкой Shorewall подключившись извне, как как при задании неверных правил и последующей перезагрузкой Shorewall, можно добиться блокирования собственного доступа\nОстановка Shorewall\nКогда файервол останавливается, маршрутизация разрешается на те хосты, которые указаны в файле\nroutestopped:\nПуть на целевом устройстве\n/etc/shorewall/routestopped;\nПуть в Poky\npoky-router/meta-router-bs/recipes-connectivity/shorewall/files/routestopped.\nВ данном случае мы указываем что после остановки Shorewall разрешена маршрутизация на любые адреса (\n"-"\nзначит "0.0.0.0/0") c внутреннего сетевого интерфейса\nПРИМЕЧАНИЕ:  если вы хотите полностью очистить правила внесенные Shorewall в "netfilter", вы должны выполнить команду\n«shorewall clear»\nКонфигурация Shorewall\nОсновной конфигурационный файл расположен:\nПуть на целевом устройстве\n/etc/shorewall/shorewall.conf;\nПуть в Poky\npoky-router/meta-router-bs/recipes-connectivity/shorewall/files/shorewall.conf.\nВ этом файле лежит конфигурация парсера, некоторые особенности поведения. За основу был взять конфигурационный файл из примера настройки Shorewall, файл является достаточно большим и подробно вы можете изучить его самостоятельно. Пример конфигурационного файла на целевом устройстве\n/usr/share/shorewall/configfiles/shorewall.conf\nПримеры настройки Shorewall\nВ пакет поставки Shorewall входят хорошие, достаточно универсальные примеры настройки для конфигурации сетевых интерфейсов:\nПримечание: путь к конфигурациям указан на целевом устройстве\nили же вы можете посмотреть примеры после сборки прошивки на компьютере:\npoky-router/build/tmp/work/armv7vehf-neon-poky-linux-gnueabi/shorewall/4.4.27-r0.0/shorewall-4.4.27.3/Samples\nРецепт сборки Shorewall для слоя meta-router-bs\nДля того, чтобы собрать пакет Shorewall в нашем дистрибутиве, мы возьмем его рецепт сборки из проекта "OpenEmbedded"\nOpenEmbedded\n— инфраструктура для сборки пакетов для встраиваемого Linux. OpenEmbedded предлагает решение в классе сред для кросс-компиляции. Он позволяет разработчикам создавать целостные дистрибутивы Linux для встраиваемых систем.\nИсходный рецепт можно взять вот отсюда, http://git.openembedded.org/openembedded/plain/recipes/shorewall/shorewall_4.4.14.bb\nИ в дальнейшем модифицируем его, обновив до последней стабильной ревизии в версии 4.4, у нас это\n4.4.27\nДобавим рецепт shorewall_4.4.27.bb в наш слой сборки "meta-router-bs" предварительно немного изменив его, дописав в секцию установки (do_install_append) замену конфигурационных файлов по умолчанию, файлами, описанными выше: zones, interfaces, policy, masq, rules, routestopped и shorewall.conf\npoky-router/meta-router-bs/recipes-connectivity/shorewall/shorewall_4.4.27.bb\npoky-router/meta-router-bs/recipes-connectivity/shorewall/shorewall.inc\npoky-router/meta-router-bs/recipes-connectivity/shorewall/shorewall-deps.inc\nРецепт сборки образа Router-bs\nДля того, чтобы в Yocto Project собрать минималистический дистрибутив "router-bs" нам необходимо добавить файл рецепта router-bs-image.bb в слой "meta-router-bs"\npoky-router/meta-router-bs/recipes-router-bs/images/router-bs-image.bb\nДополнительные рецепты включенные в слой\nВ нашей плате Orange Pi R1 отсутствуют встроенные часы реального времени, а значит после выключения компьютера время сбрасывается, что не очень удобно. И поэтому при старте компьютера, текущее время будет запрашиваться из Интернета. Для этого мы установим сервис\nNTPD.\nСервис ntpd (Network Time Protocol daemon) — программа-демон, которая устанавливает и поддерживает системное время, используется для синхронизации серверами точного времени. Рецепт сборки сервиса ntpd был взят как есть из слоя:\nhttps://github.com/openembedded/meta-openembedded\nна ветке "Sumo".\nПримечание:\nтак же в нашем слое meta-router-bs присутствует рецепт bind_9.11.4.bb новой версии,\nэто зависимость для dhcp_4.4.1.bb и рецепт pps-tools_git.bb от которого зависит ntp_4.2.8p11.bb\nПоддерживаемые платформы\nНиже мы приведем общей список поддерживаемых платформ слоя\n"meta-sunxi"\n, перед публикаций мы проверили сборку прошивки только для плат "Orange Pi R1" и "Orange Pi Zero", но возможность выбора достаточно большая.\norange-pi-zero;\nbananapi;\ncubieboard2;\ncubieboard;\ncubietruck;\nforfun-q88db;\nmele;\nmeleg;\nnanopi-neo-air;\nnanopi-neo;\nolinuxino-a10lime;\nolinuxino-a10s;\nolinuxino-a13;\nolinuxino-a13som;\nolinuxino-a20;\nolinuxino-a20lime2;\nolinuxino-a20lime2-emmc;\nolinuxino-a20lime;\nolinuxino-a20som;\norange-pi-one;\norange-pi-pc;\norange-pi-pc-plus;\norange-pi-zero-plus2;\npcduino.\nНу и конечно мы не могли обойти своим вниманием самую распространенную платформу в среде "Гиков" -\nRaspberry Pi.\nДля сборки прошивки под эту плату в\n"Yocto Project"\nнеобходимо использовать слой\n"meta-raspberrypi".\nЭтот BSP слой поддерживает следующие устройства:\nraspberrypi;\nraspberrypi0;\nraspberrypi0-wifi;\nraspberrypi2;\nraspberrypi3-64;\nraspberrypi3;\nraspberrypi-cm3;\nraspberrypi-cm.\nПримечание: вся функциональность касающаяся платы Raspberry Pi в нашем примере находится на ветке "raspberry-sumo", см. пункт ниже (загрузка проекта с github).\nКраткая инструкция по созданию прошивки\n1) Загрузите\n2) Установите\n3) Соберите\n4) Время сборки\n5) Запишите проект\nАдминистративный пароль по умолчанию\nВ образе Router-bs по умолчанию включена учетная запись:\nroot\n- пользователь;\nrouterbs\n- пароль по умолчанию.\nВНИМАНИЕ: обязательно смените пароль по умолчанию на собственный\nПароль можно сменить выполнив команду passwd на самом устройстве, или в случае самостоятельной сборки в файле рецепта\nrouter-bs-image.bb\n.\nПервое включение устройства\nВ том случае если вы не перенастроили проект под ваше сетевое окружение, а сразу включили Orange Pi R1, вы можете подключиться к вашему шлюзу по протоколу\nSSH\n(команда ssh root@192.168.0.1 c другого компьютера) по ip адресу по умолчанию:\n192.168.0.1.\nДля этого вы должны подключить кабель к первому сетевому интерфейсу (eth0), если вы не знаете, какой интерфейс у вас первый, то вы можете последовательно подключить сетевой кабель вначале к одному интерфейсу и проверить, ответ на команду ping, а затем и ко второму. Тот интерфейс, который первым ответит и будет искомым. Если вы не получили ответ ни по одному сетевому интерфейсу, то вначале проверьте находитесь ли вы в правильной подсети 192.168.0.0.\nЕсли все равно ответ не получен, то что то пошло не так и в этом случае мы можете подключить технологический последовательный интерфейс UART к Orange Pi R1 и таким образом понять состояние устройства.\nЗапись прошивки на карту памяти microSDHC\nСобранный образ будет располагаться по пути\npoky-router/build/tmp/deploy/images/orange-pi-zero\nНа последний успешно собранный образ всегда будет указывать символическая ссылка:\nrouter-bs-image-orange-pi-zero.sunxi-sdimg\nт.е. poky-router/build/tmp/deploy/images/orange-pi-zero/router-bs-image-orange-pi-zero.sunxi-sdimg, cам файл будет содержать достаточно длинное имя c датой создания и временем в UTC например такое: router-bs-image-orange-pi-zero-20180916164236.rootfs.sunxi-sdimg.\nДля записи прошивки на карту памяти используется команда\ndd\n. Запуск команды dd выполняется от имени администратора, при этом необходимо указать входной файл и устройство подключения карты памяти "microSDHC", например /dev/sdX, где X может быть a,b,c и т.д. в зависимости от предыдущих подключенных дисковых разделов.\nПроще всего название определить по выводу команды\nblkid\n. Наберите команду\nsudo blkid\nдо подключения карты памяти - "microSDHC" и далее наберите команду\nsudo blkid\nпосле подключения карты памяти - "microSDHC"\nи тот новый раздел который появился в выводе последней команды и будет искомым. Отмонтируйте разделы карты памяти - "microSDHC" например так, если разделов несколько:\nВ команде dd указывается имя диска целиком т.е. без номера раздела так как в образе содержатся таблицы двух разделов, первый раздел загрузочный диск формата fat16, и второй раздел ext4 - корневая файловая система ОС Linux\nПримечание:\nтекущем каталогом в примере указанном ниже является каталог\npoky-router/build\nВНИМАНИЕ: все предыдущие данные на карте памяти "microSDHC"\nпосле выполнения операции записи будут удалены.\nИтак в заключении статьи хотелось бы отметить, что\n"Yocto Project"\nдостаточно мощный инструмент для сборки специализированных дистрибутивов для встраиваемых систем. В нашем обзоре, мы показали как собрать прошивку с крайне ограниченным набором функций для платы Orange Pi R1.\nКонечно каждый инструмент имеет как свои плюсы, так и свои минусы. На наш взгляд главным достоинством подобного инструмента является то, что у вас есть полный контроль над исходным кодом вашей прошивки, а все остальное дело техники, т.е. в любой момент вы можете подключить нужный вам патч в Linux Kernel, обновить DHCP, обновить NTP, обновить Shorewall, установить любой дополнительный "Open Source Soft" под ваши нужды.\nНет похожих записей\nОцените статью:\n2\n5,00\nTweet\nPin It\n	https://losst.ru/setevoj-shlyuz-na-orange-pi-r1-i-yocto-project	116
\.
